(31, NULL, 2, 4, NULL, 'Zoea', 'Sekalive - The Role Model', '../catalog/posters/sekalive280523.png', 'An original comedy special by Daniel Omara\r\n\r\nFeaturing: \r\n- Rusine\r\n- Ambasador waba consomateri\r\n- Admin\r\n- Mavide and Pazo\r\n- Arthur and Seka Rising stars\r\n\r\nGates Open at 6PM', 'Kigali Cultural Village, KN 3 Avenue, Kigali, Rwanda', '', '2023-05-28', '0000-00-00 00:00:00', '0000-00-00', '0000-00-00 00:00:00', '', 43, 81, 96, 'Ended'),
(32, NULL, 8, 8, NULL, 'Zoea', 'Yoga session at Nyandungu Eco -Park', '../catalog/posters/b5459ff3d68df61a785d8274f3d13ec83de4e065Screen Shot 2023-05-31 at 10.44.37.png', '', 'Nyandungu Urban Wetland Eco-tourism Park, Kigali, Rwanda', '', '2023-06-04', '0000-00-00 00:00:00', '0000-00-00', '0000-00-00 00:00:00', '', 3, 12, 75, 'Ended'),
(33, NULL, 8, 11, NULL, 'Zoea', 'Nyandungu Eco Park', '../catalog/posters/ece5ac533a782c3b4cdc821f22ad8cd7ad4e4079Screen Shot 2023-05-31 at 10.54.33.png', 'The rapid growth of Kigali and the associated human activities have put significant pressure on the wetlands. Wetlands,\r\nincluding Nyandungu, have been degraded and this led to biodiversity loss. Encroachment has also resulted in downstream\r\nflooding as well as increased pollution due sewage outflows.\r\nIn 2016, the Government of Rwanda through the Rwanda Environment Management Authority (REMA) developed the\r\nNyandungu restoration project to respond to these challenges and demonstrate the potential of wetlands to abate pollution and\r\nreduce the risk of flooding in urban areas.\r\nSince then, the Ryf 4.5 billion project, funded by the Rwanda Green Fund (FONERWA) with support from the UK Government,\r\nIS APR BBC an.. the Italian Government through the Ministry for Ecological Transition and the UN Environment Programme, has restored critical\r\ny 2023\r\nhabitats, including a native fig forest and the wetland itself, and rehabilitated streams and ponds to alleviate\r\nfloods and reed-beds to reduce pollution.', 'Nyandungu Urban Wetland Eco-tourism Park, Kigali, Rwanda', '', '2024-12-31', '0000-00-00 00:00:00', '0000-00-00', '0000-00-00 00:00:00', '', 202, 102, 90, 'Ended'),
(34, NULL, 2, 4, NULL, 'Zoea', 'SEKA LIVE', '../catalog/posters/1b0a66d1e9030cb1c74870075a9bd224da798f99WhatsApp Image 2023-06-06 at 18.35.32.jpeg', '', 'Kigali Cultural Village, KK 31 Avenue, Kigali, Rwanda ', '', '2023-06-25', '2023-06-25 06:00:00', '2023-06-25', '2023-06-25 23:00:00', '', 8, 47, 17, 'Ended'),
(35, NULL, 8, 3, NULL, 'Zoea', 'Waka warrior race 2023', '../catalog/posters/5becc2ec206b2595e800fa0db2e419babbaafa60Screenshot 2023-06-24 at 5.15.14 PM.png', 'PACKAGE INCLUDES FOR EACH TICKET\r\nADULT\r\n+ PARTICIPATE IN THE RACE\r\n+ GET ONE WAKA SWAG ITEM\r\n+ TRANSPORT\r\n+ 2 FREE DRINKS\r\n+ FREE 3-MONTHS EDEN CARE DIGITAL HEALTH INSURANCE\r\n+ FREE BABYL HEALTH SCREENING AT RACE\r\n+ QUALIFY FOR RAFFLE PRIZES\r\n+ SPECTOR ENTRY\r\n+ AFTERPARTY ACCESS @IRONMAN RACE RWANDA', 'GSF\'s Field of Dreams Cycling Center, Nzoea, Bugesera, Rwanda', '', '2023-07-22', '0000-00-00 00:00:00', '2023-07-22', '0000-00-00 00:00:00', '', 90, 86, 17, 'Ended'),
(36, NULL, 8, 6, NULL, 'Zoea', 'Giants of Africa Festival Opening ceremony', '../catalog/posters/e2f3af1263eceed4593ba52b890ac27dfd39bd8dScreenshot 2023-06-24 at 5.22.23 PM.png', 'The Opening Ceremony celebration will kick off the week with a parade of athletes representing the 16 African countries participating in\r\nyouth basketball festival, as well as an electrifying concert from Tanzanian Bongo Flava recording artist and award-winning superstar\r\nDiamond Platnumz.\r\nHosted by award-winning sportscaster Carol Tshabalala, the celebration will also feature captivating sounds from Massamba intore,\r\nmusician, songwriter and founder of Gakondo music group accompanied by a performance choreographed by Sherrie Silver, an MTV\r\nAward-winning choreographer and United Nation\'s IFAD Advocate for Rural Youth,', 'BK Arena, KG 17 Avenue, Kigali, Rwanda', '', '2023-08-13', '0000-00-00 00:00:00', '2023-08-13', '0000-00-00 00:00:00', '', 25, 88, 36, 'Ended'),
(37, NULL, 2, 4, NULL, 'Zoea', 'Sekalive', '../catalog/posters/a385a1f8f3103285d37a06f8bcf4db657643fa6csekalive.jpeg', 'Get ready to LOL at Sekalive Comedy Show on July 30th, 2023! Join us at Kigali Cultural Virage for a night of non-stop laughter. Tickets: 10,000 RWF (Regular), 15,000 RWF (VIP). Don\'t miss this hilarious event! #SekaliveComedyShow #KigaliCulturalVirage #GetReadyToLaugh', 'Kigali Cultural Village, KN 3 Avenue, Kigali, Rwanda', '', '2023-07-30', '2023-07-06 18:00:00', '2023-07-30', '2023-07-06 18:00:00', '', 55, 79, 29, 'Ended'),
(38, NULL, 2, 4, NULL, 'Zoea', 'Sekalive', '../catalog/posters/Seka live 4th Loyiso Gola copy 2.jpg', 'Get ready to laugh your heart out at &quot;Sekalive&quot; â€“ the ultimate comedy extravaganza happening on August 27th, 2023, at Compa Kigali. Join us for hilarious performances, side-splitting sketches, and an evening filled with non-stop laughter. Doors open at 6 PM. Secure your spot now with tickets starting from 10,000 RWF. See you there for a night of endless giggles!', 'Kigali Cultural Village, KN 3 Avenue, Kigali, Rwanda', '', '2023-08-27', '2023-08-27 18:00:00', '2023-08-27', '2023-08-27 22:00:00', '', 99, 33, 37, 'Ended'),
