(285, NULL, 0, 7, '2024-09-29 14:34:33', 'Zoea', 'Afro Fusion Dance Class', '../catalog/events/16cc2094c021049c37849a40e4ad965917d94b1d1727342071755_file_IMG_2339.jpeg', 'Afro Fusion Dance Class with Manzi Mbaya  \r\nEvery Tuesday | 6:00 PM â€“ 8:00 PM \r\n\r\nJoin Rwandan dance sensation and choreographer Manzi Mbaya for an exhilarating Afro Fusion dance class every Tuesday. Fusing traditional African rhythms with contemporary urban moves, this class is designed for dancers of all levels seeking to expand their artistic expression and deepen their connection to African culture.\r\n\r\nManzi Mbaya, founder of the Move Afrika Dance Camp, is a master of blending dance styles and has trained at the renowned Ecole de Sable  in Senegal. His unique approach to Afro Fusion blends precision, creativity, and powerful storytelling through movement. Students will explore dynamic choreography, improve their technique, and build confidence under Manziâ€™s expert guidance, known for his contagious energy and passion.\r\n\r\nWhether youâ€™re a beginner or an experienced dancer, this class offers a fun and dance skills and beyond.', 'The Pink House Kigali, KG 670 Street, Kigali, Rwanda', '', '2024-11-26', '2024-11-26 09:30:00', '2024-11-26', '2024-11-26 09:30:00', '', 43, 30, 0, 'Ended'),
(286, NULL, 0, 11, '2024-09-29 14:38:56', 'Zoea', 'Twilight Picnic and Film SoirÃ©e 2.0', '../catalog/events/dc4fad5a852deb58b634ae62da970f706a8f8a341727189245356_file_IMG_7336.jpeg', 'weâ€™re taking the magic up a notch! Prepare yourself for an evening overflowing with even more fun, laughter, and enchanting moments. From delectable picnic spreads and delightful conversations to captivating film screenings under the twilight sky, every detail has been thoughtfully enhanced to ensure an unforgettable experience.', 'AMASHYO GROUNDS, KG 145 Street, Kigali, Rwanda', '', '2024-10-05', '2024-10-05 16:00:00', '2024-10-05', '2024-10-05 16:00:00', '', 0, 0, 0, 'Ended'),
(287, NULL, 0, 10, '2024-09-29 14:43:33', 'Zoea', 'Jameson Hangout', '../catalog/events/5bf555feeb629923fab061a6cbb5bc8f7f9bf71f1727271727589_file_IMG_6958.jpeg', 'Welcome to Jameson Hangout, the perfect excuse to gather your friends, sip some whiskey, and vibe out to live beats. Brought to you by the same crew behind the Login In Party (yes, those party legends), weâ€™re turning Mundi Center into the ultimate chill zone. Expect games, great food, and a whole lot of fun. So grab your crew, grab a drink, and letâ€™s make some memories you may or may not remember tomorrow. See you there!', 'Mundi Center, KN 3 Road, Kigali, Rwanda', '', '2024-10-05', '2024-10-05 15:00:00', '2024-10-05', '2024-10-05 15:00:00', '', 0, 0, 0, 'Ended'),
(288, NULL, 0, 10, '2024-09-29 14:54:30', 'Zoea', 'The WKND Social', '../catalog/events/7bff9086d2e2ab979a2bdb1652c11f445498bbbd1726069841568_file_Copy of The WKND Social_General Video Reel.png', 'The Social Club Presents...The WKND Social!\r\n\r\nThis is a social event for the music lovers, fashion lovers, fashion trendsetters and good vibe people. Let\'s have a good time!\r\n\r\nThe theme for this edition is &quot;Fashion Killa&quot; so go crazy and bring on the cool threads. There will be a prizes for some of the best dressed!\r\n\r\nWe have Dj Lamper, Dj Yolo from Rwanda, and a special female guest DJ coming in from South Africa to get you dancing and singing along all night long. \r\n\r\nGet your limited tickets now.\r\n\r\nEarly Bird - 10k\r\nRound 1 Pre-sold - 12k\r\nRound 2 Pre-sold - 15k\r\nAt the door - 20k', 'Lemon Kigali, KG 623 St, Kigali, Rwanda', '', '2024-10-05', '2024-10-05 06:00:00', '2024-10-05', '2024-10-05 06:00:00', '', 0, 0, 0, 'Ended'),
(289, NULL, 0, 17, '2024-09-29 15:01:41', 'Zoea', 'Misty Brunch', '../catalog/events/ee4bb0e7c83ab02bbaa04778390c84279344b3cc1727176853673_file_WhatsApp Image 2024-09-24 at 1.19.34 PM.jpeg', 'Kigali\'s hottest brunch experience! Dive into a day of bottomless bites, signature cocktails, and unlimited mimosas, all while vibing to the beats of DJ Alza and DJ Fiston. It\'s the perfect blend of great food, great drinks, and even better vibes. This is the brunch you didnâ€™t know you needed. Donâ€™t miss out on the most talked about event in town!', 'KG 270 Street, Kigali, Rwanda', '', '2024-10-06', '2024-10-06 11:00:00', '2024-10-06', '2024-10-06 11:00:00', '', 0, 0, 0, 'Ended'),
