(331, NULL, 150, 21, '2024-10-17 16:38:17', 'Zoea', 'Children\'s Book Lecture', '../../catalog/events/a7f97408010a96e484407e23290efa79b6ab3af1event.jpg', 'CHILDRENS BOOK LECTURE\n\nAt the 19th of October, we are planning several events on the topic of children\'s literature. In this regard, we have invited several contemporary Rwandan children\'s book authors and publishers to our institute on Saturday, 19 October. They will present their latest publications and bring along a large book table that will provide a good overview. All children are cordially invited to this reading and we look forward to a colourful and lively Saturday with you.\n\n🗓️ Thursday, 19th of October\n🕒 3 pm\n📍  Goethe Institute Kigali, 13 KN 27 Street, Kiyovu\n🏷️ free', 'Goethe-Institut', '', NULL, '2024-10-19 15:00:00', NULL, NULL, '', 0, 0, 0, 'Ended'),
