(335, NULL, 150, 5, '2024-10-17 16:42:43', 'Zoea', 'Les Merveilles du Quotidien', '../../catalog/events/32bec3aaa054504fe69022a7deea28732fd1b52aevent.jpg', 'LES MERVEILLES DU QUOTIDIEN - exposition photographique par Alice Kayibanda et Christel Arras 📷\n\n“Cette exposition invite les visiteurs à saisir les moments simples du quotidien, trop souvent tenus pour acquis. À travers les œuvres, on encourage une nouvelle appréciation des petits détails oubliés qui façonnent nos vies.” 🍃\n\nLors du vernissage, découvrez une performance de Christel Arras en écho avec l’exposition 🎁\n\n📅 Du 17 au 24 octobre\n🥂 Vernissage le 17 octobre à 18h30\n📍 CCFR\n💵 Gratuit\n🤝 Impundu Arts en partenariat avec CCFR\n\nBonne journée 👋', 'Centre Culturel Francophone du Rwanda', '', NULL, '2024-10-24 18:30:00', NULL, NULL, '', 0, 0, 0, 'Ended'),
