(337, NULL, 150, 17, '2024-10-17 16:51:03', 'Zoea', 'Salsa and Tacos Night', '../../catalog/events/bbfd6084680e054ce9fc1db70bfc207adcc90758event.jpg', '🔥 THE SALSA EVENT YOU’VE BEEN WAITING FOR IS FINALLY HERE! 💃🕺\n\nDear dance lovers, you asked for it, and Indochine made it happen! Get ready for an unforgettable night at Salsa &amp; Tacos Night this Saturday, October 20th, starting from 5 PM at Bel Ombre Hotel, Nyaruzoea! 🎉\n\n🌮 Delicious Tacos - A variety of fillings, including meat, vegetables, and vegetarian options to delight your taste buds.\n🍣 Savory Sushi - Discover our fresh and authentic selection, prepared by our chefs.\n💃 Salsa Dancing - Dance sessions for all levels with a professional instructor to guide you!\n🎶 Festive Atmosphere - Lively music and a friendly, welcoming vibe guaranteed!\n🍺 Special Promotion - Buy 3 beers, get the 4th one FREE!\n\n🔥 Don’t miss this chance to enjoy a memorable evening in great company. Invite your friends and join us to dance the night away! 🎊\n\n📍 Indochine Restaurant, Bel Ombre Hotel, Nyaruzoea, Kigali\n📞 For more details: +250 780 006 956\n\nWe can’t wait to see you there! Get ready to light up the dance floor! 💃🔥', 'Indochine Restaurant, Nyaruzoea', '', NULL, '2024-10-24 17:00:00', NULL, NULL, '', 0, 0, 0, 'Ended'),
(338, NULL, 150, 0, '2024-10-17 16:51:55', 'Zoea', 'Musanze Trip', '../../catalog/events/087a3a0a1724fa29b8afc0c4f5ff3b2b0ada57c8event.jpg', '🌋 Don\'t Miss Out on Our Musanze Camping Adventure! ⛺🍖\n\nHey there! 😊 Just a friendly reminder that our Musanze camping trip with stunning volcano views is almost here! 🌄🔥\nGet ready for an exciting night under the stars, a cozy bonfire, and a delicious BBQ! 🍗🌟 If you\'re still interested, now\'s the perfect time to secure your spot.\nFeel free to reach out with any questions—we’d love to have you join us for this unforgettable experience! 😊', '', '', NULL, '2024-10-25 16:00:00', NULL, NULL, '', 0, 0, 0, 'Ended'),
