(341, NULL, 150, 2, '2024-10-17 16:58:38', 'Zoea', 'East Africa Real Estate Round Table', '../../catalog/events/e99e5e46e629a37646f9e79532b5a38f79e97407event.jpg', '*Save the Date:* 26th October 2024, 6 PM - 10 PM CAT  🇷🇼 \n\nWe are excited to invite you to the _*East Africa Real Estate Round Table (EARERT)*_ event, which will be *live-streamed* to those in the diaspora and those unable to attend in person. *Special invite only* due to capacity.\n\nThis event will focus on _*&quot; Unlocking the Dual Realities of Foreign Direct Investment and Migration in the Rwandan Housing Sector: Government Strategies for Mitigation.&quot;*_ Key industry leaders and decision-makers will discuss investment opportunities, housing trends, and strategies to navigate the evolving real estate landscape in Rwanda.  🇷🇼 \n\n*Don\'t miss this opportunity* to gain valuable insights and connect with experts in the field!', 'Mythos, 590 KN 50 St', '', NULL, '2024-10-26 18:00:00', NULL, NULL, 'https://www.eventbrite.co.uk/e/east-africa-real-estate-round-table-earert-virtual-kigali-tickets-1040717854117', 0, 0, 0, 'Ended'),
