(404, NULL, 0, 10, '2024-12-16 07:17:58', 'Zoea', 'Afrohub Homecoming w. Theecember', '../catalog/events/4b9c27cd7a30baf30e9bbb421061fcf9ef18b5991733937655313_file_70236683-5e49-4010-9b67-3171446c4277.jpeg', '***DRESS CODE: RED AND WHITE***\r\nPartnering with Afrohub, we are bringing up and coming Burundian sensation Theecember along side DJ Tity and Waklexx from Canada  and Ry from Kigali.\r\nTheecember is a rising singer-songwriter and producer. He burst onto the global stage in March 2022 when he released a 60-second freestyle to Pheelz\'s viral sensation \'Finesse\', an electrifying performance that paved the way for his contribution to the official East Africa remix of \'Finesse\' alongside Tanzanian star Rayvanny. Since then,\r\nTheecember has released an array of singles including \'Gumako\', \'Back to You\', and, most recently, \'Uransaza, a mesmerizing afro-pop track that effortlessly weaves together French, English, Swahili, and Kirundi, the artist\'s native language.', 'Mundi Center, KN 3 Road, Kigali, Rwanda', '', '2024-12-20', '2024-12-20 19:00:00', '2024-12-20', '2024-12-20 19:00:00', 'https://www.sinc.events/afrohub_ho_84', 1, 0, 0, 'Ended'),
