(586, 951, 0, 10, '2025-01-14 14:00:16', 'Sinc', 'IKAZE After Party', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1736854849984_file_16-compressed', 'Join us for the inaugural Ikaze Party, a celebration of unity and self-expression, presented by Revolte in partnership with Petit Suisse Club. \"Ikaze,\" meaning \"welcome\" in Kinyarwanda, invites you to come as you are and immerse yourself in an unforgettable evening.\n\nLive Music & DJ: Experience an eclectic mix of genres, featuring local and international music to  keep you dancing all night long.\nComplimentary Welcome Shot: Kick off the night with a free shot upon entry when you purchase your ticket online.\nGourmet Delights: Savor a selection of exquisite dishes and cocktails crafted by Petit Suisse Club\'s renowned chefs and mixologists.', 'Petit Suisse Lounge&Club', '[-1.958672,30.1144575]', '2025-01-17', '2025-01-17 18:00:40', '2025-01-18', '2025-01-18 00:00:40', 'https://www.sinc.events/ikaze_afte_898', 0, 0, 0, 'Upcoming'),
