(589, 953, 0, 10, '2025-01-16 07:00:07', 'Sinc', 'Afro Fusion Dance Class ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1735570970576_file_IMG_3320', 'Afro Fusion Dance Class with Manzi Mbaya Every Tuesday | 6:30 PM – 8:00 PM Join Rwandan dance sensation and choreographer Manzi Mbaya for an exhilarating Afro Fusion dance class every Tuesday. Fusing traditional African rhythms with contemporary urban moves, this class is designed for dancers of all levels seeking to expand their artistic expression and deepen their connection to African culture. Manzi Mbaya, founder of the Move Afrika Dance Camp, is a master of blending dance styles and has trained at the renowned Ecole de Sable in Senegal. His unique approach to Afro Fusion blends precision, creativity, and powerful storytelling through movement. Students will explore dynamic choreography, improve their technique, and build confidence under Manzi’s expert guidance, known for his contagious energy and passion. Whether you’re a beginner or an experienced dancer, this class offers a fun and dance skills and beyond.', 'The Pink House Kigali', '[-1.9528976,30.0797059]', '2025-01-21', '2025-01-21 16:30:27', '2025-01-21', '2025-01-21 18:00:27', 'https://www.sinc.events/afro_fusio_96_edition_24', 0, 0, 0, 'Upcoming'),
