(620, 1013, 0, 10, '2025-02-20 06:03:21', 'Sinc', 'The Creative Class', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1738594999395_file_IMG_9227.png', 'Bridging the Gap presents: The Creative Class – a space for curated hands-on learning and collaboration. This new initiative expands Bridging the Gap’s mission by offering opportunities tailored for creatives looking to elevate their craft and career.\n\n\nWhat can you expect at The Creative Class?\n- A fireside chat with two prominent industry figures\n- Skill-focused workshops led by subject experts\n- A networking session to connect with fellow creatives and potential collaborators\n\n\nParticipants can sign up for two of the following workshops:\n\n- Creative Branding & Marketing – Position yourself and your work for success.\n- Strategy for Businesses in Creative Industries – Build a sustainable career.\n- Being a Creative in the Digital Age – Leverage digital tools to expand your reach.\n\n\nWhether you’re a full-time creative or balancing a side hustle, this is your chance to invest in your craft, gain industry knowledge, and take your creative journey to the next level!\n\nAre you ready to expand your toolbox?', 'Norrsken House Kigali', '[-1.9511719,30.0599932]', '2025-02-22', '2025-02-22 11:00:22', '2025-02-22', '2025-02-22 15:00:22', 'https://www.sinc.events/the_creati_930_edition_2', 0, 0, 0, 'Upcoming'),
