(675, 1117, 0, 10, '2025-03-06 08:00:16', 'Sinc', 'RESONATOR', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1741246400095_file_1000470229', 'RESONATOR brings a tidal wave of techno, house, and trance music to Kigali - with a formidable sound system, an industrial warehouse venue, and international DJs pushing progressive electronic music.\nTap into a new frequency at RESONATOR.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-03-15', '2025-03-15 19:00:35', '2025-03-16', '2025-03-16 00:00:35', 'https://www.sinc.events/resonator_712', 0, 0, 0, 'Upcoming'),
(676, 1118, 0, 10, '2025-03-06 12:00:12', 'Sinc', 'JaBA #3 - Sounds For The Musically Aware', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1741232246075_file_Final%20Web', 'JaBA Vol. 3: Bigger, Bolder, and Unmissable!\n\nKigali, Rwanda – March 2024 – After two electrifying editions, JaBA Vol. 3 returns on Friday, May 3rd, bringing even more energy to Depot37 inside Mundi Center.\n\nJaBA is more than just a party—it’s a movement. Co-created by Broadcite (UK) and AFROGROOV, it celebrates the fusion of music, art, and community, curating immersive experiences that push the boundaries of African and global electronic sounds.\n\nA Lineup Curated for the Culture\n\n🎧 T-Roy (Broadcite, UK) – Afro, broken beat, and electronic tastemaker.🎧 Eric Soul (AFROGROOV) – Afro-fusion DJ & curator.🎷 Water Sax – Hypnotic sax improvisations.\n\nThey’ll be joined by special local & international guests—to be announced soon! Expect groundbreaking sounds, immersive vibes, and an unforgettable night of musical exploration.\n\n#JaBA #JaBAVol3 #CuratedExperiences\n\n#JaBA #JaBAVol3 #CuratedExperiences\n\n', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-05-03', '2025-05-03 18:00:25', '2025-05-04', '2025-05-04 01:00:25', 'https://www.sinc.events/jaba_3_723', 0, 0, 0, 'Upcoming'),
(677, 1119, 0, 10, '2025-03-06 15:00:15', 'Sinc', 'Ignite Fridays ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1741269721241_file_IMG_9698', '🔥 IGNITE FRIDAYS – SHOW TIME AT CADILLAC NIGHTCLUB! 🔥\n\nThis Friday, we’re turning all the way up at Cadillac Nightclub with a FIRE lineup that’s guaranteed to keep you moving! Get ready for DJ Julzz, DJ Brian, DJ Cad, DJ Fabbi, and our special guest DJ Diallo—bringing the best in Afrobeats, Amapiano, Hip-Hop, and club bangers all night long!\n\n🚀 Non-stop vibes, high-energy beats, and a dancefloor that won’t quit! Whether you’re sipping, vibing, or shutting it down on the dancefloor, this is the place to be!\n\n📍 Venue: Cadillac Nightclub\n🎧 DJs: DJ Julzz, DJ Brian, DJ Cad, DJ Fabbi & Special Guest DJ Diallo\n📅 Date: This Friday\n\nTag your squad and pull up—it’s about to get crazy! #IgniteFridays #CadillacNightclub #TurnUpVibes', 'Cadillac Night Club', '[-1.945379,30.06139]', '2025-03-06', '2025-03-06 14:27:49', '2025-03-08', '2025-03-08 07:01:49', 'https://www.sinc.events/ignite_fri_112_edition_4', 0, 0, 0, 'Happening'),
(678, 1121, 0, 10, '2025-03-07 07:00:13', 'Sinc', 'JAMMY SATURDAY 🎶 Women\'s Day Edition', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1741328451575_file_JAMMY%20SATURDAY', '🌟 Jammy Saturday – Women’s Day Edition with Mikamis! 🌟\n\nThis Saturday, March 8th, we’re celebrating Women’s Day at Lemon Kigali with great music, delicious food, and exclusive discounts for the ladies! 💃✨\n\n⏳ Special Happy Hour (6-8 PM) – For Women Only!\n🍸 50% OFF all cocktails\n🍽️ 20% OFF meals\n\n🎶 Live Performance by Mikamis\n📍 Lemon Kigali, KG 623 St, Kimihurura\n🎟️ Free Entry!\n\nBring your girls and let’s make it a night to remember! ', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-03-08', '2025-03-08 16:00:16', '2025-03-08', '2025-03-08 18:00:16', 'https://www.sinc.events/jammy_satu_792', 0, 0, 0, 'Upcoming'),
