(685, 1129, 0, 10, '2025-03-10 11:00:10', 'Sinc', 'Afro Hybrid Workshop with Honore Hartel ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1741601751431_file_Screenshot_20250310-121447_Gallery', 'Afro Hybrid Dance Workshop is where Afro-dance meets different modern styles, bringing energy, rhythm, and creativity together. Led by Honore Hartel, this session will help you explore new movements, improve your groove, and enjoy the joy of dance. Whether you\'re a beginner or experienced, this workshop is all about learning, expressing, and having fun! \n📅 3rd Edition: Wednesday, March 12th \n📍 Location: Zedance Studio, Kigali \n⏰ Time: 6:30 PM – 8:00 PM 🎟️ Book your spot now! Let’s move, vibe, and grow together!', 'Ze Dance Studio', '[-1.9685954,30.0580519]', '2025-03-12', '2025-03-12 16:30:56', '2025-03-12', '2025-03-12 18:00:56', 'https://www.sinc.events/afro_hybri_165_edition_3', 0, 0, 0, 'Upcoming'),
