(697, 1146, 0, 10, '2025-03-19 10:00:16', 'Sinc', 'KOMPA NIGHT @ LEMON 🍋 ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742377728291_file_IMG_9727', 'Kompa Night  Friday 21ST  MARCH\n@lemonkigali\n\nFree entrance for ladies between 7-8pm\nWith @dj_lamper\n\n@deejay_arthur\n\n@danny_latino250 \n\nDoors open at 7pm\n\nFREE SHOTS EVERY HOUR FROM 9PM TO 11PM\n\nVip area booking:\n+250 780 691 569 or e-mail: lemonkigali@gmail.com\n\nRooftop located in Kimihurura KG 623 St, Kigali.', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-03-21', '2025-03-21 17:00:23', '2025-03-22', '2025-03-22 00:00:23', 'https://www.sinc.events/kompa_nigh_201_edition_27', 0, 0, 0, 'Upcoming'),
(698, 1147, 0, 10, '2025-03-19 16:00:12', 'Sinc', 'ShashaGirana X Afrosynethsis', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742397906731_file_WhatsApp%20Image%202025-03-18%20at%2017.00.58_b3cf1072', 'Join us on March 29th, 4 PM - 11 PM at K’Mawa, Kigali for a night of powerful cultural fusion & urban excellence!\n\n✨ LIVE MUSIC & COLLABORATIONS\nExperience a groundbreaking performance as Muti Musa, Jimmy Star, and Manzi blend traditional and contemporary sounds into a new sonic movement.\nPremier their new EP.\n\n🔥 DJ LINEUP\nVibe to the electrifying sets of Lion Eyes, DJ Viper, and DJ K, spinning the best of Afrohouse, Hip Hop, and global rhythms.\n\n🥁 DRUM CEREMONY\nWitness the legendary Intwari Club in a powerful drum ritual, uniting past and present in a rhythmic celebration.\n\n🗣️ PANEL DISCUSSION & CULTURE\nEngage in thought-provoking conversations on the future of African creative expression with leading voices from music, art, and fashion.\n\n👕 FASHION POP-UP\nDiscover unique styles from visionary designers pushing the boundaries of tradition and innovation.\n\n🍔 FOOD & DRINKS\n🔥 Burgers & Chicken Tenders by Perfect Bite\n🍹 Signature cocktails by Bistro\n\n🔥 A night to remember!', '12 KG 13 Ave', '[-1.9471739,30.1024572]', '2025-03-29', '2025-03-29 16:00:39', '2025-03-29', '2025-03-29 23:00:39', 'https://www.sinc.events/shashagira_1035', 0, 0, 0, 'Upcoming'),
(699, 1149, 0, 10, '2025-03-20 09:00:09', 'Sinc', 'MARCH Madness at ADV', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742459510818_file_IMG_9695', 'GRVND and Dj Joe the Drummer This Friday at Atelier 🚀🚀', 'Atelier du Vin', '[-1.9674015,30.089817]', '2025-03-21', '2025-03-21 09:01:26', '2025-03-22', '2025-03-22 01:31:26', 'https://www.sinc.events/march_madn_159', 0, 0, 0, 'Upcoming'),
(700, 1148, 0, 10, '2025-03-20 09:00:09', 'Sinc', 'Umuco, N\'umucyo Utazima', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742417803087_file_Umulisa', '✨ Friday Igitaramo with Umulisa Liliane! ✨\n\nJoin us for an unforgettable evening of culture and music at Ijuru Restaurant & Lounge on Friday, March 28th from 6:00 PM! 🎶\n\n🌟 Theme: Umuco, N\'Umucyo Utazima\n📍 Venue: ONOMO Hotel Kigali\n🎟️ Fee: 20,000 RWF per person | 90,000 RWF per table of 6\n\nLet’s come together to celebrate our heritage and support an incredible artist! If you cannot attend but wish to support Umulisa Liliane, you can contribute via MOMO Code 0700070 (Waramutse Rwanda Ltd).\n\n📞 Info & Reservations: +250 790 700 070 ', 'Onomo Hotel', '[-1.9481634,30.0721298]', '2025-03-28', '2025-03-28 16:00:37', '2025-03-28', '2025-03-28 21:00:37', 'https://www.sinc.events/umuco_nu_1093', 0, 0, 0, 'Upcoming'),
(701, 1074, 0, 10, '2025-03-20 10:00:14', 'Sinc', 'Inspire Africa Conference', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1740137887624_file_Main%20Banner', 'WHO?\nBringing together local and international product and training leaders to drive impact in the African product community.\n\nAimed at product curious, product practitioners, leaders, product teams or founders and entrepreneurs in Africa.\n\nWHAT?\nAfrica’s Largest Tech Product Conference offers:\n\n-Upskilling by world-renowned product experts\n\n-Job readiness training by Worknigeria and employment partners\n\n-Networking opportunities in Africa and around the world\n\n-Insight into career opportunities for product experts\n\n-Paths to funding for Founders\n\nWHY?\nInspire Africa Conference is perfect if you’re looking to explore the teachings of Silicon Valley Product Group (SVPG), the essence of product and the trends and key concepts in tech.\n\n-We’re passionate about  upskilling African product experts.\n\n-We want to empower the product community in Africa, for Africa.\n\n\n', 'Kigali Marriott Hotel', '[-1.9537135,30.0621258]', '2025-10-14', '2025-10-14 07:00:24', '2025-10-16', '2025-10-16 16:00:24', 'https://www.sinc.events/inspire_af_1012', 0, 1, 0, 'Upcoming'),
(702, 1143, 0, 10, '2025-03-20 11:00:09', 'Sinc', 'The Breakthrough Circle - Fix Your Finances', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742138366325_file_PHOTO-2025-03-13-19-07-17', 'Fix Your Finances – March 29th at 2 PM | Lemon Kigali\n\nMoney isn’t just about numbers—it’s about the relationship you have with it. How you earn, how you spend, and how you feel about money all shape your financial reality.\n\nThis session is about understanding yourself and your relationship with money on a deeper level. We’ll explore both the inner work—the mindset, habits, and beliefs that shape your finances—and the practical tools to navigate income, spending, and financial systems in a way that actually works for you.\n\n✨ Shift the way you think about money so it stops feeling like a source of stress\n✨ Learn how to balance income and spending with more clarity and control\n✨ Walk away with simple, actionable strategies to improve your finances\n\nIf you’re ready to take a more empowered approach to your money—without the guilt or overwhelm—join us at Lemon Kigali on March 29th at 2 PM.', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-03-29', '2025-03-29 12:00:58', '2025-03-29', '2025-03-29 15:00:58', 'https://www.sinc.events/the_breakt_1084', 0, 0, 0, 'Upcoming'),
(703, 1151, 0, 10, '2025-03-20 17:00:15', 'Sinc', '🏆 Beerpong (Amateur!) World Cup 🍻', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1742489546550_file_Lemon%20Kigali%20Events%20Design%20Template%20%2844%29', '🏆 Beerpong (Amateur!) World Cup 🍻\n\"The Most Fun Sports Tournament in Kigali!\"\n\nSponsored by SKOL 🍺🏅\n\n📅 Date: Saturday, March 22nd\n⏰ Time: 6 - 8 PM\n📍 Venue: Lemon Kigali\n\n🔥 Think you’ve got what it takes? Join the tournament and compete for the Trophy + Sponsor Awards!\n\n🎟 Entry Fee: 10,000 RWF (Includes 5 beers/soft drinks for the tournament)\n👥 Open to All | 🎯 Fun, Drinks & Competitive Spirit!\n\n🔗 Sign Up Now!\n\nLet the games begin! 🍺🏆', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-03-22', '2025-03-22 16:00:03', '2025-03-22', '2025-03-22 18:00:03', 'https://www.sinc.events/beerpon_792', 0, 0, 0, 'Upcoming'),
