(733, 1182, 0, 10, '2025-03-30 15:00:15', 'Sinc', 'Chess Grand Prix', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743341535136_file_IMG_0447', '♟️ Join Our Exciting Chess Tournament! ♟️\n\nTest your skills in a 6-round Swiss tournament with a 15+5 time control and battle it out for cash prizes, trophies, and medals!\n\n🎯 First Round: 10:00 AM\n🏆 Award Ceremony: 5:00 PM\n\n✅ Registration Fee: 10K (Includes breakfast & lunch)\n❌ Not FIDE Rated\n\nSecure your spot and be part of an intense day of strategic battles! ♟️🔥 #ChessTournament #SwissFormat #ChessBattle', 'UR College of Science and Technology', '[-1.958692,30.0642158]', '2025-04-05', '2025-04-05 08:01:01', '2025-04-05', '2025-04-05 15:00:01', 'https://www.sinc.events/chess_gran_771', 0, 0, 0, 'Upcoming'),
