(735, 1183, 0, 10, '2025-04-01 08:00:13', 'Sinc', 'Acoustic by Ruti Joel', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743494162028_file_IMG_9811', 'Get ready for an unforgettable evening of music and good vibes as Ruti Joel takes the stage at Pili Pili for a special live acoustic performance! 🌙🔥\n\nExpect smooth melodies, soulful rhythms, and an intimate atmosphere that will have you lost in the music. Whether you\'re coming for the music, the ambiance, or just a great time with friends, this night promises to be one to remember.\n\nCome through, soak in the vibes, and let Ruti Joel’s voice take you on a journey. Good music, good people, and good energy—just the way it should be. 🎶🍷✨', 'Pili Pili', '[-1.931313,30.1102637]', '2025-04-04', '2025-04-04 17:00:40', '2025-04-04', '2025-04-04 21:15:40', 'https://www.sinc.events/acoustic_b_1118', 0, 0, 0, 'Upcoming'),
(736, 1186, 0, 10, '2025-04-01 10:00:12', 'Sinc', 'Afro Hybrid Dance Workshop with Honore Hartel ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743498021323_file_Screenshot_20250401-105600_Gallery', 'Afro Hybrid Dance Workshop is where Afro-dance meets different modern styles, bringing energy, rhythm, and creativity together. Led by Honore Hartel, this session will help you explore new movements, improve your groove, and enjoy the joy of dance. Whether you\'re a beginner or experienced, this workshop is all about learning, expressing, and having fun! 📅 4th Edition: Wednesday April 2nd 2025📍 Location: Zedance Studio, Kigali ⏰ Time: 6:30 PM – 8:00 PM 🎟️ Book your spot now! Let’s move, vibe, and grow together!', 'Ze Dance Studio', '[-1.9685954,30.0580519]', '2025-04-02', '2025-04-02 16:30:00', '2025-04-02', '2025-04-02 18:00:00', 'https://www.sinc.events/afro_hybri_165_edition_4', 0, 0, 0, 'Upcoming'),
(737, 1187, 0, 10, '2025-04-01 20:00:11', 'Sinc', 'Happiness Day', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743513558958_file_Black%20%26%20Yellow%20Typographic%20%20International%20Day%20of%20Happiness%20Social%20Media%20Graphic', 'Happiness Day at The Circle 🎉✨\n\nJoin us this Sunday for a special gathering dedicated to joy, connection, and celebrating mental well-being. Often, when we talk about mental health, we focus on struggles—this event is about embracing happiness and shared moments!\n\nWhat to expect:\n🎶 Live music & spoken word\n🎲 Fun games & friendly competitions\n💃 Dancing & meaningful conversations\n🍦 Drinks & ice cream\n♻️ Clothes exchange\n\n📍 Location: The Circle, Kacyiru\n⏰ Time: 3 PM!\n\nCome as you are and bring a friend! 💛', '108 KG 5 Ave', '[-1.9395847,30.0764114]', '2025-04-06', '2025-04-06 13:00:44', '2025-04-06', '2025-04-06 18:00:44', 'https://www.sinc.events/happiness_978_edition_3', 0, 0, 0, 'Upcoming'),
(738, 1188, 0, 10, '2025-04-01 21:00:13', 'Sinc', 'LAST LAST ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743539883777_file_98B34E06-BA6F-4514-9737-69858A0E8392', 'We’re excited to remind you that our [Event Name] is just 4 days away! This is an event you won\'t want to miss, and we’d love for you to be part of it.', 'Onomo Hotel', '[-1.9481634,30.0721298]', '2025-04-05', '2025-04-05 21:00:46', '2025-04-06', '2025-04-06 01:00:46', 'https://www.sinc.events/last_last_1073_edition_2', 0, 0, 0, 'Upcoming'),
(739, 1189, 0, 10, '2025-04-02 05:00:21', 'Sinc', 'Cadillac on A Sato 5 April 2025 w. DJ Dawee', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743567375072_file_A8D0B8CA-7E7E-4641-9276-6EF3B66F3472', 'Cadillac on A Sato at Cadillac we have a special guest DJ Dawee, a Reggae, Dancehall, Soca, Tropical Bass & Afrobeats\n DJ & MC from the Berlin-based sound system and label SWS.\n\nTogether with his crew, Dawee influenced the German and European Caribbean music scene in the 2000s and 2010s, and he played shows all around Germany, Europe, the UK, the US, Africa, and Asia, including on the main stages of major festivals such as Ostroda Reggae Festival Poland (2008, 2009), Lake of Stars Festival Malawi (2015, 2016), Shoko Festival Zimbabwe (2016, 2016), Bushfire Festival Swaziland (2016), Kol Fest Kyrgyzstan (2019 - 2022) and VolkanoFest Rwanda (2023).\n\nOver the last 20 years, Dawee has been travelling the world, and he has taken his music with him. Before moving to Kigali in 2022, he lived in Kyrgyzstan and set up Kol Fest, by now Central Asia\'s largest music and arts festival. \n', 'Cadillac Night Club', '[-1.945379,30.06139]', '2025-04-05', '2025-04-05 18:00:38', '2025-04-06', '2025-04-06 07:00:38', 'https://www.sinc.events/cadillac_o_84_edition_52', 0, 0, 0, 'Upcoming'),
(740, 1190, 0, 10, '2025-04-02 09:00:11', 'Sinc', 'KOMPA NIGHT @ LEMON 🍋', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1743583452431_file_IMG_0142', 'Kompa Night  Friday 4TH  MARCH\n@lemonkigali\n\nFree entrance for ladies between 7-8pm\nWith @dj_lamper\n\n@deejay_arthur\n\n@danny_latino250 \n\nDoors open at 7pm\n\nFREE SHOTS EVERY HOUR FROM 9PM TO 11PM\n\nVip area booking:\n+250 780 691 569 or e-mail: lemonkigali@gmail.com\n\nRooftop located in Kimihurura KG 623 St, Kigali.', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-04-04', '2025-04-04 17:00:17', '2025-04-05', '2025-04-05 00:00:17', 'https://www.sinc.events/kompa_nigh_201_edition_30', 0, 0, 0, 'Upcoming'),
