(774, 1229, 0, 10, '2025-04-22 14:00:08', 'Sinc', 'Introduction to Yoga Session', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1745327979721_file_ChatGPT%20Image%20Apr%2022%2C%202025%2C%2003_19_09%20PM', 'Join us this Saturday at The Circle for a gentle introduction to Yoga Session with the graceful Rosé Uwineza. Whether you’re brand new to yoga or simply looking to reconnect with your body, this class offers a slow, supportive space to move, breathe, and unwind.\n\nExpect grounding postures, mindful breathwork, and a nurturing atmosphere designed to help you feel centered and restored. No prior experience is needed—just come as you are, bring your mat (or borrow one), and be open to the practice.\n\nThe session will be in Kinyarwanda with English translation when needed.', 'Kacyiru', '[-1.939329,30.0809664]', '2025-04-26', '2025-04-26 14:30:02', '2025-04-26', '2025-04-26 15:00:02', 'https://www.sinc.events/introducti_978', 0, 0, 0, 'Upcoming'),
