(847, NULL, 1645, 0, '2025-05-10 12:04:13', 'Zoea', 'SUD KIGALI', '../../catalog/events/7ab6ad8ee89ebe9ea6b9fbe612e011c1c3cb8ef3event.jpg', 'Welcome to My Sud Resto &amp; Bar – More Than Just a Dining Experience!\n\nAt My Sud Resto &amp; Bar, we offer more than great food and drinks — we provide an all-in-one destination for relaxation, entertainment, and memorable stays. Whether you’re visiting for a night out or a longer escape, you’ll find everything you need right here.\n\nOur Services Include:\n	•	Restaurant &amp; Bar: Enjoy a diverse menu and refreshing drinks in a vibrant atmosphere.\n	•	Comfortable Accommodation: Stay in our cozy, well-appointed rooms for a restful night.\n	•	Free Swimming Pool Access: Take a dip and unwind with complimentary access to our pool.\n	•	Movie Nights &amp; Games: Join us for regular movie nights and enjoy movie-themed games for all ages.\n	•	Karaoke &amp; Live Events: Show off your vocal talents or just enjoy the fun with regular karaoke nights and special events.\n	•	Free Wi-Fi: Stay connected throughout your visit, whether you’re working or unwinding.\n\nWhether you’re a traveler, a local, or planning a group event, My Sud Resto &amp; Bar is your go-to spot for food, fun, and comfort — all in one place.', '6 KG 672 St, Kigali, Rwanda', '', NULL, '0000-00-00 00:00:00', NULL, NULL, '', 0, 0, 0, 'Pending'),
