(853, 1304, 0, 10, '2025-05-12 12:00:12', 'Sinc', 'LOVE & CARE: A Mothers’ Workshop', 'https://dbmhau7o59w3r.cloudfront.net/1747050224890-file-Amour+et+Soin_+Soutenir+les+Parents', 'LOVE & CARE: A Mothers’ Workshop is a gentle and empowering space designed to support mothers in their emotional and mental wellbeing. Led by Ishimwe Christella, a clinical psychologist, this session will focus on how caring for yourself as a parent directly strengthens your ability to support and nurture your children.\n\nThrough guided reflections, shared experiences, and practical self-care tools, mothers will leave feeling more grounded, seen, and supported.\n\nWhether you\'re a new mom or navigating parenthood for years, this workshop offers you space to reconnect—with yourself and with others.', '108 KG 5 Ave', '[-1.9395095,30.0756844]', '2025-05-17', '2025-05-17 13:00:56', '2025-05-17', '2025-05-17 15:00:56', 'https://www.sinc.events/love-car-978', 0, 0, 0, 'Upcoming'),
(854, 1303, 0, 10, '2025-05-12 17:00:11', 'Sinc', 'The Love Pitch | 3rd Edition', 'https://dbmhau7o59w3r.cloudfront.net/1747034975645-file-WhatsApp+Image+2025-05-10+at+7.16.48+PM.jpeg', 'THE LOVE PITCH: Singles Only Edition\nNo spectators. Just seekers.\n\nThis isn’t just another night out - this is where curiosity meets chemistry.\n\nExpect live dating pitches, speed dating rounds, games, spontaneous connections, music, drinks, and just the right amount of chaos.\n\nIf you’re single, bold, and tired of swiping - this is your sign.\n\n📍 SUD Kigali\n🗓️ June 7 | 7PM till late\n🎟️ 5K Early | 7K at the door\nSeats are first come, first served - come early.\n\nPlease fill in this form after paying: https://forms.gle/mkVvk5p41xu8ehqs9', 'Sud Kigali', '[-1.9512854,30.0811679]', '2025-06-07', '2025-06-07 17:00:32', '2025-06-07', '2025-06-07 22:00:32', 'https://www.sinc.events/the-love-p-967', 0, 0, 0, 'Upcoming'),
