(883, 1335, 0, 10, '2025-05-20 11:00:09', 'Sinc', 'Sober-friendly Circle', 'https://dbmhau7o59w3r.cloudfront.net/1747737855389-file-ChatGPT+Image+May+20,+2025,+12_43_50+PM', 'Sober-Friendly Circle\nEvery Tuesday | 6:30 PM | With Tsatsi\nAt The Circle, Kigali\n\nThis is a space for anyone walking the path of recovery—whether from alcohol, substances, or anything else you\'re choosing to let go of.\n\nLed by Tsatsi, the Sober-Friendly Circle offers honest conversation, support, and community for those choosing clarity, growth, and a different way of living.\n\nCome as you are. You don’t need to explain, prove, or be perfect.\nJust bring yourself—we meet you there.\n\nRecovery doesn’t have to be lonely. Let\'s walk this road together.', 'The Circle', '[-1.9394982,30.0757012]', '2025-05-20', '2025-05-20 16:30:04', '2025-05-20', '2025-05-20 19:00:04', 'https://www.sinc.events/sober-frie-978', 0, 0, 0, 'Upcoming'),
(884, 1333, 0, 10, '2025-05-20 11:00:09', 'Sinc', 'A Brotherhood Circle', 'https://dbmhau7o59w3r.cloudfront.net/1747736909117-file-ChatGPT+Image+May+20,+2025,+12_27_57+PM', 'Brotherhood Circle\nEvery Wednesday | 6:30 PM | The Circle Kigali\n\nA space for men to pause, reflect, and rise.\n\nThe Brotherhood Circle is a weekly gathering where men—fathers, brothers, sons, and friends—come together to connect, speak freely, and support each other on the path of growth and self-betterment.\n\nNo bravado. No performance. Just honest conversations about what it means to be a man in today’s world—accountable, evolving, and whole.\n\nThis is your circle. Your space to show up.', 'The Circle', '[-1.9394982,30.0757012]', '2025-05-21', '2025-05-21 16:30:44', '2025-05-21', '2025-05-21 19:00:44', 'https://www.sinc.events/a-brotherh-978', 0, 0, 0, 'Upcoming'),
