(924, 1369, 0, 10, '2025-05-28 10:00:12', 'Sinc', 'Fuego Fest After Party', 'https://dbmhau7o59w3r.cloudfront.net/1748421018197-file-Tyler+ICU+Fuego+Offcial+After+PArty.jpg', 'Get ready for an unforgettable night as Fuego Fest brings the heat to Kigali! On Friday, May 30, 2025, starting at 6:00 PM, the city will come alive with the electrifying sounds of Amapiano, headlined by South African sensation Tyler ICU. Known for his chart-topping hits like \"Mnike\" and \"Banyana,\" Tyler ICU is set to deliver an energetic performance that will keep the crowd dancing all night long .\n\nThe festivities don\'t end there. Following the main event at Kigali Universe, the party continues with an exclusive after-party at M Hotel Kigali. Located in the heart of the city, M Hotel offers a sophisticated setting with spacious event venues and top-notch amenities, making it the perfect spot to keep the vibes going into the early hours .', 'M Hotel', '[-1.9498467,30.0732428]', '2025-05-30', '2025-05-30 22:00:46', '2025-05-31', '2025-05-31 04:00:46', 'https://www.sinc.events/fuego-fest-1356', 0, 0, 0, 'Upcoming'),
(925, 1371, 0, 10, '2025-05-28 10:00:12', 'Sinc', 'FEAST AND PRAISSE', 'https://dbmhau7o59w3r.cloudfront.net/1748424662272-file-IMG-20250528-WA0000.jpg', 'FEAST AND PRAISE is a Monthly Gospel Experience.\n\nJoin us for the very first edition of FEAST AND PRAISE, a monthly gathering where faith, fellowship, fun, and food come together in celebration of the Lord!\n\nWe’re kicking off this powerful new tradition with a spirit-filled day of praise and worship, led by the anointed Rachel Uwineza as our special guest worship leader. Prepare to lift your hands, raise your voice, and connect deeply with God in a vibrant atmosphere of love and unity.\n\nBut that\'s not all, this isn’t just a worship day, it’s a celebration.\n\nWhat to Expect:\n\nDynamic praise & worship sessions\n\nFun and interactive games with exciting prizes\n\nA warm and welcoming meet & greet with fellow brothers and sisters in Christ\n\nAnd of course, a delicious feast to share and enjoy together!\n\n\nCome with a heart ready to praise, a spirit open to joy, and a stomach ready to eat!\n\n📅 Date: [Insert Date]\n📍 Location: [Insert Venue]\n🕖 Time: [Insert Time]', 'Onomo Hotel Kigali', '[-1.9481634,30.0721298]', '2025-05-31', '2025-05-31 12:00:36', '2025-05-31', '2025-05-31 19:00:36', 'https://www.sinc.events/feast-and-1358', 0, 0, 0, 'Upcoming'),
