(944, 1392, 0, 10, '2025-06-02 13:00:07', 'Sinc', 'SOULFUL HILLS', 'https://dbmhau7o59w3r.cloudfront.net/1748868269242-file-IMG_1811.jpeg', 'What’s a better way to start the summer than a Groove Daytime Party😜🕺🏾\nPresenting to you Groove Sundays Edition 1: Soulful Hills 🌄🔥\n\nHappening this Sunday, June 8th at Barafous Garden (Nyandungu) for a full day of vibes from 1PM to 10PM!\n\nVibes Curated by  DJ Lamper • DJ Inno • DJ Pyfo • GRVNDLVNG • Selekta Faba\n\nTheme: Recreate a celebrity’s summer outfit', 'Barafous Garden', '[-1.9617592,30.1637354]', '2025-06-08', '2025-06-08 11:00:44', '2025-06-08', '2025-06-08 21:00:44', 'https://www.sinc.events/soulful-hi-367', 0, 0, 0, 'Upcoming'),
(945, 1393, 0, 10, '2025-06-03 15:00:07', 'Sinc', 'Paradox Afterwork ', 'https://dbmhau7o59w3r.cloudfront.net/1748887948616-file-Modern+Psychedelic+Art+Exhibition+Event+Instagram+Story+(1080+x+1080+px)+(1080+x+1350+px)+(1)', 'PARADOX is where real connection meets good energy.\n\nYou know that feeling when everything contradicts and still somehow makes perfect sense?\nIt’s not a party. It’s not a panel. It’s something in between — and beyond.\n\nThink of it as networking without the pressure, a space for conversations that flow naturally and moments that feel both spontaneous and intentional.\nA gathering where curiosity is welcome, small talk is optional, and good vibes are non-negotiable.\n\nWhether you\'re there to meet new people, spark an idea, or just be in the right kind of energy — PARADOX is the place.\n', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-06-05', '2025-06-05 15:00:30', '2025-06-05', '2025-06-05 21:00:30', 'https://www.sinc.events/paradox-af-1372', 0, 0, 0, 'Upcoming'),
