(950, 1399, 0, 10, '2025-06-04 17:00:09', 'Sinc', 'URUTARE ART STORIES #slampoetryandlivemusic ', 'https://dbmhau7o59w3r.cloudfront.net/1749053200534-file-IMG_8211.jpeg', 'Urutare art stories is an inspiring initiative organized by Cheers Africa that celebrates slam poetry, live music, cinema, and artistic collaboration across African countries. In this edition, we proudly partner with Sudanese creatives to foster deep cultural exchange with Rwandan artists. Urutare art stories is more than just a showcase of talent, it is a platform for learning, collaboration, and creative dialogue. By promoting mutual inspiration and building meaningful cross border partnerships, the initiative aims to strengthen cultural understanding and contribute to the development of a vibrant, inclusive, and sustainable creative economy\n\nExplore within ', 'Tea House Resto and Workspace', '[-1.956236,30.0793904]', '2025-06-28', '2025-06-28 16:00:08', '2025-06-28', '2025-06-28 20:30:08', 'https://www.sinc.events/urutare-ar-69', 0, 0, 0, 'Upcoming'),
