(999, 1405, 0, 10, '2025-06-19 13:00:05', 'Sinc', 'Festival of Sports- Rotary Edition ', 'https://dbmhau7o59w3r.cloudfront.net/1749509739175-file-20250609_185705_0000', 'Join us for the Festival of Sports – Rotary Edition 2025, a dynamic community event taking place on Saturday, 21st June 2025 at International  School  of  Kigali  (ISKR), Kibagabaga, Kigali from 9:00 AM to 4:00 PM.\n\nOrganised by Wura Holdings Ltd, in collaboration with Rotary Sport( UK ), Rotary Club of Kigali Virunga, and Rotary Club of Kigali Golf this one day celebration of unity, wellness, and giving brings together rotarians,  rotractors, Interactors,  families, sports enthusiasts, youth, and businesses through friendly competitions in football, basketball, athletics, volleyball, and more.\n\nBeyond the games, the event is a fundraising initiative supporting the Rotary Cancer Bus Project – a cause dedicated to providing transport for  cancer patients in Kinyinya  Rwanda.\n\nExpect:\n🏆 Exciting games and team challenges\n🎤 Live entertainment & DJs\n🍽️ Food vendors & family-friendly activities\n🎟️ Raffles, giveaways, and sponsor showcases', 'International School of Kigali, Rwanda', '[-1.9288419,30.1096969]', '2025-06-21', '2025-06-21 07:00:52', '2025-06-21', '2025-06-21 14:00:52', 'https://www.sinc.events/festival-o-1384', 0, 0, 0, 'Upcoming'),
