(1004, 1490, 0, 10, '2025-06-20 14:00:06', 'Sinc', 'The Creative Class II : Money Matters', 'https://dbmhau7o59w3r.cloudfront.net/1750424846431-file-ANNOUNCEMENT', 'The Creative Class is a curated learning and networking experience by Bridging the Gap, designed to equip African creatives with the skills, tools, and connections they need to thrive. \n\nEvent Overview\n\nTheme: Money Matters\nThis edition explores how creatives can achieve financial sustainability while staying true to their craft.\n\nFireside Chat\nA candid conversation between leading voices in Rwanda’s creative industry, sharing real experiences around funding, pricing, and building financially sustainable careers.\n\nWorkshops  \nParticipants can choose between two (60 mins) hands-on sessions:\n\nFunding & Financing Your Work with Arnold Kwizera – Learn how to access capital, understand funding pathways, and craft compelling proposals.\n\nMonetizing Creative Talent with Cynthia Butare – Discover business models, pricing strategies, and new income streams for your creative work.\n\nNetworking Mixer\nThe day ends with a relaxed mixer—connect with fellow creatives over music, drinks, and good vibes.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-07-12', '2025-07-12 10:00:44', '2025-07-12', '2025-07-12 15:00:44', 'https://www.sinc.events/the-creati-930', 0, 3, 0, 'Upcoming'),
