(1093, 1615, 0, 10, '2025-07-14 13:00:07', 'Sinc', 'Kigali Cine Junction Opening Night', 'https://dbmhau7o59w3r.cloudfront.net/1752492219384-file-KCJ_POSTER_TICKETS-01.jpg', 'Join us for the Opening Ceremony of Kigali Cine Junction! \n\nWe’re kicking off this year’s festival with an official ceremony followed by the acclaimed film DAHOMEY by Mati Diop.\n\nDAHOMEY is a powerful recount of the return of 26 looted royal treasures from France to Benin. With her signature style, Mati Diop explores the emotional and political ripples of repatriation - what does it mean to reclaim stolen heritage, and who decides how the story is told?\n\n Expect an inspiring ceremony, a gripping story with rich imagery, sharp insight, and an unforgettable start to this year’s cinematic journey.', 'Car Free Zone', '[-1.9440727,30.0618851]', '2025-07-23', '2025-07-23 15:00:39', '2025-07-23', '2025-07-23 19:00:39', 'https://www.sinc.events/kigali-cin-1515', 0, 0, 1, 'Upcoming'),
