(1097, 1620, 0, 10, '2025-07-15 10:00:09', 'Sinc', 'Kigali Cine Junction Day 2', 'https://dbmhau7o59w3r.cloudfront.net/1752510991808-file-KCJ_POSTER_TICKETS-02+(1).jpg', 'Day 2!!\n\nFind the first half of the MAIN SHORT PROGRAM titled INVISIBLE THREADS at CINE MAYAKA (2pm - 4pm).\n\nIf you like high octane action and motorcycles, do not miss a screening of ZION at CINE MAYAKA (4:15pm - 6:30pm)\n\nMaking it\'s African premiere, LE GRAND DEPLACEMENT will be screening at IMBUGA CAR FREE ZONE (6:30pm - 8:30pm)\n\nDon\'t miss out!', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-07-24', '2025-07-24 12:00:04', '2025-07-24', '2025-07-24 18:30:04', 'https://www.sinc.events/kigali-cin-1515-edition-2', 0, 0, 1, 'Upcoming'),
