(1099, 1621, 0, 10, '2025-07-15 12:00:08', 'Sinc', 'Kigali Cine Junction Day 3', 'https://dbmhau7o59w3r.cloudfront.net/1752573654002-file-KCJ_POSTER_TICKETS-03+(1).jpg', 'Day 3!!\n\nFind the second half of the MAIN SHORT PROGRAM titled BORDER CROSSINGS at CINE MAYAKA (2pm - 3:30pm)\n\nEast meets West in the FOCUS ON SENEGAL program at CINE MAYAKA (3:45pm - 6:30pm)\n\nFor our Romantic Night Under The Stars, THE TASTE OF THINGS will be screening at IMBUGA CAR FREE ZONE (5:30pm - 9:00pm)\n\nDon\'t miss out!', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-07-25', '2025-07-25 12:00:04', '2025-07-25', '2025-07-25 19:00:04', 'https://www.sinc.events/kigali-cin-1515-edition-3', 0, 0, 1, 'Upcoming'),
(1100, 1623, 0, 10, '2025-07-15 13:00:10', 'Sinc', 'Kigali Cine Junction Day 4', 'https://dbmhau7o59w3r.cloudfront.net/1752578157136-file-KCJ_POSTER_TICKETS-04+(1).jpg', 'Day 4!!\n\nEast meets West...Again in the FOCUS ON SENEGAL program with films like CAMP DE THIAROYE and AFRIQUE SUR SEINE at CINE MAYAKA (12pm - 4:50pm)\n\nMarking it\'s National Premiere, PHIONA: A GIRL FROM MADRID will be gracing the screen at CINE MAYAKA (5pm - 6:30pm)\n\nRemembrance and Melancholia take a different look under the stars with A REAL PAIN at IMBUGA CAR FREE ZONE (7:30pm - 9pm)\n\nChildren are promised an evening of fun at the screening of SAUVAGES at L*ESPACE (5pm - 9pm)\n\nDon\'t miss out!', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-07-26', '2025-07-26 10:00:04', '2025-07-26', '2025-07-26 19:00:04', 'https://www.sinc.events/kigali-cin-1515-edition-4', 0, 0, 0, 'Upcoming'),
(1101, 1624, 0, 10, '2025-07-15 15:00:11', 'Sinc', 'Kigali Cine Junction Day 5', 'https://dbmhau7o59w3r.cloudfront.net/1752583145033-file-KCJ_POSTER_TICKETS-05+(2).jpg', 'Day 5!!\n\nClermont-Ferrand comes to Kigali with COUPS DE COEUR which offers the best from the Biggest Short Film Festival in the world at CINE MAYAKA (1pm - 3:20pm)\n\nMarking it\'s National Premiere is MINIMALS IN A TITANIC WORLD, the only east african film at BERLINALE 2025 and it\'ll be screening at CINE MAYAKA (4pm - 6pm)\n\nClosing out the festival is another National Premiere, IMIHIGO will be screening at IMBUGA CAR FREE ZONE (7pm - 9:30pm)\n\nDon\'t miss out!', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-07-27', '2025-07-27 11:00:46', '2025-07-27', '2025-07-27 19:30:46', 'https://www.sinc.events/kigali-cin-1515-edition-5', 0, 0, 0, 'Upcoming'),
(1102, 1627, 0, 10, '2025-07-16 09:00:05', 'Sinc', 'Paradox. Day Time Vibes', 'https://dbmhau7o59w3r.cloudfront.net/1752646227632-file-Screenshot+2025-07-16+at+08.10.03', 'After already  two unforgettable editions this summer, we bring you a Paradox Daytime event, and this time, we’re taking over Katina Kigali for a full-on daytime experience.\n\nWhat ? ☀️ Open air and Daylight drinks\n\nSurprise ? 🤘Happy hour from 2 pm to 4pm. Buy 1 cocktail + get 1 for FREE\n\nWhere ? Katina\'s Kafé   \n\nAND\n\n❤️No entry fee from 2pm to 3pm \n\n', '31 KG 8 Ave', '[-1.9548289,30.1054172]', '2025-07-19', '2025-07-19 12:00:13', '2025-07-19', '2025-07-19 23:00:13', 'https://www.sinc.events/paradox-d-1372', 0, 0, 0, 'Upcoming'),
