(1124, 1650, 0, 10, '2025-07-21 15:00:05', 'Sinc', 'Diaspora Day', 'https://dbmhau7o59w3r.cloudfront.net/1753093205088-file-WhatsApp+Image+2025-07-21+at+12.00.51+PM+(1).jpeg', 'A full day of celebration of global Rwandan voices in film, art, and storytelling\n\nJoin us for a powerful special program spotlighting the creativity and impact of Rwandan artists across the diaspora.\n\n-  Panel Discussion with actress Umulisa Gahiga on her journey to starring in the final season of Netflix’s The Sandman.\n\n- Podcast Listening Session – INNOCENT (VATERLAND) by acclaimed filmmaker Amelia Umuhire (Rwanda/Germany), with English & French subtitles.\n\n-  Panel + Performance by multidisciplinary artist Marie Mwiza Ndutiye (Rwanda/France), weaving together dance, film, fashion, and music.\n\n And to close the night—Diaspora Party!\nCelebrate with beats, drinks, and community as we honour Rwandan creativity in all its forms.\n\nDon\'t miss!', 'L’Espace', '[-1.9812387,30.0481897]', '2025-07-24', '2025-07-24 12:00:35', '2025-07-24', '2025-07-24 23:00:35', 'https://www.sinc.events/diaspora-d-1515', 0, 0, 0, 'Upcoming'),
(1125, 1651, 0, 10, '2025-07-21 16:00:09', 'Sinc', 'DIASPORA DAY         Early Birds', 'https://dbmhau7o59w3r.cloudfront.net/1753110711874-file-WhatsApp+Image+2025-07-21+at+12.00.51+PM+(1).jpeg', 'A full day celebrating global Rwandan voices in film, art, and storytelling at l\'Espace, Nyamirambo.\n\nJoin us for a powerful special program spotlighting the creativity and impact of Rwandan artists across the diaspora:\nPanel Discussion with actress Umulisa Gahiga on her journey to starring in the final season of Netflix’s The Sandman\n\nPodcast Listening Session – INNOCENT (VATERLAND) by acclaimed filmmaker Amelia Umuhire (Rwanda/Germany), with English & French subtitles\n\nPanel + Live Performance by multidisciplinary artist Marie Mwiza Ndutiye (Rwanda/France), blending dance, film, fashion, and music\n\nAnd to close the night—Diaspora Party! Celebrate with beats, drinks, and community as we honour Rwandan creativity in all its forms.\n', 'L’Espace', '[-1.9812387,30.0481897]', '2025-07-24', '2025-07-24 12:00:43', '2025-07-24', '2025-07-24 23:00:43', 'https://www.sinc.events/diaspora-d-1515', 0, 0, 0, 'Upcoming'),
(1126, 1653, 0, 10, '2025-07-21 19:00:09', 'Sinc', 'Cuff & Keep | Singles Mixer', 'https://dbmhau7o59w3r.cloudfront.net/1753123506939-file-WhatsApp+Image+2025-07-21+at+6.35.55+PM.jpeg', 'Kigali’s most anticipated singles mixer is here.\n\nCuff & Keep - flirty vibes, fire music, games, speed dates, cocktails, and a lil’ chaos.\n\n🍹 Free jello shots at the door (alcoholic + non)\n🎧 DJ on deck\n🔥 BBQ + themed zones + speed dating + games\n\n📍Bicu Lounge | Sat Aug 9 | 7PM till late\n🎟️ 8K early bird | 10K regular\n🎫 Tickets via Sinc: *662*700*967#\n\nOrganized by @thelovepitch\n\n#CuffAndKeep #KigaliNights #SinglesMixer', 'Bicu Lounge', '[-1.9610289,30.085062]', '2025-08-09', '2025-08-09 17:30:26', '2025-08-09', '2025-08-09 22:00:26', 'https://www.sinc.events/cuff-kee-967', 0, 0, 0, 'Upcoming'),
(1127, 1657, 0, 10, '2025-07-22 11:00:04', 'Sinc', 'June Thursdays 24 July 2025', 'https://dbmhau7o59w3r.cloudfront.net/1753180129788-file-White+Blue+Modern+Minimalist+Black+Friday+Portrait+Black+Friday+Flyer+(Instagram+Post+(45))+(1)', '#ThursdaysAreForJune\nattendees will be ID’d at the door, only physical IDs will be allowed. Non-compliance will not be refunded', 'Cocobean', '[-1.9499886,30.0912616]', '2025-07-24', '2025-07-24 20:00:26', '2025-07-25', '2025-07-25 07:00:26', 'https://www.sinc.events/june-thurs-84-edition-13', 0, 0, 0, 'Upcoming'),
(1128, 1652, 0, 10, '2025-07-23 10:00:06', 'Sinc', 'Yewe Muntu Concert by Kenny MIRASANO', 'https://dbmhau7o59w3r.cloudfront.net/1753121508214-file-sinc+flyer', 'Yewe Muntu is a concert-event by Kenny Mirasano, conceived as a vibrant and collective celebration of his musical universe. Following the release of the album and the tour of the same name in March, Kenny returns to the stage with a powerful live performance featuring musicians, dancers, and surprise guest artists. Yewe Muntu blends multiple art forms and will bring together over 30 performers. It’s a moment of joy, a tribute to art and humanity , a musical journey not to be missed!\n', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-08-09', '2025-08-09 17:00:22', '2025-08-09', '2025-08-09 21:00:22', 'https://www.sinc.events/yewe-muntu-1582', 0, 0, 0, 'Upcoming'),
(1129, 1658, 0, 10, '2025-07-23 11:00:05', 'Sinc', 'KOMPA NIGHT @ LEMON 🍋', 'https://dbmhau7o59w3r.cloudfront.net/1753264705180-file-IMG_3361.jpeg', 'Kompa Night  Friday 25TH JULY\n@lemonkigali\n\nFree entrance for ladies between 7-8pm\nWith @dj_lamper & @djreyce\n\n@danny_latino250 \n\nDoors open at 7pm\n\nFREE SHOTS EVERY HOUR FROM 9PM TO 11PM\n\nVip area booking:\n+250 780 691 569 or e-mail: lemonkigali@gmail.com\n\nRooftop located in Kimihurura KG 623 St, Kigali.', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-07-25', '2025-07-25 17:00:20', '2025-07-26', '2025-07-26 00:00:20', 'https://www.sinc.events/kompa-nigh-201-edition-13', 0, 0, 0, 'Upcoming'),
(1130, 1659, 0, 10, '2025-07-23 13:00:09', 'Sinc', 'WHITE PARTY HUYE EDITION ', 'https://dbmhau7o59w3r.cloudfront.net/1753271342054-file-Huye+White+Party+at+Dondada+3.jpg', 'WHITE PARTY HUYE EDITION 2025 organized by DONDADA ENTERTAINMENT.', 'City Snack Resto Bar', '[-2.6035694,29.7406254]', '2025-08-01', '2025-08-01 16:01:27', '2025-08-02', '2025-08-02 02:00:27', 'https://www.sinc.events/white-part-1474', 0, 0, 0, 'Upcoming'),
(1131, 1660, 0, 10, '2025-07-23 14:00:10', 'Sinc', 'Isanzure', 'https://dbmhau7o59w3r.cloudfront.net/1753276937073-file-FLYER+RWANDA+summer+fest+(1)', 'Welcome to ISANZURE, a soulful lakeside experience where nature, culture, and community come together in perfect harmony. Held at the stunning Eagle View Farm, this event blends breathwork, music, movement, and mouthwatering flavors — all under the palm trees, by the water, and surrounded by farm life.\n\nEnjoy live saxophone, traditional performances, guided mindfulness sessions with Hannes Bend (trained by Wim Hof), Enjoy BBQ snacks by Mocha Café, and farm-fresh teas and pineapple juice served in real pineapples. Explore the land with farm tours, hop on a boat ride, or simply relax in the sun with a good drink and good company.\n\n🎟️ is 15,000 RWF for adults and 5,000 RWF for kids, and includes access  activities and the farm tour. Food and drinks are not included.\n\n ISANZURE is designed to grow into a monthly series, evolving with new elements, fresh collaborations, and seasonal surprises. Each edition brings something new while staying grounded in the same joyful, easygoing spirit.\n', 'Eagle View Farm & Lake Retreat', '[-2.2097359,30.2491615]', '2025-07-26', '2025-07-26 09:00:14', '2025-07-26', '2025-07-26 16:00:14', 'https://www.sinc.events/isanzure-814', 0, 0, 0, 'Upcoming'),
(1132, 1662, 0, 10, '2025-07-23 15:00:07', 'Sinc', 'Kigali Cine Junction Block Party', 'https://dbmhau7o59w3r.cloudfront.net/1753280456239-file-IMG_1070', '✨The KCJ Block Party Under The Stars!\n\nA celebration of 48 years of Cine Mayaka (Kwa Mayaka) and a look back at the vintage nights that the cinema is known for.\n\nWear your best 1980-90\'s outfits and get ready for:\n\n- Food\n- ⁠Drinks\n- ⁠Dancing\n- And more!\n\nCome party with us and live a night worth remembering!', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-07-25', '2025-07-25 19:30:05', '2025-07-26', '2025-07-26 00:00:05', 'https://www.sinc.events/kigali-cin-1515-edition-8', 0, 0, 0, 'Upcoming');
