(1147, 1665, 0, 10, '2025-07-27 01:00:06', 'Sinc', 'Twin Lakes Experience: Summer Nights by the Lake', 'https://dbmhau7o59w3r.cloudfront.net/1753523187893-file-COVER+SINC', 'This summer, we don’t just party… we escape.\n\nJoin us on August 30th at the magical Twin Lakes of Ruhondo for an unforgettable night of music, nature, and connection. This is more than a concert — it’s a once-every-two-month escape filled with Afrobeat, Amapiano, bonfires, lakeside vibes, and sunrise hikes.\n\n🔥 Featuring top DJs  who know how to bring the heat:\n  DJ Brian  And  DJ Dialon \n\n🎤 Hosted by Uwase Muyango and Semuhungu Eric — guiding the night with energy, humor, and unforgettable vibes.\n\n✨ And guess what? The lineup is still growing. Expect more surprise guests and local talent to be announced.\n\nWhether you’re camping under the stars or vibing in a luxury tent with your crew, Twin Lakes Experience will leave you refreshed, recharged, and reconnected.', 'Lake Ruhondo', '[-1.4936261,29.7252297]', '2025-08-30', '2025-08-30 12:00:47', '2025-08-31', '2025-08-31 08:00:47', 'https://www.sinc.events/twin-lakes-1604', 0, 0, 0, 'Upcoming'),
