(1193, 1740, 0, 10, '2025-08-09 13:00:06', 'Sinc', 'ANGELL MUTONI LIVE AT BICU', 'https://dbmhau7o59w3r.cloudfront.net/1754595605395-file-Yellow+Black+Bold+Music+Event+Instagram+Story+(Instagram+Post)', 'Introducing Artist Soul Sessions: Unplugged Live \nWe’re thrilled to host our very first artist live session on Thursday the 14th August 2025 with the incredible ANGELL MUTONI. Expect stripped-back beats, raw lyrics, and an intimate vibe like never before.', 'Bicu Lounge', '[-1.9610289,30.085062]', '2025-08-14', '2025-08-14 16:00:29', '2025-08-14', '2025-08-14 22:00:29', 'https://www.sinc.events/angell-mut-1703', 0, 2, 0, 'Upcoming'),
(1194, 1743, 0, 10, '2025-08-09 13:00:06', 'Sinc', 'TEDxKHS Youth', 'https://dbmhau7o59w3r.cloudfront.net/1754671158870-file-see+you+at', 'The theme offers a timeless lens through which we can examine personal growth and social and culture changes, highlighting the interconnections of time and the impact of our decision on our present and future selves. \n\nThe statement “ I am the product of yesterday’s choices, today’s actions, and tomorrow’s dreams. “  puts it all in one phrase. How do we ensure that we are making the right , educated choices and actions to  protect both our present and future?\n\nTo stand on the shoulders of the giants literally means to study from others who came before you and build upon their knowledge. What if what we are facing now  has already been experienced by someone, somewhere? With the rapid advancement of technology everything is accessible. The question is:  how do we use what have in our hands? \n\n This theme isn’t just a tale -- it’s a canvas for our shared journey.\n', 'CanalOlympia Rebero', '[-2.0010403,30.0692849]', '2025-08-29', '2025-08-29 07:00:12', '2025-08-29', '2025-08-29 12:00:12', 'https://www.sinc.events/tedxkhs-yo-1315', 0, 0, 0, 'Upcoming'),
