(1302, 1900, 0, 10, '2025-09-08 21:00:05', 'Sinc', 'Her Body Her Gold – Fibroids, Menopause & Mental Wellness Edition', 'https://dbmhau7o59w3r.cloudfront.net/1757363105830-file-Screenshot_20250905_205249_Gallery', 'Step into an elegant women’s wellness tea-party designed to close the year with knowledge, connection, and renewal.\n\nThis unique gathering will feature:\nExpert Guest Speakers – gynecologists, nutritionists, mental health specialists, fitness/wellness coaches, and women empowerment advocates\n\nReal Conversations on fibroids, menopause, mental wellness & overall wellbeing\n\nWellness Vendors showcasing women-led businesses and health solutions\n\nRaffles & Giveaways – with wellness-inspired prizes such as spa vouchers, skincare hampers, fitness passes, and more\n\nSignature Tea-Party Experience – light refreshments, healthy bites, and sweet delights\n\nWhat You’ll Gain:\n• Knowledge to better manage fibroids, menopause, and mental wellness in everyday life\n •Confidence and motivation to prioritize your health as you enter 2026\n•Peer connections and support networks with like-minded women\n•Elegant tea-party dining, raffles, and memorable wellness takeaways\n\n', 'Kigali', '[-1.9440727,30.0618851]', '2025-12-06', '2025-12-06 14:00:28', '2025-12-06', '2025-12-06 18:00:28', 'https://www.sinc.events/her-body-h-1384', 0, 0, 0, 'Upcoming'),
