(1305, 1909, 0, 10, '2025-09-10 19:00:06', 'Sinc', 'Joy Fest Kigali', 'https://dbmhau7o59w3r.cloudfront.net/1757508915707-file-Joy+Fest_(1080+x+1440+px)_V7', 'Black Soma Kigali & Wellness Community present: Joy Fest\n\nTheme : Celebrating wellness and the everyday ways we can invite joy into our lives — not as separate moments and workshops, but as one continuous, uplifting  flow experience.\n\nSaturday  September 13th  from 9.30 – 4.30pm @ Nature Kigali (Remera)\n\nCost: Free\n\nFamily-friendly wellness event featuring: Affirmation Yoga , Acro yoga, Yin Yoga, Qi Gong, moments of mindfulness,  Sound Healing & Acupuncture Journey,  Silent Disco, traditional dance class and entertainment, Inanga Player & teacher, Afro-beat entertainer & teacher, soul stirring performances, Wellness Wisdom Talks, Sip & Share Ethiopian Coffee Ceremony, Expressive free flow art, uplifting DJ Vibes, Kid’s Wellness Zone with playful, mindful & creative guided activities, Wellness Discovery marketplace  \n\nBring: Yoga mats  and blanket for sound healing and yoga and enjoy the vibes of nature with your family and friends. \n\nFull Schedule-www.blacksomakigali.com/events', 'Nature Kigali', '[-1.9438004,30.102882]', '2025-09-13', '2025-09-13 07:30:39', '2025-09-13', '2025-09-13 14:30:39', 'https://www.sinc.events/joy-fest-k-1944', 0, 0, 0, 'Upcoming'),
