(1522, 2251, 0, 10, '2025-11-10 07:00:06', 'Sinc', 'Afro Fusion Dance Class ', 'https://dbmhau7o59w3r.cloudfront.net/7e5e3506-f2c7-4f28-8e2c-f2f8d6294dc1-high.jpeg', 'Afro Fusion Dance Class\nA weekly Tuesday class open to all levels and especially friendly to beginners. Led by Honore Hartel, it focuses on strong foundations while exploring Afro dance through rhythm, creativity, and the African spirit. Expect a joyful and inspiring learning experience.', 'Francophone Cultural Centre of Rwanda', '[-1.9578848,30.0965041]', '2025-11-11', '2025-11-11 16:30:57', '2025-11-11', '2025-11-11 18:00:57', 'https://www.sinc.events/afro-fusio-165-edition-14', 0, 0, 0, 'Upcoming'),
