(1526, 2247, 0, 10, '2025-11-11 11:00:08', 'Sinc', 'Garanti  100% Kréol  Kigali screening', 'https://dbmhau7o59w3r.cloudfront.net/108f8853-b41a-4a85-b097-d545a523daa4-high.jpeg', 'Garanti  100% Kréol is more than a documentary.  It’s a cultural experience that takes you deep into the soul of Réunion Island.\n\nThrough powerful stories, rituals, and the rhythm of maloya music, director Laurent Pantaléon explores how Creole identity has survived centuries of change. The film celebrates the strength, faith, and memory of a people who refuse to forget their roots.\n\nShot in striking black and white, it’s a rare cinematic journey that blends history, spirituality, and art.\n\nJoin us for this exclusive screening and be part of a conversation about heritage and identity that continues to shape today’s world.\n\nDon’t miss it — reserve your seat now.', 'Ciné Mayaka by IMITANA', '[-1.9648033,30.0591533]', '2025-11-20', '2025-11-20 15:00:56', '2025-11-20', '2025-11-20 16:45:56', 'https://www.sinc.events/garanti-1-2112-edition-2', 0, 0, 0, 'Upcoming'),
