(1529, 2254, 0, 10, '2025-11-12 08:00:11', 'Sinc', 'Nuru Wave', 'https://dbmhau7o59w3r.cloudfront.net/ad031778-b3b1-41c5-8517-fd99e93ed943-high.jpeg', 'NURU WAVE: FIRST EDITION\n A Creative Experience Like No Other\n\nAre you the kind who loves real vibes, good music, and purpose-filled fun?Then this is your space — where young Christians and creatives come together to connect, play, and grow through music, art, and energy that inspires.\n\nFEATURING: The freshest and best christian Artists & Creatives\n\nNuru Wave is a creative movement lighting up Kigali with art, music, and authentic connection — bringing the gospel to life in a new, refreshing way.\n\nCome catch the Wave — where creativity, purpose, and people come alive! 🌊\n\nContact: +250788969191/ 250785363874 - (phlightinfo@gmail.com/nuruwave@gmail.com) for any inquiries.', 'Ora Center', '[-1.9756678,30.1082058]', '2025-11-30', '2025-11-30 14:00:26', '2025-11-30', '2025-11-30 20:00:26', 'https://www.sinc.events/nuru-wave-2192', 0, 0, 0, 'Upcoming'),
(1530, 2262, 0, 10, '2025-11-12 12:00:06', 'Sinc', 'Oldies Music Festival Returns', 'https://dbmhau7o59w3r.cloudfront.net/a049d41f-834c-4036-bf98-74564bc355e0-high.jpeg', 'Oldies Music festival is back again this 6th december', 'Kigali Universe', '[-1.9416411,30.0588311]', '2025-12-06', '2025-12-06 16:35:08', '2025-12-07', '2025-12-07 00:05:08', 'https://www.sinc.events/oldies-mus-1344-edition-2', 0, 0, 0, 'Upcoming'),
(1531, 2263, 0, 10, '2025-11-12 13:00:08', 'Sinc', 'IdeaRise Circle Connect', 'https://dbmhau7o59w3r.cloudfront.net/ef370d03-1bd7-43af-84ec-253758ebebfb-high.jpeg', 'For our inaugural meetup of product creators (Engineers, Designer, & Product Managers), we will be joined by Annu Augustine a South Africa - based leading product management coach and consultant who works with product teams and leaders across Africa to build products that truly make an impact. \n\nBuilding products that truly matter starts with discovery, not delivery. In this session, we will explore how product discovery helps teams reduce the four key risks of product development: value, usability, feasibility, and business viability. You will learn how discovery complements delivery, why the product trio (PM, designer, and engineer) is central to this work, and how continuous discovery and dual track agile enable faster learning and better decisions. Participants will walk away with a clear understanding of what discovery is, why it matters, and the foundational principles needed to start building discovery habits.', 'Digital Transformation Center Rwanda', '[-1.9515871,30.0930217]', '2025-11-26', '2025-11-26 14:00:57', '2025-11-26', '2025-11-26 17:00:57', 'https://www.sinc.events/idearise-c-2144', 0, 0, 0, 'Upcoming'),
