(1581, 2319, 0, 10, '2025-11-23 10:00:06', 'Sinc', 'FUSION ROOM Vol.3 A DANCE CLASS WITH KIKII', 'https://dbmhau7o59w3r.cloudfront.net/703b89d5-f949-4361-aa7a-f389c6e28c0d-high.jpeg', 'Fusion Room Vol.3 is where music becomes breath, and movement becomes language.\nThis edition invites you into a space of creativity, rhythm, and honest expression — a room where every step carries intention and every dancer adds their voice to the energy we create together.\n\nAfter two powerful editions, Vol.3 opens the door to a new layer of artistry: deeper musicality, cleaner textures, and a flow that meets both beginners and advanced movers where they are.\n\nCome reset your body, challenge your creativity, and dance in a space built for connection.', 'Ze Dance Studio', '[-1.9686247,30.0580334]', '2025-11-26', '2025-11-26 16:30:48', '2025-11-26', '2025-11-26 18:00:48', 'https://www.sinc.events/fusion-roo-2061-edition-3', 0, 0, 0, 'Upcoming'),
(1582, 2331, 0, 10, '2025-11-23 10:00:06', 'Sinc', 'CRUS & AMALA KIGALI - WINE PORTFOLIO LAUNCH AND TASTING', 'https://dbmhau7o59w3r.cloudfront.net/c8b85cd0-1db3-4537-8957-5f850226cfa9-high.jpeg', 'Hello Kigali,\n\nI am delighted to introduce Crus & Amala, my boutique wine importing and distribution agency.\nMy name is Aline Rudasingwa, and after 16 years in the wine world - from Montréal to Europe - with WSET and Court of Master Sommeliers certifications and extensive hands-on experience in wineries and vineyards across the Europe, I am honoured to bring my portfolio home to Rwanda. \n\nCrus & Amala presents terroir-driven wines from France, Italy, Spain, and Germany, crafted by growers farming organically or biodynamically. These are producers I learned from throughout my winemaking and viticulture studies and through the time I spent working alongside them - producers I am incredibly proud to represent in Rwanda.\n\nJoin me at Soy, Kimihurura, on December 6th at 2:00 PM for an intimate tasting of 15+ wines and seasonal bites - a beautiful afternoon of flavour, discovery, and connection.\n\nI look forward to hosting you, \n\nAline', 'Soy Asian Table', '[-1.9474753,30.0783093]', '2025-12-06', '2025-12-06 12:00:04', '2025-12-06', '2025-12-06 15:00:04', 'https://www.sinc.events/crus-ama-2228', 0, 3, 0, 'Upcoming'),
