(1615, 2376, 0, 10, '2025-12-01 21:00:08', 'Sinc', 'The Listening Room ', 'https://dbmhau7o59w3r.cloudfront.net/62b1bba9-ddcc-4147-93cf-4cdd3db1aea1-high.jpeg', 'Rnbsoulrw presents the first edition of The Listening Room on 11th December — an intimate RnB sanctuary where stories come alive.\nExperience soulful performances by Lee Dia and Peace Jolis, with special sets from Sonia (Lady Bicu) and Jado Keys.\n\n🎟️ Early bird: 10k | At the door: 15k\n🎫 Tickets available on Sinc Events\n⏰ Doors open 6 PM | Show starts 7 PM', 'Bicu Lounge', '[-1.9610289,30.085062]', '2025-12-11', '2025-12-11 17:00:01', '2025-12-11', '2025-12-11 22:00:01', 'https://www.sinc.events/the-listen-1703', 0, 0, 0, 'Upcoming'),
(1616, 2380, 0, 10, '2025-12-02 18:00:05', 'Sinc', 'Rebero • 11 km • Moderate Adventure Hike', 'https://dbmhau7o59w3r.cloudfront.net/34ace9df-c633-4c38-bc3c-2329f1cfeb13-high.jpeg', 'Join us on 06 Dec 2025 for a fresh, scenic, and adrenaline-filled morning on the beautiful Rebero ridges.\nBreathe, climb, explore — HOA 360 takes you where the views reward your effort. ✨\n\n📍 Meeting Point: Rebero | Juru Park\n⏰ 07:30 AM (Start 08:00 AM)\n🌐 www.hikingoutdooradventures.com\n📞 +250 795 296 557', 'Juru Park', '[-1.9952476,30.0709881]', '2025-12-06', '2025-12-06 05:30:10', '2025-12-06', '2025-12-06 10:33:10', 'https://www.sinc.events/rebero-1-2218', 0, 0, 0, 'Upcoming'),
