(1619, 2385, 0, 10, '2025-12-03 09:00:08', 'Sinc', 'Legends Night Christmas Edition', 'https://dbmhau7o59w3r.cloudfront.net/1ec62eb5-c2de-4b2b-8d7e-99dc7959509b-high.jpeg', 'A Celebration of Heritage, Icons, and the Timeless Spirit of Igisope. \n\nThis December, Kigali gathers once again to honor the sounds that shaped generations. Legends Night returns for a special Christmas edition, night crafted for music lovers, culture keepers, and anyone who understands the power of a song to tell a thousand stories.\n\nAt the heart of this celebration stand two giants of Rwandan music: Makanyaga Abdoul and Mavenge Sudi. Their voices have carried across decades, across eras of change, and across moments that live forever in our shared memory. Their melodies have held joy, longing, resilience, and pride, forming the soundtrack of countless Rwandan homes, gatherings, and celebrations.\n\nOn this special night, these two legends come together to gift Kigali an experience of pure cultural magic, a blend of timeless melodies, shared memories, and the soul of Igisope brought back to life.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-12-20', '2025-12-20 17:00:11', '2025-12-21', '2025-12-21 00:59:11', 'https://www.sinc.events/legends-ni-712-edition-4', 0, 0, 0, 'Upcoming');
