(1622, 2391, 0, 10, '2025-12-03 14:00:07', 'Sinc', '🍹THURSDAY Happy Hour at LEMON', 'https://dbmhau7o59w3r.cloudfront.net/c8589da2-56ce-4a4e-a08c-d6be4df7e302-high.jpeg', '🍹Happy Hour at Lemon Kigali\n\nThursday 04 Dec | 5:00 PM, unwind with refreshing cocktails, tasty bites, and live entertainment.\n\n🎧 Music mix by Deejay Arthur  & Vega drift \n🍸 Buy 1 Get 1 FREE on selected cocktails\n🍺 Buy 2 Get 1 FREE on VIRUNGA BEERS @virungabeverages\n🍽️ Special Food Discounts on selected menu items\n\n📍 Lemon Kigali | KG 623 St, Kimihurura\n📞 RSVP: +250 780 691 569\n🌐 www.lemonkigali.com\n\nCome for the drinks, stay for the music, leave with the vibes! 🍋', 'Lemon Kigali', '[-1.9467599,30.0796536]', '2025-12-04', '2025-12-04 15:00:01', '2025-12-04', '2025-12-04 18:00:01', 'https://www.sinc.events/thursday-792', 0, 0, 0, 'Upcoming'),
(1623, 2390, 0, 10, '2025-12-03 14:00:07', 'Sinc', 'Quiz night experience ', 'https://dbmhau7o59w3r.cloudfront.net/140266fd-d746-4d55-aee1-1d04322358fd-high.jpeg', 'A Quiz, Colour & Chill Night Experience\nStep into an evening designed to entertain, challenge, and inspire. This one-of-a-kind event blends the excitement of a Digital Quiz Night with the creativity of a Colour & Chill painting session  all in a relaxed, vibrant atmosphere.\nSimply join using your phone and participate either as an individual or as a team. The quiz features five engaging rounds covering a wide range of topics including General Knowledge, Science & Technology, Current Affairs, World History, and more. Each round comes with its own prizes, and the top performers across all five rounds will compete for a grand mega prize.\nBetween rounds, enjoy smooth old-school music mixes and take part in our guided painting sessions, where every participant creates their own artwork — a meaningful keepsake from the night.\nWhether you\'re here for the trivia, the music, the creativity,or the social vibe, this experience promises an unforgettable evening of fun, competition, and expression.', 'Four Points by Sheraton Kigali', '[-1.9561712,30.0620622]', '2025-12-04', '2025-12-04 17:00:11', '2025-12-04', '2025-12-04 20:00:11', 'https://www.sinc.events/quiz-night-1896-edition-2', 0, 0, 0, 'Upcoming'),
(1624, 2397, 0, 10, '2025-12-04 09:00:06', 'Sinc', 'La Noche Thursday Nightshift', 'https://dbmhau7o59w3r.cloudfront.net/4441a384-aa40-446b-af6a-4082774f08b4-high.jpeg', 'La Noche Nightshift thursday🔥 ', 'La Noche', '[-1.9467919,30.0796929]', '2025-12-04', '2025-12-04 18:06:33', '2025-12-04', '2025-12-04 23:36:33', 'https://www.sinc.events/la-noche-t-208-edition-25', 0, 0, 0, 'Upcoming'),
(1625, 2403, 0, 10, '2025-12-04 16:00:17', 'Sinc', 'BUMBOGO HILLS ', 'https://dbmhau7o59w3r.cloudfront.net/6d205bf1-6061-4c44-9a72-6e69708fc906-high.jpeg', 'HOA 360 – Bumbogo Hills • 14 km Adventure Hike\n\n📅 Sunday, 07 December 2025\n\nGet ready for a refreshing climb across the scenic ridges of Bumbogo Hills — rolling landscapes, fresh air, and stunning Kigali views waiting at every turn.\nBring your stamina, your spirit, and let’s conquer the hills together! ⛰️✨\n\n📍 Meeting Point: Mr Chips, KG 12 Ave, Kigali\n⏰ Arrival: 07:30 AM\n⏳ Departure: 08:00 AM\n\n💵 Fee: 5,000 RWF\n\n🌐 Website: www.hikingoutdooradventures.com\n📞 Contact: +250 795 296 557\n\n#HOA360 #BumbogoHills #KigaliHikes #RwandaAdventures #HikingRwanda #ExploreRwanda #AdventureHike #WeekendHike #NatureLoversRw #ChallengeYourself #OutdoorExperience #VisitRwanda ✨️🇷🇼🎒🥾🥾', 'Bumbogo', '[-1.8976037,30.147383]', '2025-12-07', '2025-12-07 05:30:38', '2025-12-07', '2025-12-07 11:00:38', 'https://www.sinc.events/bumbogo-hi-2218', 0, 0, 0, 'Upcoming'),
