(1644, 2377, 0, 10, '2025-12-08 02:00:06', 'Sinc', 'ZEO HANGOUT : MEET TO IMPACT', 'https://dbmhau7o59w3r.cloudfront.net/0a6a33df-6bbb-4d86-8021-a4f8a5368b20-high.jpeg', 'A hangout designed to ignite faith, restore joy and inspire love in action. We’re coming together to celebrate Jesus, build genuine community and make a difference that goes beyond the event.\n\nJoin us for live worship, prayer moments, Zoe circles, fun interactive activities, impact stations, open-mic testimonies, creative challenges and a whole lot of Jesus-centered joy.\n\nIt’s a hangout with purpose.\nA family moment.\nA day to praise, belong and impact together.\n', 'Kigali', '[-1.9440727,30.0618851]', '2025-12-28', '2025-12-28 12:00:10', '2025-12-28', '2025-12-28 18:30:10', 'https://www.sinc.events/zeo-hangou-2257', 0, 0, 0, 'Upcoming'),
(1645, 2427, 0, 10, '2025-12-08 06:00:06', 'Sinc', 'Mount Jali  & Mount Bweramvura Loop ', 'https://dbmhau7o59w3r.cloudfront.net/421bf1e9-0fda-422f-9653-f6eb2dbb8ae5-high.jpeg', 'HOA 360\n\nMOUNT JALI & MOUNT BWERAMVURA\n\n18 KM • Challenge Hike\n📅 14 December 2025\n\n📍 Harmony Bar & Grill, Karuruma\n⏰ 07:30 AM\n💰 Fee: 5,000 RWF\n\n🗺️ Route: Jali → Bweramvura → Loop\n🔥 Steep climbs • Epic views • Pro-guided\n\n📞 +250 795 296 557\n\nHOA 360 — Adventure. Endurance. Excellence.\n✨️🇷🇼🥾🥾🎒\n#HOA360 #JaliHike #Bweramvura #RwandaHikes #AdventureRwanda #ChallengeHike #HikingRwanda #ExploreRwanda #RwandaNature #OutdoorRwanda #VisitRwanda', 'Gatsata', '[-1.9229716,30.0466637]', '2025-12-14', '2025-12-14 05:30:32', '2025-12-14', '2025-12-14 11:00:32', 'https://www.sinc.events/mount-jali-2218', 0, 0, 0, 'Upcoming'),
(1646, 2429, 0, 10, '2025-12-08 11:00:07', 'Sinc', '🎄✨ SOUL CIPHER – FESTIVE EDITION ✨🎄', 'https://dbmhau7o59w3r.cloudfront.net/6a4efcaa-cd42-432f-ad09-255634d0521c-high.jpeg', 'A Night of Live Soul & Hip-Hop\n\nThis festive season, Soul Cipher returns with a special Christmas-inspired edition, a night where soul, hip-hop, and holiday magic meet on one unforgettable stage.\n\nOn December 23rd, we bring together some of the city’s most electrifying artists to deliver raw expression, smooth soul, and rhythm that warms the season. From heartfelt verses to powerful live performances, this isn’t just an event; it’s a celebration of music, culture, and togetherness right before Christmas.\n\nWhether you’re vibing with the live band, getting lost in a freestyle moment, or soaking up the festive atmosphere, this is the night to feel it all.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-12-23', '2025-12-23 16:30:51', '2025-12-23', '2025-12-23 21:59:51', 'https://www.sinc.events/soul-c-712', 0, 0, 0, 'Upcoming'),
(1647, 2430, 0, 10, '2025-12-08 17:00:08', 'Sinc', 'Quiz night experience as we  sum up the year ', 'https://dbmhau7o59w3r.cloudfront.net/140266fd-d746-4d55-aee1-1d04322358fd-high.jpeg', 'A Quiz, Colour & Chill Night Experience\nStep into an evening designed to entertain, challenge, and inspire. This one-of-a-kind event blends the excitement of a Digital Quiz Night with the creativity of a Colour & Chill painting session  all in a relaxed, vibrant atmosphere.\nSimply join using your phone and participate either as an individual or as a team. The quiz features five engaging rounds covering a wide range of topics including General Knowledge, Science & Technology, Current Affairs, World History, and more. Each round comes with its own prizes, and the top performers across all five rounds will compete for a grand mega prize.\nBetween rounds, enjoy smooth old-school music mixes and take part in our guided painting sessions, where every participant creates their own artwork — a meaningful keepsake from the night.\nWhether you\'re here for the trivia, the music, the creativity,or the social vibe, this experience promises an unforgettable evening of fun, competition, and expression.', 'Four Points by Sheraton Kigali', '[-1.9561712,30.0620622]', '2025-12-11', '2025-12-11 17:00:51', '2025-12-11', '2025-12-11 20:00:51', 'https://www.sinc.events/quiz-night-1896-edition-3', 0, 0, 0, 'Upcoming'),
