(1649, 2433, 0, 10, '2025-12-08 20:00:06', 'Sinc', 'KANDAKA KIBANDA: The Sudan-Rwanda Cultural Market', 'https://dbmhau7o59w3r.cloudfront.net/645ba6ef-5424-4eae-9b1f-7cb086f0656f-high.jpeg', 'Kandaka Kibanda is a monthly curated marketplace and social hub dedicated to celebrating and connecting the cultures of Sudan and Rwanda through commerce, cuisine, and community. Named after the historic Sudanese queens (Kandaka) and the Rwandan market stall (Kibanda), it is more than a market, it is a bridge of exchange, empowerment, and shared heritage.\n\nDate: Saturday, December 13, 2025\nTime: 10:00 AM – 6:00 PM\nVenue: Dana Hotel Kigali (Open Grounds), Opposite Pili Pili, Kibagabaga\nEntry: FREE & OPEN TO ALL\n\n\nWHAT TO EXPECT\n1. Curated Market Stalls,\n2. Flavor Plaza,\n3. Live Cultural Experiences,\n4. Community Lounge (The Majlis)', 'Dana Kigali Hôtel', '[-1.9317791,30.1105487]', '2025-12-13', '2025-12-13 08:00:24', '2025-12-13', '2025-12-13 16:00:24', 'https://www.sinc.events/kandaka-ki-2052', 0, 0, 0, 'Upcoming'),
(1650, 2435, 0, 10, '2025-12-09 10:00:08', 'Sinc', 'House of Queens - ColorMeQueen Edition', 'https://dbmhau7o59w3r.cloudfront.net/7ead293a-f611-4cbb-ade4-bb791ba45640-high.jpeg', 'The HalloQueen Edition left its mark in style, a legendary night where fashion met music, confidence ruled the room, and every Queen unlocked her inner diva. The energy, the glam, the unforgettable moments… it was a celebration that still echoes 👑✨\n\nNow, we turn the page to a brand new chapter: Divas in Colors Edition 🎨\n\nThis time, we’re turning the spotlight into a runway of shades, tones, and bold expressions. From vibrant neons to soft pastels and dramatic deep hues, every color tells a story and every Queen becomes the masterpiece 💄✨\n\nGet ready to dress your mood, speak in style, and let your colors do the talking.\n\nBecause this edition isn’t just about what you wear, it’s about what you embody 💃🔥', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-12-19', '2025-12-19 16:00:06', '2025-12-20', '2025-12-20 01:00:06', 'https://www.sinc.events/house-of-q-712-edition-2', 0, 0, 0, 'Upcoming'),
