(1652, 2439, 0, 10, '2025-12-09 18:00:06', 'Sinc', 'Busanza Hike', 'https://dbmhau7o59w3r.cloudfront.net/75ee9514-dabf-44b2-bf22-9fb546ee3d0d-high.jpeg', 'HOA 360 — GOLD EXPERIENCE HIKE ✨\n🔥 Busanza Edition\nA premium outdoor challenge designed for endurance, energy, and pure adventure.\n\n📍 Place: Busanza\n🅿️ Parking: Sunset Village\n🥾 Distance: 13 KM • Moderate Hike\n\n📅 13th December 2025\n⏰ Start: 08:00 AM\n💰 Fee: 5,000 RWF\n\nReconnect with nature, push your limits, and enjoy Rwanda’s golden landscapes with the HOA 360 professional team.\n\n📞 +250 795 296 557\n🌐 www.hikingoutdooradventures.com\n\n#HOA360 #GoldExperience #HikeRwanda #BusanzaHike #AdventureRwanda #EnduranceChallenge #ExploreRwanda #VisitRwanda #HikingCommunity', 'Busanza', '[-2.0046296,30.1434816]', '2025-12-13', '2025-12-13 06:00:06', '2025-12-13', '2025-12-13 10:30:06', 'https://www.sinc.events/busanza-hi-2218', 0, 0, 0, 'Upcoming'),
