(1670, 2459, 0, 10, '2025-12-14 01:00:06', 'Sinc', 'Akagera National Park – Full-Day Group Safari.', 'https://dbmhau7o59w3r.cloudfront.net/21318d00-1706-4214-9767-2f3eb35b0d8b-high.jpeg', 'Akagera National Park – Full-Day Group Safari.\n\nText +250795581177 to join the WhatsApp Group for more information.\n\nExperience a full day of adventure in Akagera National Park with a guided group safari through Rwanda’s only Big Five park. Enjoy scenic landscapes, wildlife viewing, and a fun, social safari atmosphere—perfect for travelers looking for an affordable and well-organized day trip.\n\nPick-up is at Rubis Gisimenti in Kigali at 4:30 AM. Please arrive on time—any late arrivals risk being left behind as the bus cannot wait.\n\nInclusions:\n\nPark entrance fees\nTransport (round trip)\nBottled water\nSoft drinks\nSnacks\n\nExclusions:\n\nMeals/lunch\nPersonal purchases\nAccommodation\nTravel insurance\n\nAny other services not listed under inclusions', 'Rubis - Gisimenti', '[-1.9600716,30.1079739]', '2025-12-27', '2025-12-27 02:30:14', '2025-12-27', '2025-12-27 17:30:14', 'https://www.sinc.events/akagera-na-2322', 0, 0, 0, 'Upcoming'),
