(1697, 2373, 0, 10, '2025-12-21 22:00:14', 'Sinc', 'DUSK TILL DAWN', 'https://dbmhau7o59w3r.cloudfront.net/ea910380-9fcc-4ce1-8834-baa5e4e13194-high.jpeg', 'Ring in the New Year in style at Dusk Till Dawn, the ultimate end-of-year party happening at Coco Fizz, Four Points by Sheraton Kigali. Join an electrifying lineup of top DJs bringing nonstop vibes from 7PM until sunrise. Expect high-energy music, an amazing atmosphere, and unforgettable moments as we celebrate the final night of 2025. Entrance is only 20K—come ready to party!', 'Four Points by Sheraton Kigali', '[-1.9561712,30.0620622]', '2025-12-31', '2025-12-31 17:00:27', '2026-01-01', '2026-01-01 02:00:27', 'https://www.sinc.events/dusk-till-266', 0, 0, 0, 'Upcoming'),
