(1699, 2471, 0, 10, '2025-12-22 00:00:06', 'Sinc', 'BRUNCH LIKE AN OLDIE!', 'https://dbmhau7o59w3r.cloudfront.net/c882959d-f701-4105-9145-c4f8d1d26a74-high.jpeg', 'This is not your regular brunch! \n\nIt’s barbecue, old-school music, and vibes that don’t repeat.\n\nBrunch Like An Oldie - get your ticket now before it sells out.', 'Bicu Lounge', '[-1.9610289,30.085062]', '2026-01-03', '2026-01-03 10:00:28', '2026-01-03', '2026-01-03 15:00:28', 'https://www.sinc.events/brunch-lik-2334', 0, 0, 0, 'Upcoming'),
(1700, 2465, 0, 10, '2025-12-22 02:00:11', 'Sinc', 'MELLOWFEST', 'https://dbmhau7o59w3r.cloudfront.net/3bc49f07-6769-4582-9450-2a23beaec340-high.jpeg', 'MELLOWFEST\n\nThird Edition, \nJan 10th, 2026 \nMundi Center.\n\nSee you soon ;)', 'Mundi Center', '[-1.9694694,30.0878461]', '2026-01-10', '2026-01-10 15:00:04', '2026-01-11', '2026-01-11 00:00:04', 'https://www.sinc.events/mellowfest-1058', 0, 0, 0, 'Upcoming'),
(1701, 2475, 0, 10, '2025-12-22 03:00:06', 'Sinc', 'Our Sisu Launch Event', 'https://dbmhau7o59w3r.cloudfront.net/43b27a08-001e-423a-b3a1-a61e3f12b3ce-high.jpeg', 'Step into your next era with the OUR SISU Pass — your all-access entry to a night redefining how women come together.\n\nYour experience includes it all: a powerful live panel and Q&A with inspiring women, immersive activations, reflection stations, brand booths from women-owned businesses, the confessional booth, photo moments, drinks, bites, and a special word from the founders. Plus, curated goodie bags so you can take the night home with you.\n\nYou won’t leave with just memories.\nYou’ll leave feeling lighter, clearer, and connected to a community of women who truly get it.✨', 'Century Park Hotel and Residences', '[-1.9435815,30.1003473]', '2026-01-17', '2026-01-17 12:00:28', '2026-01-17', '2026-01-17 16:00:28', 'https://www.sinc.events/our-sisu-l-2344', 0, 0, 0, 'Upcoming'),
(1702, 2508, 0, 10, '2025-12-22 09:00:06', 'Sinc', 'OLD SCHOOL SOIRÉE – THE REUNION', 'https://dbmhau7o59w3r.cloudfront.net/31ed7aba-2e9c-4d93-8576-cc7210bc4e0f-high.jpeg', 'OLD SCHOOL SOIRÉE – THE REUNION\n\nOld memories. New energy.\n\nEnd the year that was.\nStart the new one the right way.\n\nStep into a night where the music takes you back and the energy moves you forward. More than a reunion, this is a celebration of where we’ve been and where we’re going,familiar faces, classic anthems, and a dancefloor that feels like home.', 'Atelier du Vin', '[-1.9674015,30.089817]', '2026-01-03', '2026-01-03 16:00:50', '2026-01-04', '2026-01-04 00:00:50', 'https://www.sinc.events/old-school-2076-edition-3', 0, 0, 0, 'Upcoming');
