(1726, 2546, 0, 10, '2025-12-25 16:00:07', 'Sinc', 'June Thursdays 25 December  2025', 'https://dbmhau7o59w3r.cloudfront.net/df07c164-3786-4f51-9287-2918c4c407dd-high.jpeg', '#ThursdaysAreForJune\nattendees will be ID’d at the door, only physical IDs will be allowed. Non-compliance will not be refunded', 'Cocobean', '[-1.9499886,30.0912616]', '2025-12-25', '2025-12-25 18:02:14', '2025-12-26', '2025-12-26 03:32:14', 'https://www.sinc.events/june-thurs-84-edition-27', 0, 0, 0, 'Upcoming'),
(1727, 2547, 0, 10, '2025-12-25 16:00:07', 'Sinc', 'Rebero hike', 'https://dbmhau7o59w3r.cloudfront.net/0f87985e-f0cf-4883-a106-ca69a3a5d961-high.jpeg', '🥾 Sunday, 28th Dec 2025 – Rebero 11 km Hike 🌄\nModerate trail • Scenic views • Fresh air\nTake on an 11 km moderate hike at Rebero — rolling hills, wide panoramas, and nature moments to make your Sunday unforgettable!\n📍 Meeting Point: Juru Park — 07:30 AM\n🕗 Departure: 08:00 AM\n💳 Booking & Payment\n👉 Booking is confirmed after payment via Sinc.events\nDial: *669*2218#\n📞 +250 795 296 557\n🌐 hikingoutdooradventures.com\n✨ See you on the trail!\n#HikingOutdoorAdventures #ReberoHike #ExploreRwanda #SundayAdventure #TrekkingRwanda 🇷🇼✨🥾🥾', 'Rebero', '[-1.9891649,30.0761251]', '2025-12-28', '2025-12-28 05:30:45', '2025-12-28', '2025-12-28 10:30:45', 'https://www.sinc.events/rebero-hik-2218', 0, 1, 0, 'Upcoming'),
