(86, 594, 'single room', 'I have nearly completed my treatment and returned to work today.\r\nI was absent last week and, therefore, have no updates from that period.\r\nI asked Annah to share her report for last week with you.\r\nAnnah informed me that the onboarding issue with rooms not displaying has been resolved.\r\nI decided to onboard hotels immediately and on-site to avoid similar issues in the future and advised Annah to do the same.\r\nI attended a follow-up meeting with Hubert, who updated me on his recent activities.\r\nI completed the following tasks at the office:\r\nPrinted out signatures for contracts unsigned by Madam Teta.\r\nCleaned up the sheets.\r\nI signed another contract at a meeting at Netluna Villa.\r\nHubert provided me with login credentials for the hotels.\r\nI am awaiting tutorial links to email them out and handle the handover tomorrow.\r\nWe set a goal to target at least five properties each week to ensure reasonable progress', '', 40.00, 1, 'Single', 1, 0, '180', '../catalog/venues/666811cb2d0df_WhatsApp Image 2024-05-30 at 10.15.49_94ee402b.jpg', 'Available'),
(87, 596, 'Double Room', 'Beautiful en-suite self contained double room without terraces. A working table and chair is in the room, so you can do your work in the room. Access to our fast internet is available.\r\n\r\n220-240 volt circuits in room\r\nSlippers\r\nWireless internet (WiFi)', '', 100.00, 2, 'Double', 3, 0, '180', '../catalog/venues/6672c5ba02863_551161426.jpg', 'Available'),
(88, 598, 'Standard Single Room', '1 single bed \r\nBalcony\r\nMountain view\r\nLandmark view\r\nCity view\r\nAir conditioning\r\nEnsuite \r\nbathroom\r\nFlat-screen TV\r\nFree WiFi', '', 65.00, 1, 'Single', 4, 0, '100', '../catalog/venues/6672c7deb16eb_IMG_20190820_170653_6.jpg', 'Available'),
(89, 599, 'one bedroom Apartment', 'These contemporary havens boast stylish decor that exudes a refreshing ambiance. Relax on your private balcony and soak in panoramic views while enjoying a seamless blend of simplicity, coziness, and modern sophistication. Perfect for accommodating up to two guests,', '', 160.00, 1, 'Double', 3, 0, '120', '../catalog/venues/6672c9667c5ec_img (16).webp', 'Available'),
(90, 362, 'Standard Single Room', 'The standard single room  at Centric Hotel is designed to cater to both solo travelers and couples. This versatile room type is available with either a comfortable single bed or a spacious double bed, making it suitable for accommodating two people. The room features a private balcony, offering breathtaking views of the surrounding landscape.\r\n\r\nThe room is tastefully decorated, with warm and inviting colors, and comes with a range of modern amenities to ensure a comfortable and enjoyable stay. A smart flat-screen TV, high-speed Wi-Fi, and air conditioning are just a few of the features included. You will also find a small desk and seating area, ideal for those who need to work during their stay.\r\n\r\nIn terms of bathroom facilities, you can expect a clean and well-maintained bathroom with a shower, a sink, and all the essentials youâ€™ll need. Whether youâ€™re traveling for business or leisure, this room type is sure to meet your needs. With a blend of comfort and practicality, the standard single room at Centric Hotel is the perfect choice for your stay in Rwanda.', '', 65.00, 1, 'Double', 3, 0, '100', '../catalog/venues/6672cf2a9f79c_WhatsApp-Image-2023-01-26-at-1.20.10-PM-1024x512.jpeg', 'Available'),
(91, 534, 'Terrace room', 'Beautiful ensuite rooms with terraces at The Nest . Free fast internet in a lovely neighbourhood right in the heart of Kigali. Best restaurants nearby, business venues within 10 min walk. Perfect for solo and couple travellers. the Nest consist of 12 bedrooms that are all self-contained with ensuite bathrooms. The Nest is the perfect home away from home. #AStayYoullLove.', '', 85.00, 2, 'Double', 14, 0, '160', '../catalog/venues/6672e13b49c0a_2.png', 'Available'),
(92, 597, 'Executive Apartment', 'Free high-speed internet\r\nFree breakfast\r\nFree self parking', '', 119.00, 2, 'Double', 1, 0, '100', '../catalog/venues/6672eb115598c_IMG-20240618-WA0306.jpg', 'Available'),
(93, 356, 'Single Room', 'Igitego ApartHotel is Kigali\'s 1st entirely eco-friendly apartment that includes domestically crafted property teak wood furniture, the whole building and around the building is naturally green, best wooden doors and best bathrooms.\r\n\r\n\r\n24 Hour Security \r\n24hrs Parking \r\nAir conditioning\r\n Bathroom\r\n Flat-screen TV\r\n Toilet Toiletries\r\n Towels\r\n WiFi Access\r\n Work/writing desk', '', 60.00, 1, 'Single', 3, 0, '100', '../catalog/venues/6672f03555d1c_Igi.jpeg', 'Available'),
