(104, 503, 'Kivu Double room with balcony', 'With garden views, INZOZI AFRICA HOUSE B&amp;B-Gishushu is located in Kigali and has a restaurant, full-day security, bar, garden, outdoor fireplace and picnic area. Private parking is available on site at this recently renovated property. The bed and breakfast provides mountain views, a sun terrace, a 24-hour front desk, and free WiFi is available throughout the property.\r\n\r\nAt the bed and breakfast, all units are fitted with a desk. All units include a private bathroom with a bath, slippers and free toiletries. At the bed and breakfast, the units are fitted with bed linen and towels.\r\n\r\nÃ€ la carte and continental breakfast options with local specialities, fresh pastries and pancakes are available daily at the bed and breakfast. There is a coffee shop, and a grocery delivery service and packed lunches are also available.\r\n\r\nThe area is popular for cycling, and bike hire and car hire are available at INZOZI AFRICA HOUSE B&amp;B-Gishushu. An indoor play area is also available for guests at the accommodation.\r\n\r\nKigali Convention Centre is 1.4 km from INZOZI AFRICA HOUSE B&amp;B-Gishushu, while Niyo Arts Gallery is 4.5 km away. The nearest airport is Kigali International, 3 km from the bed and breakfast, and the property offers a paid airport shuttle service.\r\n\r\nYour property description is created according to the facilities and amenities you add. Itâ€™s then translated into multiple languages. This can increase your bookings because it appeals to all potential guests.', '', 50.00, 2, 'Double', 1, 0, '180', '../catalog/venues/669294433f4d9_374973719.jpg', 'Available'),
