(10, 1, 18, 1, 1, 'gRN8Gc3l', 'Mist Gorilla Safari', 'Enjoy A 2-day Rwanda Gorilla Safari, A Short Gorilla Trekking Tour To See The Massive Mountain Gorillas In Their Natural Environment. You Will Have The Best Of Rwanda Gorilla Trekking Experience In Volcanoes National Park, Ruhengeri Region. This Is One Of The Oldest Parks In Africa, Created In 1925 And It Is Found In Northwestern Rwanda. Gorilla Trekking In Volcanoes National Park Is A Lifetime Opportunity To Interact With One Of The 12 Habituated Gorilla Family Groups In The Park. The 2 Days Rwanda Gorilla Safari Allows You To Spend 1 Hour With A Gorilla Family With Higher Chances To Encounter Several Other Wildlife Species. The Entire Gorilla Safari In Rwanda For 2 Days Starts And Ends In The Kigali Capital.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '+250 785 372 824', NULL, 'https://www.mistrwandasafaris.com', NULL, '../catalog/venues/b48f3c9de501a60cefa1ff2fd19add442c1b606alogo-MIST+20sep-01.png', NULL, 4, 79, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
