(107, 1, 19, 1, 1, 'HL2p7keC', 'Kigali', 'Ideally Positioned In The Centre Of Rwanda, Kigali Extends Across Several Hills And Valleys, With Good Road Links To The Rest Of The Country. The Verdant Capital City Is Pleasantly Low Key Yet Dynamic And Progressive, With Just Over One Million Inhabitants.first-time Visitors To The Bustling And Colourful Centre Often Remark How Clean The Streets Are, A Matter Of Pride Across Every Community Throughout The Country.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/2289601c7a9d2ce938638d569eec9a05f9861bdcScreen Shot 2023-05-03 at 09.08.19.png', NULL, 4, 39, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(108, 1, 19, 1, 3, 'owLxQYqy', 'Rubavu', 'A Waterfront Town On The Shores Of Lake Kivu, Rubavu Is An Hour Away From The Volcanoes National Park, And Makes A Good Stopover On The Way To Or From Nyungwe, Or Somewhere To Relax After Gorilla Tracking.rubavu, As Well As Other Spots Along Lake Kivu, Has Red Sandy Beaches, Warm, Clean Water And An Easygoing Tropical Character. It Is A Great Place To Unwind, Soak Up The Tranquil Vibe, Watch The Birds And Enjoy Various Watersports.the City Marks The Beginning Of The Congo Nile Trail, Which Extends 227km South To Rusizi. The Trail Can Be Enjoyed On Foot Or By Mountain Bike, With Endless Lake Views, Friendly Hamlets, Fishermen At Work And Women Clothed In Striking Prints Going About Their Daily Lives.with Many Tea And Coffee Plantations Around Rubavu, As Well As Bird And Primates To See In The New Gishwati-mukura National Park, The Area Has Something For Everyone.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/cdd4da761975d146572d4ebb766bce5fddc96236Screen Shot 2023-05-03 at 09.10.19.png', NULL, 4, 184, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(109, 1, 19, 1, 4, '8wujBF79', 'Karongi', 'In Our Landlocked Country, Karongi Is Perhaps The Most Popular Beach Retreat For Families Living Elsewhere In Rwanda. Its Easy To See Why, With Its Majestic Vistas, Tranquil Atmosphere And Easy Access From Kigali.hillsides Covered In Pines And Eucalyptus Serve As A Backdrop To The Sparkling Lake, With Accommodation To Suit Most Budgets. At Dawn And Dusk, The Sound Of Local Fisherman Singing Carries Across The Water As They Paddle In Unison.this Is A Place Where Busy Minds Can Completely Switch Off, Occasionally Glancing Up From A Good Book To Notice The Birds Or The Changing Colours On The Lake As The Sun Drops Over The Far Side.for Those Keen To Stay Active, Various Hotels Have Kayaks To Rent. Boats Carry Small Groups Out To Napoleons Island, Home To A Colony Of Fruit Bats, Or To Dine At One Of Amahoro Islands Restaurants.for An Authentic Experience Of Rwandan Daily Life, Head Off Night Fishing With The Locals, Or Kayak Out With Them At Sunset.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/45b6bcffddfa5f301aebe00be4ea9c3b030329f0Screen Shot 2023-05-03 at 09.11.38.png', NULL, 4, 34, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(110, 1, 19, 1, 2, 'C72bjFeO', 'Musanze', 'Poised To Become One Of Rwandas Major Cities, Musanzes Strategic Location In The Foothills Of The Virunga Massif Is Attractive To Tourism, Business And Agriculture, With Notably Fertile Land In The Surrounding Region.set At An Altitude Of 1,850m, The City Is A Convenient Base For Gorilla Tracking, With The Kinigi Headquarters 13km Away. For Those Keen To Stay Closer To The Edge Of The Volcanoes National Park, There Are Various Boutique Lodges Along Its Fringes With Spectacular Views And A More Rural Setting.musanze Is A Hassle-free And Buzzing City, With Plenty Of Choice For Eating Out, Atms To Withdraw Cash, Vibrant Nightlife, Markets And Artisanal Trades.excursions From Musanze Include A Guided Tour Of The Underground Caves, Bicycle Tours And A Chance To Meet The Rwandan Cycling Team At The Africa Rising Cycling Centre, The Buhanga Eco-park And The Little-known Lakes Of Karago, Burera And Ruhondo.highlightsresponsible Tourismgorilla Trackingsports & Adventurecaving', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/da98b17924a89c39f75f11c73d88305004525626Screen Shot 2023-05-03 at 09.16.31.png', NULL, 4, 174, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(111, 1, 19, 1, 5, 'NlT6nVw0', 'Nyanza', 'The Administrative Capital Of The Southern Province, Nyanza Is The Eighth Largest City In Rwanda. The Main Attraction Of The Region Lies In Its Cultural Heritage, Which Undoubtedly Merits A Stopover En Route To Nyungwe National Park.well Worth A Visit Is The Kings Palace, A Reconstruction Of The Traditional Royal Residence, A Beautifully-crafted Thatched Dwelling Shaped Like A Beehive. At The Back Live A Few Long-horned Ankole Cattle, Descended From The Kings Herd, Whose Keepers Carefully Tend And Sing To Them.in The Olden Days, Rwandan Kings Were Very Mobile, Moving Between Numerous Residences Scattered Throughout The Kingdom. However, By The Late 19th Century The Growing Colonial Presence Risked Undermining The Authority Of The Crown. In An Attempt To Counteract This, Mwami (king) Musinga Yuhi V Made Nyanza The First Permanent Royal Capital Of Rwanda In 1899 And It Kept This Status Until The Country Became A Republic In 1962.the Royal Court Impressed The Belgians Sufficiently That They Chose To Exert Control Through The Existing Power Structure And Largely Refrained From Intruding On The City. Western Accounts Full Of Colour, Pomp And Ceremony Blend With Rwandan Oral Tradition To Put Nyanza Firmly On The Map Of Cultural Heritage.whilst Nyanzas Hillsides Are No Longer Covered In Roundhouses And The Royal Court Is Long Dispersed, The Region Remains An Important Cultural Centre. Other Attractions Include The Ethnographic Museum In Nearby Huye.highlightsmuseums & Art Gallerieskings Palace', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/588c49223d47b27339333153909f120f37c13525Screen Shot 2023-05-03 at 09.37.05.png', NULL, 4, 192, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(112, 1, 19, 1, 6, 'lntzBXfU', 'Rusizi', 'A Small Town On The Border With The Democratic Republic Of The Congo And The Closest Town To Nyungwe National Park. Budget Accommodation Here Will Appeal To Self-drive Visitors To The National Park.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/743d1824ad449643e3130025d032d224d811c8eaScreen Shot 2023-05-03 at 09.43.58.png', NULL, 4, 45, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
(113, 1, 19, 1, 7, 'xSEDEGXN', 'Huye', 'Peaceful And Compact, Huye Was Founded In The Early Colonial Era. Today Is A Centre Of Academia, As Well As Housing The Ethnographic Museum.', '', '', '', '0000-00-00', '0000-00-00', 2, 0, '', NULL, '', NULL, '../catalog/venues/0a3b642f8f55feed9d3b76e9b15a1cf38b593221Screen Shot 2023-05-03 at 09.45.01.png', NULL, 4, 19, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:34:02', 'active', 0, NULL),
