(420, 145, 4, 1, 1, '9n5DofVK', 'TROPICAL APARTMENTS', 'Tropical Plaza Apartments Offers Accommodations In Kigali, 3.3 Miles From Kigali Centenary Park And 3.3 Miles From Niyo Arts Gallery. Both Free Wifi And Parking On-site Are Accessible At The Condo Hotel Free Of Charge. Kigali Convention Centre Is 3.7 Miles Away, And Nyamata Genocide Museum Is 21 Miles From The Condo Hotel.each Unit Comes With A Sofa, A Seating Area, A Flat-screen Tv, A Well-equipped Kitchen, A Safety Deposit Box, And A Private Bathroom With Slippers. A Terrace With An Outdoor Dining Area And Mountain Views Is Offered In Select Units. At The Condo Hotel, Every Unit Is Equipped With Bed Linen And Towels.buffet And Continental Breakfast Options With Fresh Pastries, Fruit, And Juice Are Available Each Morning At Tropical Plaza Apartments.popular Points Of Interest Near The Accommodation Include Belgian Peacekeepers Memorial, Kigali City Tower, And Kandt House Natural History Museum. The Nearest Airport Is Kigali International Airport, 6.2 Miles From Tropical Plaza Apartments.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 102, 0, '0788321717', 'tropicalplazaltd@gmail.com', 'https://tropicalplaza.rw/', NULL, '../catalog/venues/65fd49453b720_1711098181.jpeg', NULL, 3, 51, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '24/7', '2025-10-03 15:34:02', 'active', 0, NULL),
(422, 1, 4, 1, 1, 'jPWz3PSE', 'Neza Haven Kigali', 'Welcome to Neza Haven - a charming home nestled in the heart of Kigali. This inviting accommodation features four cozy rooms and three modern bathrooms, perfect for accommodating up to 7 guests, making it an ideal choice for couples, families, a group of friends, or even corporate travelers.\r\nWith its prime location in Kacyiru, located 3 mins away from Kigali Convention Center, guests at Neza Haven have convenient access to the city\'s attractions, restaurants, and other cultural experiences.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 60, 0, '0788606765', 'hubert@itdevs.rw', 'https://zoea.ai', NULL, '../catalog/venues/660142f780376_1711358711.jpeg', NULL, 3, 43, 'Kigali, Rwanda', '1.9441,30.0619', '', 531, '24/7', '2025-10-03 15:34:02', 'active', 0, NULL),
