(428, 149, 5, 1, 1, 'OxyvnSKF', 'Tania’s Cuisine and Lounge', 'From Tania\'s Cuisine &amp; Lounge\r\nTania\'s Cuisine &amp; Lounge was founded by Tania Gakuba in January 2017 first as a food catering business and since February 2020 with a home at M&amp;M plaza on KG 8 avenue in Gishushu Area,\r\nGasabo, Kigali, Rwanda.\r\nTania has always been very passionate about cooking and have had various experiences throughout her life in Kinshasa DRC, Brussels\r\nBelgium London UK and Kigali Rwanda.\r\nTania\'s Cuisine &amp; Lounge is specializing in African cuisine with a variety of cuisine from East, Central and West Africa.\r\nYou are welcome for a unique experience at Tania\'s Cuisine &amp; Lounge', '', '', '', '0000-00-00', '0000-00-00', 1, 0, '0789289450', 'info@zoea.ai', 'https://www.instagram.com/taniacuisineandlounge/reels/?ref=poetylsk&amp;hl=en', NULL, '../catalog/venues/6617c172691ed_1712832882.jpeg', NULL, 3, 21, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '8am-12am', '2025-10-03 15:34:02', 'active', 0, NULL),
