(461, 1, 7, 1, 1, 'wOS1pL1V', 'Maji Coffee Ltd.', 'From Maji Coffee Ltd.\r\nNestled amidst the bustling streets of Kigali, Maji Coffee offers a unique retreat that marries the vibrant energy of Rwanda\'s capital with the time-honored coffee traditions of Ethiopia.\r\nDrawing from Ethiopia\'s illustrious coffee heritage, every cup brewed in our café resonates with rich, aromatic tales from the ancient heartlands. While we revel in our Ethiopian coffee roots, our menu ventures beyond, presenting an array of drinks, both non-alcoholic and alcoholic, to cater to diverse tastes.\r\nAt Maji Coffee, we\'ve cultivated more than just a café; we\'ve created a warm, calm, and humble sanctuary where every visit feels like a gentle embrace.\r\nJoin us, and let the aromas of Ethiopia envelop you, right here in Kigali.\r\n^ Less', '', '', '', '0000-00-00', '0000-00-00', 1, 0, '0786866', 'info@zoea.ai', '', NULL, '../catalog/venues/661910bbb2abd_1712918715.jpeg', NULL, 3, 94, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '8:30am-10pm', '2025-10-03 15:34:02', 'active', 0, NULL),
