(501, 155, 4, 1, 1, 'LheTfNhS', 'Hotel Chez Lando', 'Located Within The Bustling Business District Of Remera, Hotel Chez Lando Offers Accommodations In Kigali. This Hotel Is Located Within 1.9 Mi Of Kigali International Airport And Offers Free Wifi.  Each Of The Rooms At Hotel Chez Lando Features A Balcony With Views Of The Manicured Gardens, And Is Equipped With A Mini-bar, Flat-screen Tv And A Laptop Safe. The Private Bathrooms Are Fitted With A Bath And A Shower, And Free Toiletries Are Provided For Your Comfort.  Enjoy A Meal At The Lively Chez Lando Grill, Popular Among Locals And Tourists Alike For Its Rwandan Barbecue Specialties. La Fringale Restaurant Offers Formal Dining With A Variety Of Dishes And A Selection Of South African And French Wines.  Hotel Chez Lando Has A 24-hour Front Desk, And Offers Guests Complimentary Airport Shuttles. Laundry Services Are Available At A Surcharge, And Free Private Parking Is Available On Site.  The Kigali Genocide Memorial Is 5 Mi From Hotel Chez Lando While Kigali Convention Center Is 1.9 Mi Away.  Couples In Particular Like The Location  They Rated It 8.8 For A Two-person Trip.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 107, 1, '250252510000', 'info@chezlando.com', 'https://www.chezlando.com/', NULL, '../catalog/venues/661fa8603f4b7_175672199.jpg', NULL, 3, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 306, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(502, 156, 4, 1, 1, 'p9f7svGD', 'Highlands Suites Hotel and Apartments', 'Highlands Suites offers a unique blend of hotel comfort and apartment convenience in the serene Kilimani neighborhood of Kigali. Whether you\'re a business traveler seeking a productive environment or a leisure guest exploring the city, our stylish rooms and fully-furnished apartments cater to your needs.\r\n\r\nRelax and Recharge\r\n\r\nUnwind after a long day with a swim in our refreshing pool, maintain your workout routine in our well-equipped fitness center, or indulge in a rejuvenating massage at our on-site spa (services additional).\r\n\r\nStart Your Day Right\r\n\r\nFuel your adventures with our complimentary breakfast buffet, featuring delicious options to kickstart your Kigali experience.\r\n\r\nBeyond Your Room\r\n\r\nOur commitment to your comfort extends beyond your room. Enjoy complimentary high-speed Wi-Fi, secure on-site parking, and access to our 24-hour business center for those working on the go. In between exploring Kigali\'s vibrant offerings, find a peaceful retreat in our lush garden or take care of laundry (amenity available in apartments).\r\n\r\nExperience the Highlands Difference\r\n\r\nAt Highlands Suites, we believe in providing exceptional service alongside modern amenities.  Our dedicated team is here to ensure a comfortable and memorable stay in Kigali.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 190, 0, '+250789111457', 'bookings@highlandssuiteshotel.com', 'www.highlandssuiteshotel.com', NULL, '../catalog/venues/661fad5a5656b_475814106.jpg', NULL, 3, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 252, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(503, 157, 4, 1, 1, 'T6z6GOlY', 'SKYLIGHT MOTEL Airport Road', 'Nestled in the heart of Kigali, just 2.6 miles from the vibrant Kigali Convention Centre, SKYLIGHT MOTEL Airport Road welcomes guests with a blend of comfort and convenience. Offering a range of accommodations, including rooms with balconies boasting city views, our motel provides a restful retreat. Each room features modern amenities such as a flat-screen TV and plush slippers, ensuring a comfortable stay.\r\n\r\nGuests can indulge in a delectable ï¿½ la carte or Full English/Irish breakfast at our charming restaurant, where a diverse array of African, American, and British cuisine awaits. Special dietary needs are catered to with our vegetarian, dairy-free, and halal options.\r\n\r\nConveniently situated, our motel offers easy access to popular attractions such as the Niyo Arts Gallery and Kigali Centenary Park, both just a short drive away. For those looking to explore further, bike and car rentals are available, perfect for discovering the city at your own pace.\r\n\r\nAfter a day of sightseeing or business meetings, guests can unwind in our shared lounge or on the terrace, soaking in the serene atmosphere. With attentive room service, a 24-hour front desk, and currency exchange services, we strive to make every stay seamless and memorable.\r\n\r\nWhether you\'re here for business or leisure, SKYLIGHT MOTEL Airport Road provides a welcoming haven for travelers. Plus, with Kigali International Airport just 0.6 miles away, your journey begins and ends with ease.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 25, 0, '250781545800', 'skylightmotel10@gmail.com', 'www.skylightmotel.com', NULL, '', NULL, 2, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 113, '24/7', '2025-12-05 06:19:48', 'active', 0, NULL),
