(528, 185, 4, 1, 1, 'e46jraUK', 'Urban Park Suites', 'Nestled in the heart of Kigali, just 2.2 miles from the bustling Kigali Convention Centre, Urban Park Suites beckons with a blend of contemporary comfort and convenience. Boasting an array of amenities including an inviting outdoor swimming pool, complimentary private parking, a state-of-the-art fitness center, and a tranquil garden, this establishment promises a rejuvenating stay.\r\n\r\nSituated within easy reach of cultural attractions such as the Niyo Arts Gallery and the picturesque Kigali Centenary Park, Urban Park Suites offers more than just a place to rest your head. Indulge in leisurely moments at the on-site bar or dive into adventure with water sports facilities and a thrilling water park.\r\n\r\nGuests are welcomed into air-conditioned rooms thoughtfully equipped with modern conveniences, including a practical desk, an electric tea kettle for that perfect brew, a convenient stovetop, and a safety deposit box for peace of mind. Entertainment is provided by a flat-screen TV, while a private terrace invites relaxation. Each room boasts a private bathroom adorned with a refreshing shower and complemented by essential amenities. Ample storage space is offered with a spacious closet ensuring a clutter-free environment.\r\n\r\nSatisfy your culinary cravings at the hotel\'s restaurant, offering a tantalizing fusion of African, American, and Argentinian cuisine. Catering to diverse dietary preferences, the menu includes options for vegetarians, dairy-free, and vegan guests.\r\n\r\nDedicated to exceeding expectations, Urban Park Suites extends services such as an ironing service and comprehensive business facilities, including fax and photocopying services. The multilingual staff, fluent in English and French, are on hand at the 24-hour front desk to assist with any inquiries or requests.\r\n\r\nConveniently located just 5.5 miles from the poignant Belgian Peacekeepers Memorial and 18 miles from the historic Nyamata Genocide Museum, Urban Park Suites offers easy access to significant landmarks. For seamless travel experiences, the hotel provides a complimentary airport shuttle service to and from the nearby Kigali International Airport, situated just 1.2 miles away.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 130, 1, '0790008667', 'info@urbanparksuites.com', 'www.urbanparksuites.com', NULL, '../catalog/venues/6623e00fdb26a_406752163.jpg', NULL, 3, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 487, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(529, 186, 4, 1, 1, 'effFEhYm', 'The Keza Hotel', 'Welcome to THE KEZA HOTEL, an exquisite retreat nestled near Kigali International Airport, offering a perfect blend of modern comfort and Rwandan hospitality. Recently renovated, this luxurious apartment invites guests to indulge in the serenity of its verdant garden and unwind at the vibrant bar.\r\n\r\nExperience unparalleled convenience with amenities such as a terrace overlooking the breathtaking mountains, a refreshing pool complemented by a pool table, and the convenience of free private parking and Wi-Fi. Our attentive staff, available round-the-clock, ensures a seamless stay, coupled with robust security measures and convenient currency exchange services.\r\n\r\nStep into the lap of luxury within our spacious apartment boasting 16 elegantly appointed bedrooms and bathrooms, complete with plush bathrobes and slippers for ultimate relaxation. Take in the panoramic views of the shimmering pool from your private balcony adorned with comfortable outdoor furniture, or cozy up in the inviting seating area by the fireplace.\r\n\r\nAwaken your senses each morning to a sumptuous breakfast spread featuring buffet, Ã  la carte, and continental delights. Savor delectable culinary creations at our on-site family-friendly restaurant, open for dinner, lunch, brunch, and tantalizing cocktails.\r\n\r\nConveniently located just 3.8 miles from the prestigious Kigali Convention Centre and 4.6 miles from the lush Kigali Centenary Park, THE KEZA HOTEL offers unparalleled access to the city\'s attractions. With Kigali International Airport a mere 1.2 miles away, your journey to relaxation begins the moment you arrive. Indulge in a stay where every detail is meticulously crafted to elevate your experience to new heights.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 40, 0, '0788309912', 'thekezahotel@gmail.com', 'www.thekezahotel.com', NULL, '../catalog/venues/66241e153e244_532127086.jpg', NULL, 4, 16, 'Kigali, Rwanda', '1.9441,30.0619', '', 133, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(532, 189, 4, 1, 1, 'X1zewce7', 'Oasis Park', 'Immerse yourself in luxury living at Oasis Park Apartments, Kigali.\r\n\r\nSituated in the heart of Gishushu, Kigali, Oasis Park Apartments offers a haven of comfort and style. Our spacious apartments, ranging from studios to expansive 4-bedroom penthouses, cater to various needs and preferences.\r\n\r\nExperience the best of Kigali at your doorstep.\r\n\r\nOur prime location places you within minutes of Kigali\'s key landmarks, including the Parliament, Convention Center, RDB, Ministry of Justice, and the trendy Kigali Heights. Enjoy panoramic city views (if applicable to most units) and easy access to the vibrant energy of the city.\r\n\r\nUnwind in your oasis of tranquility.\r\n\r\n[Mention specific amenities here, if available: Relax by the sparkling outdoor pool, soak up the sun on the rooftop terrace, or unwind in the fitness center.]\r\n\r\nWhether you\'re a business traveler seeking a luxurious retreat, a family yearning for a spacious haven, or a couple on a romantic getaway, Oasis Park Apartments promises an unforgettable Kigali experience.\r\n\r\nBook your stay today and discover your oasis in the heart of Kigali!', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 90, 0, '+250 732 000 212', 'info@centuryrealestategroup.com', '', NULL, '../catalog/venues/662436b7a9f9a_3bffff73.avif', NULL, 4, 30, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '24/7', '2025-10-03