(533, 190, 4, 1, 1, 'siaHpHRC', 'Five to Five Hotel', 'Nestled in the vibrant Remera  just a leisurely 5-minute stroll from the iconic Amahoro Stadium, Five to Five Hotel presents a captivating blend of modern comforts and Rwandan hospitality. Boasting a delightful restaurant, seamless free WiFi connectivity across its premises, and exclusive private parking, this establishment promises an unforgettable stay.\r\n\r\nEach room at Five to Five Hotel offers enchanting city vistas, complemented by essential amenities such as satellite TV and a charming balcony, creating a serene sanctuary for guests. Adorned with cozy mosquito nets, the beds invite tranquil nights of rest.\r\n\r\nIndulge your palate with a tantalizing array of local delicacies and international flavors at the hotel\'s inviting restaurant, or savor refreshing beverages amidst breathtaking panoramas from the rooftop terrace. For added convenience, attentive room service is readily available.\r\n\r\nEmbracing the needs of both leisure and business travelers, the hotel provides a 24-hour front desk, dedicated concierge services, a fully-equipped business center, and versatile meeting facilities.\r\n\r\nConveniently positioned, Kigali International Airport is a mere 10-minute drive away, while the esteemed Kigali Convention Centre lies just 3.7 kilometers from the hotel\'s doorstep. Additionally, the poignant Genocide Memorial is situated 8.3 kilometers away, offering profound insights into Rwanda\'s history.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-00-00', '0000-00-00', 125, 1, '0784936392', 'info@fivetofivehotel.com', 'https://fivetofivehotel.com/', NULL, '../catalog/venues/6624d7b4b2171_158334742.jpg', NULL, 3, 30, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(534, 191, 4, 1, 1, '7pn4vyoJ', 'Beausejour Hotel', 'Nestled in the heart of Kigali, Rwanda, Beausejour Hotel invites guests to indulge in a rejuvenating experience with its luxurious spa and wellness center. Whether you\'re seeking relaxation or adventure, this property offers a tranquil terrace and a stylish bar where you can unwind with your favorite drink.\r\n\r\nEach guest room at Beausejour Hotel is meticulously designed to ensure comfort and convenience. Featuring a spacious desk for work or leisure, select rooms are equipped with air conditioning for added comfort. Every room boasts a private bathroom with a refreshing shower and essential toiletries, completing the perfect retreat.\r\n\r\nStart your day with a delightful continental breakfast served fresh every morning at Beausejour Hotel\'s onsite restaurant. Indulge in a delectable meal crafted with care by expert chefs, showcasing a blend of local flavors and international cuisine.\r\n\r\nWith a multilingual staff fluent in English, French, and Swahili available around the clock at the 24-hour front desk, guests can rely on personalized assistance for any inquiries or tour recommendations they may have.\r\n\r\nConveniently located just 1.6 kilometers from Kigali International Airport, Beausejour Hotel offers seamless airport shuttle services upon request, ensuring a stress-free arrival and departure experience for guests.', '', 'Zoea prioritize guest satisfaction and transparency. They encompass check-in/out times, age restrictions, pet policies, smoking rules, and deposit requirements. Property-specific regulations ensure a smooth and enjoyable stay for all guests.', 'Zoea\'s cancellation policy ensures flexibility and clarity for guests. Free cancellation within set days, partial refunds for late cancellations, and non-refundable options provide choice. No-shows incur full charges, while force majeure exceptions may apply. Modifications are possible, with group booking policies also in place.', '0000-0