(554, 212, 4, 1, 1, '0zIAxfPN', 'Gorillas Golf Hotel', 'Welcome to Gorillas Hotel, where luxury meets adventure in the heart of the jungle! Nestled amidst lush greenery and surrounded by towering trees, our hotel offers a unique experience for travelers seeking an unforgettable escape.\r\n\r\nIndulge in the ultimate comfort with our spacious and elegantly appointed rooms, featuring modern amenities and stunning views of the surrounding wilderness. Whether you\'re here for a romantic getaway, a family vacation, or a solo adventure, Gorillas Hotel promises an unparalleled stay.\r\n\r\nExperience the thrill of encountering wildlife up close with our guided jungle treks and safaris, where you\'ll have the chance to spot majestic gorillas, playful monkeys, and exotic birds in their natural habitat. After a day of exploration, unwind and rejuvenate at our onsite spa, offering a range of indulgent treatments inspired by local traditions.\r\n\r\nSavor the flavors of Africa at our onsite restaurant, where our talented chefs prepare delicious dishes using fresh, locally sourced ingredients. Whether you prefer traditional African cuisine or international fare, our diverse menu has something to satisfy every palate.\r\n\r\nAt Gorillas Hotel, we pride ourselves on providing exceptional service and creating unforgettable memories for our guests. Book your stay with us today and embark on the adventure of a lifetime!', '', '', '', '0000-00-00', '0000-00-00', 186, 1, '0788174000', 'reservation@grillashotels.com', 'http://www.gorillashotels.com/', NULL, '../catalog/venues/662a7c1d92b4c_g10 - Copy.jpg', NULL, 4, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in ;14:00\r\ncheck out:12:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(555, 214, 4, 1, 1, 'XTK9W8MV', 'THE B HOTEL', 'Welcome to the b hotel, where modern luxury meets unparalleled comfort in the heart of KIGALI.  Nestled amidst the bustling energy of the city, our boutique hotel offers a serene retreat for travelers seeking both relaxation and adventure.\r\n\r\nStep into our stylish lobby, where sleek design and warm hospitality create an inviting atmosphere from the moment you arrive. Our attentive staff is dedicated to ensuring your stay exceeds expectations, whether you\'re here for business or leisure.\r\n\r\nIndulge in our well-appointed guest rooms, each thoughtfully designed with contemporary furnishings and plush bedding to provide a restful sanctuary after a day of exploration. Equipped with modern amenities such as high-speed Wi-Fi and flat-screen TVs, our rooms offer the perfect blend of comfort and convenience.\r\n\r\nElevate your culinary experience at our onsite restaurant, where expert chefs craft delectable dishes using locally sourced ingredients. Savor innovative cuisine in a chic and intimate setting, or unwind with a handcrafted cocktail at our stylish bar.\r\n\r\nFor those looking to rejuvenate body and mind, our hotel features a state-of-the-art fitness center and tranquil spa facilities. Pamper yourself with a soothing massage or take a dip in our sparkling indoor pool, the perfect way to unwind after a busy day.\r\n\r\nConveniently located near [Nearby Attractions], the b hotel provides easy access to the city\'s top sights and sounds. Whether you\'re here to explore historic landmarks, shop at upscale boutiques, or simply soak in the vibrant culture, our prime location ensures you\'re never far from the action.\r\n\r\nExperience the epitome of urban luxury at the b hotel. Book your stay with us today and discover why we\'re the preferred choice for discerning travelers.', '', '', '', '0000-00-00', '0000-00-00', 150, 1, '0798698092', 'info@thebhotel.rw', 'https://www.google.com/travel/clk?pc=AA80OsxsaF1zHPMjLkDZrRRrIyso8FxmnvA9Z6Win-yuqUqid5nLFzjW7_-jxQS3aNb2f7X3dbWMT7eYNVpCQASHDP0AUPkJMrFYXXefIQFZdrJtMyurmUpT2sYhZJZ_jNZH&amp;pcurl=https://live.ipms247.com/booking/searchroom_ghf.php?HotelId%3D42739%26checkin%3D2024-04-29%26nonights%3D1%26adults%3D2%26children%3D0', NULL, '../catalog/venues/66587ff595e86_the b hotel.jpg', NULL, 5, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Check in:14:00\r\nCheck out: 11:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(556, 216, 4, 1, 1, '9xw5TWG2', '8TWENTY8 RESIDENCE', 'Absolutely,   here\'s a description of 8twenty8 Residents:\r\n\r\nWelcome to 8twenty8 Residents,   where contemporary sophistication meets urban living in the heart of the vibrant city center. Situated at the nexus of culture,   commerce,   and entertainment,   our boutique residence offers a stylish retreat for discerning travelers and modern nomads alike.\r\n\r\nStep into our sleek lobby,   where minimalist design and upscale amenities set the tone for an unforgettable stay. Each of our meticulously crafted apartments boasts modern furnishings,   elegant finishes,   and panoramic views of the city skyline,   providing a luxurious haven for relaxation and rejuvenation.\r\n\r\nIndulge your palate at our onsite dining establishments,   where expert chefs blend culinary innovation with local flavors to create unforgettable dining experiences. Whether you\'re craving artisanal cocktails at the rooftop bar or savoring gourmet cuisine at the ground-floor restaurant,   our culinary offerings are sure to delight even the most discerning palate.\r\n\r\nUnwind and recharge in our state-of-the-art fitness center,   featuring cutting-edge equipment and personalized training programs designed to keep you in peak physical condition. After your workout,   take a dip in our sparkling rooftop pool,   where panoramic vistas of the city skyline provide a breathtaking backdrop for relaxation and leisure.\r\n\r\nConveniently located within walking distance of the city\'s top attractions,   8twenty8 Residents offers easy access to world-class shopping,   dining,   and entertainment options. Whether you\'re exploring historic landmarks,   browsing upscale boutiques,   or simply soaking in the vibrant energy of the city streets,   our prime location ensures you\'re never far from the action.\r\n\r\nExperience the epitome of urban luxury at 8twenty8 Residents. Book your stay with us today and discover why we\'re the preferred choice for travelers seeking a sophisticated sanctuary in the heart of the city.\r\n\r\n Working Hours \r\ncheck in :14:00\r\n\r\n Working Hours \r\ncheck in : 14:00', '', '', '', '0000-00-00', '0000-00-00', 170, 1, '0788771915', '8twenty8spaces@gmail.com', 'https://www.instagram.com/828residence?igsh=eGNyY2ZweXRvdHJ0', NULL, '../catalog/venues/665311de56ad7_8twenty.jpeg', NULL, 5, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in : 14:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(557, 217, 4, 1, 1, 'PKKkQVSH', 'Kigali Ville Maison', 'Welcome To Kigali  Ville Maison, Where Tranquility Meets Elegance In The Heart Of Kigali Nestled Amidst Lush Gardens And Overlooking The Thousand Hills Of Rwanda. Our Boutique Maison Offers A Serene Escape For Those Seeking A Blissful Retreat.step Into Our Charming Villa, Where Traditional Mediterranean Architecture Harmonizes With Modern Comforts To Create A Truly Enchanting Ambiance. Each Of Our Well-appointed Suites Is Tastefully Furnished With Luxurious Amenities And Offers Breathtaking Views Of The Hills And Mountains That Dotted Kigali Or The Verdant Gardens, Providing A Haven Of Relaxation And Rejuvenation.', '', '', '', '0000-00-00', '0000-00-00', 40, 1, '0792402925', 'bobinkigali@gmail.com', 'maisondeomashi.rw', NULL, '../catalog/venues/6675b3fa9d31b_KVM.jpg', NULL, 4, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 49, '24 Hours per day X 7 days per week (24/7)', '2025-10-03 15:38:23', 'active', 0, NULL),
(558, 218, 4, 1, 1, 'PChJKuzv', 'MAISON DE OMASHI Guest House and Suites', 'Welcome to Maison de Omashi,  where the essence of Japanese hospitality meets contemporary comfort in the heart of kigali . Our guest house and suites offer a serene retreat for travelers seeking an authentic cultural experience combined with modern amenities.\r\n\r\nStep into our traditional Japanese-style guest house,  where the warmth of omotenashi (Japanese hospitality) envelops you from the moment you arrive. Each of our thoughtfully designed suites blends traditional elements such as tatami mat flooring and shoji screens with modern comforts,  creating a harmonious fusion of past and present.\r\n\r\nIndulge in the art of Japanese cuisine at our onsite restaurant,  where skilled chefs prepare exquisite dishes using fresh,  seasonal ingredients. From delicate sushi and sashimi to hearty bowls of ramen and comforting plates of tempura,  our culinary offerings showcase the diverse flavors of Japan\'s rich culinary heritage.\r\n\r\nUnwind and rejuvenate in our tranquil garden oasis,  where lush greenery and peaceful water features provide a serene escape from the bustle of the city. Take a leisurely stroll along winding pathways,  meditate amidst the beauty of nature,  or simply relax with a cup of matcha tea in our traditional tea house.\r\n\r\n,  Maison de Omashi offers easy access to the city\'s top sights and experiences. Whether you\'re exploring historic landmarks,  shopping in vibrant markets,  or immersing yourself in the local culture,  our central location ensures you\'re never far from the action.\r\n\r\nExperience the beauty and tranquility of Japanese hospitality at Maison de Omashi. Book your stay with us today and discover the timeless charm of a traditional ryokan combined with the comforts of home.\r\n\r\n Working Hours \r\nCHECK IN/ CHECK OUT', '', '', '', '0000-00-00', '0000-00-00', 15, 1, '0792401900', 'info@maisondeomashi.com', 'http://maisondeomashi.mydirectstay.com/', NULL, '../catalog/venues/66530fa4aadf7_omashi.jpeg', NULL, 5, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 33, 'CHECK IN/ CHECK OUT', '2025-10-03 15:38:23', 'active', 0, NULL),
(559, 219, 4, 1, 1, 'jXpJA0S2', 'PETRA RESIDENCES KIGALI', 'Welcome to Petra Residents, where ancient charm meets modern comfort in the heart of the historic city of Petra. Nestled amidst the breathtaking landscapes of Jordan, our boutique residence offers a unique blend of tradition and luxury for travelers seeking an unforgettable experience.\r\n\r\nStep into our serene oasis, where traditional Jordanian architecture seamlessly combines with contemporary amenities to create a truly immersive stay. Each of our spacious apartments is tastefully decorated with authentic furnishings and modern touches, providing a cozy retreat after a day of exploration.\r\n\r\nEmbrace the rich flavors of Jordanian cuisine at our onsite restaurant, where skilled chefs prepare authentic dishes using locally sourced ingredients. Dine al fresco on our charming terrace, surrounded by stunning views of the Petra mountains, or enjoy a leisurely meal in the comfort of your own apartment.\r\n\r\nUnwind and recharge in our tranquil courtyard, where lush gardens and serene fountains provide a peaceful escape from the hustle and bustle of the city. Whether you\'re sipping tea under the shade of a palm tree or simply soaking in the warm Jordanian sun, our courtyard offers the perfect spot to relax and rejuvenate.\r\n\r\nConveniently located near the entrance to the ancient city of Petra, Petra Residents provides easy access to the region\'s most iconic landmarks and attractions. Explore the awe-inspiring beauty of Petra\'s archaeological sites, hike through rugged desert landscapes, or embark on a thrilling adventure through the nearby Wadi Rum desert.\r\n\r\nExperience the magic of Petra in comfort and style at Petra Residents. Book your stay with us today and discover the timeless beauty of Jordan\'s most iconic destination.', '', '', '', '0000-00-00', '0000-00-00', 40, 1, '0786644618', 'residencepetra47@gmail.com', '', NULL, '../catalog/venues/665317f082d85_petra residence.jpeg', NULL, 5, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 266, 'CHECK IN /CHECK OUT', '2025-10-03 15:38:23', 'active', 0, NULL),
(560, 222, 4, 1, 1, 'YFZS8Mc7', 'Tea House Boutique Hotel', 'Welcome to Tea House Boutique Hotel, where luxury accommodation meets the serene ambiance of a traditional tea house. Nestled in the heart of [Location], our boutique hotel offers a unique fusion of elegance, comfort, and cultural charm for discerning travelers.\r\n\r\nStep into our intimate lobby, adorned with subtle touches of Asian-inspired decor and fragrant aromas of freshly brewed tea. Each of our exquisitely designed rooms and suites is a sanctuary of tranquility, featuring plush bedding, elegant furnishings, and modern amenities to ensure a restful stay.\r\n\r\nImmerse yourself in the art of tea at our onsite tea lounge, where a curated selection of premium teas from around the world awaits. From delicate green teas to robust black blends, our knowledgeable staff will guide you through a sensory journey of taste and aroma, allowing you to experience the true essence of tea culture.\r\n\r\nIndulge your palate at our gourmet restaurant, where skilled chefs blend local flavors with international influences to create culinary masterpieces that delight the senses. Whether you\'re savoring a leisurely breakfast overlooking our tranquil garden courtyard or enjoying an intimate dinner by candlelight, our culinary offerings are sure to tantalize your taste buds.', '', '', '', '0000-00-00', '0000-00-00', 67, 1, '0782181209', 'bnbteahousekigali@gmail.com', '', NULL, '../catalog/venues/66587edf2b3e5_T10.jpg', NULL, 5, 114, 'Kigali, Rwanda', '1.9441,30.0619', '', 297, 'Check out time :11:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(561, 223, 4, 1, 1, 'o1ze9ZzE', 'Adriel Homes &amp; Tours', 'Welcome to Adriel Homes and Tours, your gateway to unforgettable experiences and unparalleled hospitality in [Location]. As a premier provider of accommodation and tour services, we offer a seamless blend of comfort, convenience, and personalized attention to ensure your stay is nothing short of extraordinary.\r\n\r\nStep into our welcoming lobby, where our friendly staff awaits to assist you with all your needs and inquiries. Whether you\'re checking in for a relaxing getaway or embarking on an exciting tour of the region, our team is dedicated to ensuring your stay exceeds expectations from start to finish.\r\n\r\nDiscover the comforts of home in our well-appointed accommodations, each thoughtfully designed to provide a cozy retreat after a day of exploration. From spacious suites with modern amenities to charming guest rooms with picturesque views, we have the perfect option to suit every traveler\'s preferences.\r\n\r\nEmbark on an unforgettable journey with our bespoke tour experiences, tailored to showcase the best of [Location]\'s culture, history, and natural beauty. Whether you\'re exploring ancient ruins, trekking through lush forests, or indulging in culinary delights, our expert guides will ensure you have an immersive and enriching experience.\r\n\r\nUnwind and recharge in our onsite amenities, including a refreshing swimming pool, fitness center, and serene garden spaces. After a day of adventure, relax with a soothing massage or enjoy a leisurely meal at our onsite restaurant, where expert chefs craft delicious dishes using locally sourced ingredients.', '', '', '', '0000-00-00', '0000-00-00', 38, 1, '0791206736', 'Writeadriel@icoud.com', '', NULL, '../catalog/venues/6653159896411_adriel.jpeg', NULL, 5, 33, 'Kigali, Rwanda', '1.9441,30.0619', '', 84, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(562, 224, 4, 1, 1, 'nwArMIPf', 'Igitego Boutique Hotel', 'Nestled In Kigali, Boutique Hotel Offers A Serene Retreat Near Key Landmarks Like The Convention Centre And Centenary Park. Enjoy Free Wifi, Private Parking, And Family Rooms. Explore Nearby Attractions Like Niyo Arts Gallery And Inema Art Centre. Just 1.9 Miles From Kigali International Airport.', '', '', '', '0000-00-00', '0000-00-00', 110, 1, '250785601448', 'igitegoboutiquehotel@gmail.com', 'https://igitegohotel.com/#/', NULL, '../catalog/venues/66797adea00c4_IMG-20240622-WA0022.jpg', NULL, 4, 40, 'Kigali, Rwanda', '1.9441,30.0619', '', 122, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(564, 149, 7, 1, 1, 'bOfStxFw', 'Lamane Bakery &amp; Cafe', 'Lamane Bakery & Cafe, Kigali, Rwanda. 590 Likes  56 Were Here. Lamane Is A Rwandan Chain Of Bakery And Caf Shops Brand That Specialise In Pasteries', '', '', '', '0000-00-00', '0000-00-00', 2, 1, '0788836640', 'lamanebakery@gmail.com', 'https://m.facebook.com/Lamanebakerycafe/', NULL, '../catalog/venues/6637852b50427_1714914603.jpeg', NULL, 3, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '7am-10pm', '2025-10-03 15:38:23', 'active', 0, NULL),
(566, 227, 4, 1, 1, 'nRCzM31n', 'Ecoair Apartment Hotel', 'Welcome To Ecoair Apartment Hotel, Where Sustainability Meets Sophistication, Creating A Harmonious Blend Of Comfort And Eco-conscious Living. Situated In The Heart Of The City, Ecoair Offers A Haven For Travelers Seeking A Responsible And Rejuvenating Stay.our Thoughtfully Designed Apartments Boast Modern Amenities While Prioritizing Eco-friendly Practices. Each Spacious Unit Is Adorned With Sustainable Materials And Energy-efficient Appliances, Ensuring A Comfortable Stay Without Compromising On Environmental Responsibility.start Your Day With A Complimentary Organic Breakfast, Featuring Locally Sourced Ingredients That Tantalize Your Taste Buds And Support The Community. Savor Your Meal In Our Eco-friendly Dining Area, Where Natural Light Streams In Through Large Windows, Connecting You With The Beauty Of The Outdoors.', '', '', '', '0000-00-00', '0000-00-00', 137, 1, '250792106243', 'ecoair@ecoairthotel', 'http://ecoairhotel.com/', NULL, '../catalog/venues/66716c9291db2_IMG-20200917-WA0013-300x300.jpg', NULL, 5, 21, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Check in: 15:00\r\ncheck out :11:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(567, 228, 4, 1, 1, '9fMolkwC', 'SILVER HOTEL KIGALI', 'Welcome To Silver Hotel, Your Luxurious Haven Nestled In The Vibrant City Of Kigali. Embrace The Essence Of Elegance And Sophistication As You Embark On A Journey Of Unparalleled Hospitality And Comfort.located In The Heart Of Kigali, Silver Hotel Offers A Retreat For Travelers Seeking A Seamless Blend Of Modern Amenities And Rwandan Hospitality', '', '', '', '0000-00-00', '0000-00-00', 30, 1, '0789710882', 'info@zoea.ai', '', NULL, '../catalog/venues/6644ca01d3beb_s4.jpg', NULL, 5, 70, 'Kigali, Rwanda', '1.9441,30.0619', '', 66, 'CHECK IN :16:00\r\nCHECK OUT: 11:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(568, 229, 4, 1, 1, '0HStinHV', 'Galaxy Hotel', 'Welcome to Galaxy Hotel, where comfort meets convenience in the heart of every stay. Nestled amidst serene surrounding Galaxy Hotel offers a sanctuary for travelers seeking a blend of relaxation and modern amenities.\r\n\r\nOur hotel boasts spacious and elegantly designed rooms, each meticulously crafted to cater to your every need. Whether you\'re here for business or leisure, our cozy accommodations provide the perfect retreat after a day of exploration or meetings.\r\n\r\nIndulge in a complimentary continental breakfast served fresh every morning, setting the tone for a productive day ahead. Fuel up with a selection of gourmet coffee and teas before embarking on your adventures.', '', '', '', '0000-00-00', '0000-00-00', 130, 1, '+250788382553', 'info@zoea.ai', 'http://galaxyhotel.rw/', NULL, '../catalog/venues/6644cec2ed3f2_g1.jpg', NULL, 4, 111, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in:15:00\r\nCHECK OUT:11:00', '2025-10-03 15:38:23', 'active', 0, NULL),
(572, 233, 4, 1, 1, 'lloNzyzG', 'Blue Veil villa', 'Blue Veil Villa Hotel Has Express Check-in And Check-out, Non-smoking Rooms, A Restaurant, Free Wifi Throughout The Property And A Fitness Center. Among The Various Facilities Are A Garden, A Bar, As Well As A Shared Lounge. The Property Provides A 24-hour Front Desk, A Shared Kitchen And Currency Exchange For Guests.at The Hotel, The Rooms Include A Desk. Complete With A Private Bathroom Equipped With A Shower And Bathrobes, All Rooms At Blue Veil Villa Hotel Have A Tv And Air Conditioning, And Selected Rooms Also Feature A Terrace.niyo Arts Gallery Is 2.8 Miles From The Accommodation, While Kigali Centenary Park Is 2.9 Miles From The Property. The Nearest Airport Is Kigali International Airport, 5.6 Miles From Blue Veil Villa Hotel.', '', '', '', '0000-00-00', '0000-00-00', 160, 1, '250790304014', 'blueveilvilla@gmail.com', '', NULL, '../catalog/venues/6671690336e88_2024-03-05.jpg', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(573, 234, 4, 1, 1, 'OQ7WZFzD', 'Step Town Hotel', 'The Hotel Features Free Wifi Throughout The Property And Free Private Parking Is Available On Site.each Room At Step Town Is Equipped With A Fan, Telephone And A Tv With Satellite Channels. The Private Bathrooms Are Equipped With A Bath Or Shower, And Each Room Features A Terrace Or Patio.step Town Has A Restaurant On Site, Or Guests Can Enjoy A Drink On The Terrace Overlooking Kigali. Special Diet Menus And Room Service Can Also Be Arranged.other Facilities At The Hotel Include A 24-hour Front Desk And Luggage Storage, And Airport Shuttles Are Available At A Surcharge.step Town Is Within 1.9 Mi Of The Kigali Genocide Memorial And Kigali International Airport Is 6.5 Mi Away From The Property.', '', '', '', '0000-00-00', '0000-00-00', 52, 1, '250 785 005 662', 'stepst22@yahoo.com', 'https://steptownhotel.com/contacts/', NULL, '../catalog/venues/664aedd17a658_0Z9A9194.webp', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(576, 237, 4, 1, 1, 'ZTRNnXMM', 'Grazia Hotel', 'Grazia Apartments Offers Air-conditioned Accommodation With A Balcony. Complimentary Private Parking Is Available On Site.there Is An In-house Restaurant At The Property.all Self-catered Units Are Fitted With A Satellite Flat-screen Tv, An Equipped Kitchen With An Oven, And A Private Bathroom With Bath Or Shower. A Microwave, A Toaster And Fridge Are Also Offered, As Well As A Kettle.guests Can Enjoy The Outdoor Swimming Pool At Grazia Apartments.grazia Apartments Is 1.2 Km From Kigali Convention Center, 6.5 Km From Kigali Genocide Memorial And 4.8 Km From Kigali International Airport.', '', '', '', '0000-00-00', '0000-00-00', 172, 1, '+250785797095', 'info@graziaapartment.com', 'https://www.graziaapartmenthotel.com/contact/', NULL, '../catalog/venues/664b063ba03b1_Grazia-Apartement-Hotel_Dining1-1536x1229.jpg', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 381, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(578, 239, 4, 1, 1, 'Nn1TLPZr', 'GREEN VIEW APARTMENTS (A)', 'Explore the beauty of our eco-friendly garden, where native plants thrive and provide a peaceful sanctuary for relaxation and reflection. Take a leisurely stroll along our walking paths or unwind with a book in our outdoor seating areas, surrounded by the beauty of nature.\r\n\r\nStay active and energized in our fitness center, equipped with sustainable workout equipment and ample natural light, inspiring you to maintain your wellness routine while minimizing your impact on the environment.\r\n\r\nAt Greenview Apartments, our commitment to sustainability extends beyond our accommodations to every aspect of your stay, ensuring a guilt-free and environmentally responsible experience. Embrace a new era of hospitality and enjoy a stay that\'s as eco-conscious as it is comfortable at Greenview Apartments.', '', '', '', '0000-00-00', '0000-00-00', 45, 1, '0788373039', 'greenviewapartments2020@gmail.com', '', NULL, '../catalog/venues/664b0defa1516_a4.jpg', NULL, 5, 33, 'Kigali, Rwanda', '1.9441,30.0619', '', 25804, 'CHECK IN/ CHECK OUT', '2025-10-03 15:38:23', 'active', 0, NULL);
