(580, 241, 4, 1, 1, 'YnBZFx5L', 'Parador Guest House', 'Step into our welcoming lobby and immerse yourself in the warm ambiance of our guest house. Our friendly staff awaits to ensure your stay is nothing short of exceptional, from the moment you arrive until your departure.\r\n\r\nIndulge your senses at our on-site bar and restaurant, where culinary delights and refreshing beverages await. Savor a diverse menu of locally inspired dishes, expertly crafted by our talented chefs using the freshest ingredients sourced from nearby markets.\r\n\r\nUnwind after a day of exploration or business meetings with your favorite cocktail or a glass of fine wine at our cozy bar. Chat with fellow travelers, mingle with locals, or simply relax and enjoy the inviting atmosphere.\r\n\r\nRetreat to your comfortable room, designed with your utmost comfort in mind. Sink into plush bedding and enjoy modern amenities that cater to your every need, ensuring a restful night\'s sleep.\r\n\r\nStart your day with a delicious breakfast served in our restaurant, featuring a selection of hearty options to fuel your adventures ahead. Whether you prefer a leisurely meal or a quick bite, our attentive staff is here to ensure your dining experience is memorable.\r\n\r\nAt Parador Guest House, hospitality is our passion, and we strive to create a warm and welcoming environment where every guest feels like family. Experience the charm of our guest house and indulge in a culinary journey that delights the senses.', '', '', '', '0000-00-00', '0000-00-00', 25, 1, '0788300987', 'paradorguesthouse@gmail.com', '', NULL, '../catalog/venues/664b103ea999b_p4.jpg', NULL, 4, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(581, 242, 4, 1, 1, '24FnXOrf', 'COMFORT GUEST INN', 'Welcome to Comfort Guest Inn, your cozy retreat in the heart of [Location]. Situated amidst serene surroundings, Comfort Guest Inn offers a welcoming atmosphere and comfortable accommodations for travelers seeking a peaceful and relaxing stay.\r\n\r\nStep into our inviting lobby, where our friendly staff awaits to ensure your comfort and satisfaction throughout your stay. Whether you\'re here for business or leisure, we strive to make your experience memorable and enjoyable.\r\n\r\nUnwind in our well-appointed rooms, designed with your comfort in mind. Each room features modern amenities and cozy furnishings, providing a relaxing sanctuary after a day of exploration or work.\r\n\r\nStart your day with a complimentary continental breakfast served in our dining area, where you can fuel up with a selection of freshly brewed coffee, pastries, and other delicious options to kick-start your morning.\r\n\r\nExplore the local area with ease, as Comfort Guest Inn is conveniently located near [mention nearby attractions or landmarks]. Whether you\'re here to explore the city\'s vibrant culture or conduct business meetings, our central location ensures easy access to all that [Location] has to offer.\r\n\r\nAfter a day of activities, relax and unwind in our communal lounge area, where you can mingle with fellow guests, read a book, or simply enjoy a moment of peace and tranquility.', '', '', '', '0000-00-00', '0000-00-00', 30, 1, '0788428217', 'comfortguestinn@gmail.com', '', NULL, '../catalog/venues/664b13c0bd8c1_c6.jpg', NULL, 2, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'CHECK IN /CHECK OUT', '2025-10-03 15:38:23', 'active', 0, NULL),
(582, 243, 4, 1, 1, 'yCFeqiq9', 'Cozy Safari', 'Welcome to Cosy Safaris Hotel and Stay, your gateway to adventure and relaxation in the heart of kigali . Nestled amidst breathtaking landscapes and surrounded by the wonders of nature, Cosy Safaris offers a unique blend of comfort and exploration for travelers seeking an unforgettable experience.\r\n\r\nStep into our welcoming lobby, where the friendly smiles of our staff greet you with warm hospitality. From the moment you arrive, we strive to make your stay memorable, whether you\'re here to embark on thrilling safaris or simply unwind in the tranquility of nature.\r\n\r\nIndulge in the comfort of our well-appointed rooms and suites, each designed to provide a peaceful retreat after a day of exploration. Relax on plush bedding and take in panoramic views of the surrounding wilderness from your private balcony or terrace.\r\n\r\nStart your day with a delicious breakfast served in our on-site restaurant, featuring a variety of local and international dishes to tantalize your taste buds. Fuel up with freshly brewed coffee and energizing treats before setting off on your safari adventures.\r\n\r\nDiscover the beauty of kigali \'s natural wonders with our guided safari tours, where you can encounter majestic wildlife and awe-inspiring landscapes up close. Whether you\'re embarking on a game drive, trekking through lush forests, or enjoying a sunset safari, our experienced guides ensure a safe and unforgettable experience.', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '0785721900', 'info@zoea.ai', 'http://www.cozysafari.com/', NULL, '../catalog/venues/664b2ac6e9022_p8.avif', NULL, 5, 105, 'Kigali, Rwanda', '1.9441,30.0619', '', 111, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(583, 244, 4, 1, 1, 'pCqOpWuq', 'Isaro Apartments', 'Isaro Apartments, Located At Kk 418 Street In Kigali, Rwanda, Offers Comfortable And Fully Furnished Accommodations. The Complex Features A Mix Of Self-contained Apartments And Individual Rooms, Totaling 12 Cozy Units. Amenities Include Solar Water Heaters, Cable Tv, Refrigerators, Coffee Makers, And Toasters. The Location Is In A Quiet, Safe Neighborhood With Convenient Access To Grocery Stores, Banks, And Other Services. Guests Also Benefit From Free Wi-fi, Private Parking, And On-site Laundry Facilities (isaro Apartments) .', '', '', '', '0000-00-00', '0000-00-00', 60, 1, '0788604250', 'isaroapartments@gmail.com', '', NULL, '../catalog/venues/66587b5b9f928_i5.jpg', NULL, 5, 101, 'Kigali, Rwanda', '1.9441,30.0619', '', 133, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(584, 245, 4, 1, 1, 'Kk34PEaL', 'Dana Kigali hotel', 'Dana Kigali Hotel, Situated In Kigali, Rwanda, Offers A Blend Of Comfort And Convenience With Its Range Of Accommodations And Amenities. The Hotel Features Various Room Types, Including Budget Double Rooms, Double Rooms With Mountain Views, Family Deluxe Suites, And Two-bedroom Apartments, Catering To Solo Travelers, Couples, Families, And Groups Of Friends.each Room Is Equipped With Modern Amenities Such As Flat-screen Tvs With Satellite Channels, Private Bathrooms, And Some With Terraces Offering Garden Or City Views. The Family Deluxe Suite, For Example, Includes Two Bedrooms, A Jacuzzi, A Dining Area, And A Balcony With A Pleasant View, Making It Ideal For Families (dana Kigali Hotel) (ehotelsreviews).the Hotel Provides A Range Of Services, Including A 24-hour Front Desk, Airport Transportation, Free Wi-fi, And Room Service. Guests Can Also Enjoy A Variety Of Meals At The On-site Restaurant, Which Serves Both Global And Local Cuisines. The Hotel Emphasizes A Home-like Atmosphere, Aiming To Offer An Unforgettable Experience With Personalized Service (dana Kigali Hotel) (dana Kigali Hotel).dana Kigali Hotel Is Conveniently Located About 5 Kilometers From The Kigali Convention Centre, Making It An Excellent Choice For Business Travelers As Well (dana Kigali Hotel).', '', '', '', '0000-00-00', '0000-00-00', 60, 1, '250798654891', 'info@danakigali.rw', '', NULL, '', NULL, 4, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(588, 250, 4, 1, 1, 'jHHiOLHf', 'INZOZI AFRICA HOUSE B&amp;B-Kacyiru', 'Inzozi Africa House B&b, Located In Kigali Kakyiru Rwanda, Offers A Range Of Accommodation Options Including Dorms, Single, And Double Rooms. Situated In The Kacyiru District, It Is Close To Major Landmarks Like The Us Embassy And Niyo Arts Gallery. The B&b Features Amenities Such As Free Wi-fi, A Shared Kitchen, A Garden, And A Sun Terrace. Guests Can Enjoy A Complimentary Breakfast And The Property Provides A 24-hour Front Desk Service. The Atmosphere Is Noted For Being Cozy And Welcoming, Making It Ideal For Both Short And Extended Stays  .', '', '', '', '0000-00-00', '0000-00-00', 45, 1, '0783637165', 'info@inzoziafrica.com', '', NULL, '../catalog/venues/665700bff0645_k6.jpg', NULL, 5, 47, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(589, 251, 4, 1, 1, 'ClKXJky8', 'Amen Boutique Hotel', 'Amen Boutique Hotel In Kigali Offers A Welcoming And Comfortable Stay In The Heart Of The City. The Hotel Emphasizes A Home-like Atmosphere, Combining Affordability With High-quality Accommodations Designed To Meet The Needs Of Every Guest. Each Room At The Hotel Includes A Private Balcony, Allowing Guests To Enjoy The Stunning Views Of Kigali And Its Surrounding Hills.the Hotel Features A Variety Of Room Types, Including Comfort, Deluxe, And Family Rooms, All Equipped With Modern Amenities To Ensure A Comfortable Stay. Rates Range From $50 To $120 Per Night, Catering To Different Budget Needs (amen Hotels) (amen Hotels).amen Boutique Hotel Is Particularly Noted For Its Exceptional Customer Service. The Staff Is Dedicated To Providing Personalized Attention, Ensuring That Every Guest Has A Memorable Experience. The Hotel Offers A Range Of Services, Including Complimentary Breakfast, 24-hour Front Desk Assistance, And High-speed Wi-fi (amen Hotels).', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '0799366314', 'info@zoea.ai', 'https://amenhotels.com/', NULL, '../catalog/venues/66570ccf26702_a1.jpg', NULL, 5, 70, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'check in / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(590, 252, 4, 1, 1, 'xBMprelO', 'Colours Garden Hotel and Spa', 'Colors Boutique Hotel, located in Kigali, Rwanda, is known for its vibrant, cozy atmosphere and central location. The hotel offers a range of comfortable accommodations, including rooms with modern amenities such as air conditioning, free Wi-Fi, satellite TV, and private bathrooms with complimentary toiletriesâ€‹ (Booking.com)â€‹â€‹ (Heaven Rwanda)â€‹.\r\n\r\nGuests can enjoy various facilities including a garden, terrace, and a well-regarded restaurant serving both local and international cuisine. The hotel is conveniently situated near Kigali\'s major attractions, making it an excellent base for exploring the cityâ€‹ (Booking.com)â€‹â€‹ (Luxury African Safari Holidays &amp; Tours )â€‹.\r\n\r\nColors Boutique Hotel is also recognized for its commitment to sustainability and supporting the local community through ethical sourcing and employment initiativesâ€‹ (Heaven Rwanda)â€‹. This makes it a popular choice for both leisure and business travelers seeking a pleasant stay with a touch of local charm.', '', '', '', '0000-00-00', '0000-00-00', 25, 1, '0788521369', 'info@zoea.ai', 'https://coloursrwanda.com/', NULL, '../catalog/venues/665d949845b59_4.jpg', NULL, 4, 111, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'checkin / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(591, 253, 4, 1, 1, 'pcL1qe4H', 'Inzozi Africa House Kimihurura', 'Inzozi Africa House, Located In Kigali, Rwanda, Offers Comfortable And Affordable Accommodations. Situated In The Kacyiru District, It Is Close To Key Landmarks Like The Us Embassy And British Council Office. The Bed And Breakfast Features A Variety Of Rooms, Including Dorms, Singles, And Doubles, All Equipped With Modern Amenities Such As Free Wi-fi And Private Bathrooms. Guests Can Enjoy A Complimentary Breakfast, A Shared Kitchen, A Garden, And A Sun Terrace. The Welcoming Atmosphere And Convenient Location Make It An Ideal Choice For Travelers', '', '', '', '0000-00-00', '0000-00-00', 50, 1, '0783637165', 'info@inzoziafrica.com', 'www.inzoziafrica.com', NULL, '', NULL, 4, 20, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'checkin / check out', '2025-10-03 15:38:23', 'active', 0, NULL),
(594, 258, 4, 1, 1, '5XjMw8E6', 'Vibz Palace', 'Indulge in the perfect blend of comfort and convenience at VIBZ PALACE .nestled in the heart of Kigali. Each thoughtfully designed room boasts its private bathroom, ensuring a relaxing and private stay. Stay entertained with modern amenities such as TVs and stay connected with complimentary Wi-Fi accessible throughout the property.\r\nTake in the breathtaking city views from your private balcony, offering a tranquil retreat after a day of exploration. Our rooftop oasis features a stylish bar and restaurant, serving up delicious meals and refreshing drinks amidst stunning vistas.\r\nConvenience is key, and our guest house offers ample parking for your vehicle, making travel hassle-free. Situated close to Kigali\'s central hub, the airport, and the Kigali Convention Center, our location is ideal for both business and leisure travelers seeking comfort, accessibility, and a memorable stay in Rwanda\'s vibrant capital city.', '', '', '', '0000-00-00', '0000-00-00', 30, 1, '0781256351', 'vibzpalace12@gmail.com', '', NULL, '../catalog/venues/6683a2da2d3ab_2022-02-16.jpg', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(596, 265, 4, 1, 1, 'H1wvIkDT', 'The Nest', 'The Nest Features An Outdoor Swimming Pool At Our Neighboring Property, Garden, A Terrace And Inhouse Bar In Kigali. The Property Is Around 1.4 Km From Kigali Convention Centre, 4.7 Km From Kigali Centenary Park And 7.3 Km From Belgian Peacekeepers Memorial. The Accommodation Provides A 24-hour Front Desk, Airport Transfers, And Free Wifi Throughout The Property.at The Hotel, Every Room Has Where To Keep Clothes, ... Etc. The Private Bathroom Is Equipped With A Shower, Slippers And Free Toiletries.a Buffet, Continental Or American Breakfast Can Be Enjoyed At The Property.inema Art Centre Is 2.7 Km From The Nest, While Ivuka Arts Studio Is 3 Km Away. The Nearest Airport Is Kigali International Airport, 4 Km From The Accommodation.', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '250790008935', 'info@thenestkigali.com', 'www.thenestkigali.com', NULL, '../catalog/venues/6672dd2430fda_1.png', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 221, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(597, 266, 4, 1, 1, 'WpWNV9rv', 'Rohi Apartments', 'Set 200 Meters From Kigali Conventional Center, Rohi Apartments Provides Accommodation With Seating Area. Complimentary Wifi Is Featured.the Air-conditioned Units Are Furnished With Tiled Floors And Feature A Private Bathroom, A Flat-screen Tv, Desk, A Living Room, An Equipped Kitchen, Balcony And Views Over The Garden. There Is Also An Oven, Microwave And A Kettle.a Continental Breakfast Is Available Daily At The Apartment.rohi Apartments Offers A Terrace.a Car Rental Service Is Available At This Property.nyaruzoea Tennis Club Is 700 Metres From The Accommodation.', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '250788306040', 'info@rohiaparthotel.co.rw', 'https://rohiaparthotel.co.rw/', NULL, '../catalog/venues/6672c01a87ecd_IMG-20240618-WA0309.jpg', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:38:23', 'active', 0, NULL),
(598, 267, 4, 1, 1, 'kn2UInmF', 'La Posh hotel', 'Featuring Free Wifi And A Restaurant, La Posh Hotel Offers Accommodation In The Centre Of Kigali, The Hotel Has A Fitness Centre, And Guests Can Enjoy A Meal At The Restaurant Or A Drink At The Bar. Free Private Parking Is Available On Site.the Classically Decorated Rooms Come With A Flat-screen Satellite Tv, Fan, Desk, A Seating Area And A Private Bathroom. For Your Comfort, You Will Find Slippers And A Hairdryer.there Is A 24-hour Front Desk And Staff Can Help You Organise Trips And Excursions.kigali International Airport Is A 20-minute Drive From The Property.groups Particularly Like The Location  They Rated It 8.1 For Stays With Multiple People.', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '250785376215', 'laposhhotel@gmail.com', '', NULL, '../catalog/venues/6672e15df3e72_WhatsApp Image 2024-01-24 at 14.12.18_86c0cfca.jpg', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '24/7', '2025-10-03 15:38:23', 'active', 0, NULL),
(599, 268, 4, 1, 1, 'negLZXzu', 'Bisabo Suites', 'Discover the unparalleled charm of Kigali\'s hidden oasis at BISABO Suites Apartments. Nestled in the heart of Rwanda\'s vibrant capital, our luxurious apartments offer a serene retreat amidst the bustling city. Experience the perfect blend of modern elegance and natural beauty, with meticulously designed interiors, lush green spaces, and breathtaking views of the Kigali skyline.', '', '', '', '0000-00-00', '0000-00-00', 100, 1, '250798707679', 'info@bisabo.com', '', NULL, '../catalog/venues/6672c347d3fd4_img (16).webp', NULL, 0, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, '', '2025-10-03 15:38:23', 'active', 0, NULL),
