(737, 253, 4, 1, 1, 'Qvi4VqJo', 'Inzozi Africa House Gishushu', 'With Garden Views, Inzozi Africa House B&b-gishushu Is Located In Kigali And Has A Restaurant, Full-day Security, Bar, Garden, Outdoor Fireplace, And Picnic Area. Private Parking Is Available On-site At This Recently Renovated Property. The Bed And Breakfast Provides Mountain Views, A Sun Terrace, A 24-hour Front Desk, And Free Wifi Is Available Throughout The Property.at The Bed And Breakfast, All Units Are Fitted With A Desk. All Units Include A Private Bathroom With A Bath, Slippers, And Free Toiletries. At The Bed And Breakfast, The Units Are Fitted With Bed Linen And Towels. La Carte And Continental Breakfast Options With Local Specialties, Fresh Pastries, And Pancakes Are Available Daily At The Bed And Breakfast. There Is A Coffee Shop And A Grocery Delivery Service, And Packed Lunches Are Also Available.the Area Is Popular For Cycling, And Bike Hire And Car Hire Are Available At Inzozi Africa House B&b-gishushu. An Indoor Play Area Is Also Available For Guests At The Accommodation.kigali Convention Centre Is 1.4 Km From Inzozi Africa House B&b-gishushu, While Niyo Arts Gallery Is 4.5 Km Away. The Nearest Airport Is Kigali International, 3 Km From The Bed And Breakfast, And The Property Offers A Paid Airport Shuttle Service.your Property Description Is Created According To The Facilities And Amenities You Add. Its Then Translated Into Multiple Languages. This Can Increase Your Bookings Because It Appeals To All Potential Guests.', '', '', 'non-refundable', '0000-00-00', '0000-00-00', 50, 1, '0783637165', 'info@inzoziafrica.com', 'www.inzoziafrica.com', NULL, '', NULL, 5, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'private bathroom, free toiletries, towels, and everyday housekeeping service.', '2025-10-03 15:38:23', 'active', 0, NULL),
(738, 253, 4, 1, 1, 'EHUstyBu', 'Inzozi Africa House Kacyiru', 'Situated Within 800 Meters Of Niyo Arts Gallery And 3.3 Km Of Kigali Convention Centre In Kigali, Inzozi Africa House B&b- Kacyiru Offers Accommodation With A Seating Area. Boasting A Shared Kitchen, This Property Also Provides Guests With A Picnic Area. The Bed And Breakfast Features A Sun Terrace, A 24-hour Front Desk, And Free Wifi Is Available Throughout The Property.all Units Come With A Balcony With City Views, A Fully Equipped Kitchen With A Microwave And A Minibar, And A Private Bathroom With Walk-in Shower. Guests Can Have Wine Or Champagne And Fruits Delivered To Their Room. At The Bed And Breakfast, Each Unit Is Fitted With Bed Linen And Towels.guests At The Bed And Breakfast Can Enjoy A Continental Breakfast, And Breakfast In The Room Is Also Available. Guests Can Grab A Bite To Eat In The In-house Family-friendly Restaurant, Which Specializes In African Cuisine And Also Offers Vegetarian, Vegan, And Dairy-free Options.sightseeing Tours Are Available Within A Reachable Distance Of The Property. A Car Rental Service Is Available At Inzozi Africa House B&b- Kacyiru, While Cycling Can Be Enjoyed Nearby.kigali Centenary Park Is 3.4 Km From The Accommodation, While The Belgian Peacekeepers Memorial Is 5.7 Km From The Property. The Nearest Airport Is Kigali International, 8 Km From Inzozi Africa House B&b- Kacyiru, And The Property Offers A Paid Airport Shuttle Service.', '', '', 'non-refundable', '0000-00-00', '0000-00-00', 50, 1, '0783637165', 'info@inzoziafrica.com', 'www.inzoziafrica.com', NULL, '../catalog/venues/66929d305ef22_286786079.jpg', NULL, 5, 0, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'dining area, laundry, ironing,', '2025-10-03 15:38:23', 'active', 0, NULL),
