(1062, 725, 78, 5, 0, 'Q5OV8diF', 'Nairobi National Park', 'Nairobi National Park Is A National Park In Kenya That Was Established In 1946 About 7 Km South Of Nairobi. It Is Fenced On Three Sides, Whereas The Open Southern Boundary Allows Migrating Wildlife To Move Between The Park And The Adjacent Kitengela Plains. Herbivores Gather In The Park During The Dry Season.', '', '', '', '0000-00-00', '0000-00-00', 0, 1, '+254 800 597 000', '', '', NULL, '../catalog/venues/66e9ba305ba7a_555_8094.JPG', NULL, 5, 10, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Monday	6â€¯amâ€“6:30â€¯pm\r\nTuesday	6â€¯amâ€“6:30â€¯pm\r\nWednesday	6â€¯amâ€“6:30â€¯pm\r\nThursday	6â€¯amâ€“6:30â€¯pm\r\nFriday	6â€¯amâ€“6:30â€¯pm\r\nSaturday	6â€¯amâ€“6:30â€¯pm\r\nSunday	6â€¯amâ€“6:30â€¯pm', '2025-10-03 15:38:23', 'active', 0, NULL);
