(1063, 726, 78, 5, 0, 'l9hbZuBQ', 'Giraffe Centre', 'The Giraffe Centre is located in Lang\'ata, approximately 20 kilometres from the centre of Nairobi, Kenya. It was established in order to protect the vulnerable giraffe, that is found only in the grasslands of East Africa.', '', '', '', '0000-00-00', '0000-00-00', 0, 1, '+254 20 8070804', '', '', NULL, '../catalog/venues/66e9bb29cb9fb_2019-07-08.jpg', NULL, 5, 15, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Monday	9â€¯amâ€“5â€¯pm\r\nTuesday	9â€¯amâ€“5â€¯pm\r\nWednesday	9â€¯amâ€“5â€¯pm\r\nThursday	9â€¯amâ€“5â€¯pm\r\nFriday	9â€¯amâ€“5â€¯pm\r\nSaturday	9â€¯amâ€“5â€¯pm\r\nSunday	9â€¯amâ€“5â€¯pm', '2025-10-03 15:38:23', 'active', 0, NULL),
