(1065, 728, 78, 5, 0, 'V1GmzVRX', 'Mount Kenya National Park', 'Mount Kenya National Park was established in 1949 to protect Mount Kenya, the wildlife, and the surrounding environment, which forms a habitat for wild animals, as well as acting as an area for the catchment of water, to supply Kenya\'s water', '', '', '', '0000-00-00', '0000-00-00', 0, 1, '+254 716 493335', '', '', NULL, '../catalog/venues/66e9c773d0d9b_2019-07-04.jpg', NULL, 4, 6, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Monday	6â€¯amâ€“6â€¯pm\r\nTuesday	6â€¯amâ€“6â€¯pm\r\nWednesday	6â€¯amâ€“6â€¯pm\r\nThursday	6â€¯amâ€“6â€¯pm\r\nFriday	6â€¯amâ€“6â€¯pm\r\nSaturday	6â€¯amâ€“6â€¯pm\r\nSunday	6â€¯amâ€“6â€¯pm', '2025-10-03 15:38:23', 'active', 0, NULL),
