(1067, 730, 78, 5, 0, 'wSi7sBb4', 'Meru National Park', 'Meru National Park Is A Kenyan National Park Located East Of Meru, 350 Km From Nairobi. Covering An Area Of 870 Km, It Is One Best Known National Parks In Kenya. Rainfall In This Area Is Abundant With 635762 Mm In The West Of The Park And 305356 Mm In The East. The Rainfall Results In Tall Grass And Lush Swamps', '', '', '', '0000-00-00', '0000-00-00', 0, 1, '254 786 348875', '', '', NULL, '../catalog/venues/66e9cac98bf9b_IMG_9911.JPG', NULL, 4, 573, 'Kigali, Rwanda', '1.9441,30.0619', '', 0, 'Monday	6â€¯amâ€“6â€¯pm\r\nTuesday	6â€¯amâ€“6â€¯pm\r\nWednesday	6â€¯amâ€“6â€¯pm\r\nThursday	6â€¯amâ€“6â€¯pm\r\nFriday	6â€¯amâ€“6â€¯pm\r\nSaturday	6â€¯amâ€“6â€¯pm\r\nSunday	6â€¯amâ€“6â€¯pm', '2025-10-03 15:38:23', 'active', 0, NULL),
