(519, 836, 0, 10, '2024-12-25 09:00:12', 'Sinc', 'JaBA #2 - Sounds For The Musically Aware ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1734437120505_file_IMG-20241217-WA0027.jpg', 'JaBA SESSION VOL. 2 – FRIDAY, FEBRUARY 1, 2025\n\nKigali, are you ready?\n\nAfter shutting it down with a boombastic re-launch in November 2024, JaBA is back for another epic night of vibes, sounds, and culture. Don’t just take our word for it—here’s what SensMag Rwanda had to say:\n\"This immersive event, which blends Afrofuturistic sounds with traditional influences, delivered an unforgettable experience to attendees.\"\n\nFor Vol. 2, we’re taking it up a notch in the brand-new, warehouse-style venue Depot37 inside the Mundi Center.\n\n🔥 LINEUP\n- Special Guest: COCO EM (Nairobi) – the Nairobi-based DJ and Boiler Room alum who redefines the dancefloor with her boundary-pushing sets.\n- Resident DJs: T ROY (Broadcite UK) & ERIC SOUL (AFROGROOV)\n- Local Guest: KAVUMBI DUST (Funky Friday)\n- Hosted by: MUTI MUSA\n\nYou already know the drill!\nLimited space. Big vibes. Secure your tickets now.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-02-01', '2025-02-01 18:00:56', '2025-02-02', '2025-02-02 01:00:56', 'https://www.sinc.events/jaba_2_723_edition_2', 0, 0, 2, 'Upcoming'),
