(525, NULL, 0, 1, '2024-12-25 12:27:12', 'Zoea', '2025 UCI ROAD WORLD CHAMPIONSHIP', '../catalog/events/fed2a0f5a330c86457507df8c7ac9e3cd98dc672Screenshot 2024-12-25 at 2.25.46 PM (1).png', 'In the first of a series exploring cycling in different regions of the world, we focus on Africa.\r\n\r\nThe UCI Road World Championships is an annual event organized by the Union Cycliste Internationale (UCI) for bicycle road racing. The event consists of events for road race and individual time trial, and as of 2019 a mixed team relay.\r\n\r\nThe 2025 UCI Road World Championships will be held in Kigali, Rwanda, from September 21 to 28, 2025. This will be the first time that the UCI Road World Championships have been held in Africa.\r\n\r\nThe event will feature a variety of road cycling disciplines, including the road race, time trial, individual time trial, and team time trial. The championships are expected to attract over 5,000 cyclists and 20,000 delegates from around the world.\r\n\r\nThe UCI Road World Championships are the most prestigious cycling event in the world. They are held every two years and are a major test of the worldâ€™s best cyclists. The 2025 championships are expected to be a major event for Rwanda and for Africa as a whole.', 'Kigali City, Rwanda', '', '2025-09-21', '2025-09-21 08:00:00', '2025-09-21', '2025-09-21 08:00:00', 'https://www.uci.org/article/globe-riders-africa-gearing-up-for-2025-uci-road-world-championships-in/33uOYFn6vsVjs0oE6Jfwci', 18, 15, 4, 'Upcoming'),
