(543, 897, 0, 10, '2024-12-30 12:00:06', 'Sinc', 'BWATO ART VILLAGE Space Reveal Party/ New Year\'s Eve Bash', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1735555574561_file_Bwato%20Space%20Reveal%20Party%2031.12', 'BWATO Space Reveal Party ⛵️\n.\nIf you’re in Gisenyi (Rubavu) or planning to be there on December 31st, don’t miss our space reveal party!\n⛵️\nAt BWATO Art Village, we aim to bridge the contemporary artistic gap between Gisenyi and the rest of the country / the world at large, through art exchange programs. This celebration marks a step toward that mission.\n⛵️\n.\nWhat to expect:\n✨A photo exhibition by DJ @djmotari_teamkumba_, founder of @kigaliphotocenter\n.\n.\n🎧 DJ sets by:\n- @kavumbi_dust, founder & curator of @funky_friday_event\n- @alyt_mx, DJ & music producer\n- @c_r_3_3_d, DJ, founder of @dmnxn, & stage installation curator\n- @lyynduh co-founder of @elle_kwa_mziki & @bwato_art_village\n- @nyah.costa, musician & emerging DJ from @elle_kwa_mziki\n.\nFeaturing @native1018_, a fashion house rooted in recycling and upcycling authentic designs.\n⛵️\nP.S. Our space is a work in progress—your ideas and donations are welcome! 🙏🏽\n.\n.\nLet’s sail into 2025 together. ⛵️\n', 'Gisenyi', '[-1.6990482,29.2560996]', '2024-12-30', '2024-12-30 11:15:08', '2024-12-30', '2024-12-30 22:45:08', 'https://www.sinc.events/bwato_art_852', 0, 0, 0, 'Happening'),
(544, 898, 0, 10, '2024-12-30 16:00:10', 'Sinc', 'Afro Fusion Dance Class ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1735570970576_file_IMG_3320', 'Afro Fusion Dance Class with Manzi Mbaya Every Tuesday | 6:30 PM – 8:00 PM Join Rwandan dance sensation and choreographer Manzi Mbaya for an exhilarating Afro Fusion dance class every Tuesday. Fusing traditional African rhythms with contemporary urban moves, this class is designed for dancers of all levels seeking to expand their artistic expression and deepen their connection to African culture. Manzi Mbaya, founder of the Move Afrika Dance Camp, is a master of blending dance styles and has trained at the renowned Ecole de Sable in Senegal. His unique approach to Afro Fusion blends precision, creativity, and powerful storytelling through movement. Students will explore dynamic choreography, improve their technique, and build confidence under Manzi’s expert guidance, known for his contagious energy and passion. Whether you’re a beginner or an experienced dancer, this class offers a fun and dance skills and beyond.', 'The Pink House Kigali', '[-1.9528976,30.0797059]', '2025-01-07', '2025-01-07 16:30:30', '2025-01-07', '2025-01-07 18:30:30', 'https://www.sinc.events/afro_fusio_96_edition_22', 0, 6, 1, 'Upcoming'),
