(574, 922, 0, 10, '2025-01-09 06:00:14', 'Sinc', 'INDIRIRARUGAMBA', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1736156770930_file_9DB08669-1611-4B1D-8DF4-1A9008E0EC02', 'INDIRIRARUGAMBA \n is a captivating showcase of Rwanda’s vibrant dance traditions, featuring the powerful Intore warrior dances, the celeblatory, and the graceful Ikirori With energetic drumming, colorful costumes, and the majestic Intore dances of valor, this performance brings Rwanda’s rich culture to life, celebrating unity, strength, and heritage.', 'Kigali Conference and Exhibition Village (KCEV)', '[-1.9580044,30.0614195]', '2025-01-25', '2025-01-25 12:00:32', '2025-01-25', '2025-01-25 19:30:32', 'https://www.sinc.events/ishyaka_ry_870', 0, 0, 0, 'Upcoming'),
(575, 934, 0, 10, '2025-01-09 21:00:10', 'Sinc', 'Afro Fusion Dance Class ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1735570970576_file_IMG_3320', 'Afro Fusion Dance Class with Manzi Mbaya Every Tuesday | 6:30 PM – 8:00 PM Join Rwandan dance sensation and choreographer Manzi Mbaya for an exhilarating Afro Fusion dance class every Tuesday. Fusing traditional African rhythms with contemporary urban moves, this class is designed for dancers of all levels seeking to expand their artistic expression and deepen their connection to African culture. Manzi Mbaya, founder of the Move Afrika Dance Camp, is a master of blending dance styles and has trained at the renowned Ecole de Sable in Senegal. His unique approach to Afro Fusion blends precision, creativity, and powerful storytelling through movement. Students will explore dynamic choreography, improve their technique, and build confidence under Manzi’s expert guidance, known for his contagious energy and passion. Whether you’re a beginner or an experienced dancer, this class offers a fun and dance skills and beyond.', 'The Pink House Kigali', '[-1.9528976,30.0797059]', '2025-01-14', '2025-01-14 16:30:36', '2025-01-14', '2025-01-14 18:00:36', 'https://www.sinc.events/afro_fusio_96_edition_23', 0, 0, 0, 'Upcoming'),
