(657, 1091, 0, 10, '2025-02-28 13:00:14', 'Sinc', 'KAMONYI WAY 2', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1740588948917_file_IMG_4766', 'We are delighted to invite you to our second edition of KAMONYI WAY .\n\nBelow are 2 kinds of tickets where the first one of 15,000 covers entrance fee to the event plus free transportation To & Fro to the event’s venue, and the second one of 10,000 Rwf covers the entrance but no transportation provided.\n\nFor those who will buy tickets at 15,000 we will all depart between 12 - 2 PM, buses will be available at ORYX PETROL STATION opposite to REMERA BUS STATION. \n⚠️ KINDLY KEEP TIME ⚠️\n\nThe first bus will return to kigali at 6:30 PM for those who will wish to return early.\n\nFood and drinks will be provided at the venue, if you wish to bring your own bottle we will charge 20,000 Rwf per bottle as corkage fee.\n\nThis event is strictly for people above 18 and consumption of any illegal substance is highly prohibited.\n\nFor directions and more information please call 0788318263 / 0788467188 / 0781605386.\n\nSEE YOU ON SATURDAY 🫶', 'Kamonyi', '[-2.029889,29.9277947]', '2025-03-01', '2025-03-01 10:00:45', '2025-03-01', '2025-03-01 22:00:45', 'https://www.sinc.events/kamonyi_wa_172', 0, 0, 0, 'Upcoming'),
