(662, 1102, 0, 10, '2025-03-02 11:00:13', 'Sinc', 'Afrofusion dance class with Manzi Mbaya ', 'https://sinc-live.s3.ap-northeast-1.amazonaws.com/1738414817442_file_69b37ce5-04cc-4c03-89e6-70f2bcd08876', 'Afro Fusion Dance Class with Manzi Mbaya Every Tuesday | 6:30 PM – 8:00 PM Join Rwandan dance sensation and choreographer Manzi Mbaya for an exhilarating Afro Fusion dance class every Tuesday. Fusing traditional African rhythms with contemporary urban moves, this class is designed for dancers of all levels seeking to expand their artistic expression and deepen their connection to African culture. Manzi Mbaya, founder of the Move Afrika Dance Camp, is a master of blending dance styles and has trained at the renowned Ecole de Sable in Senegal. His unique approach to Afro Fusion blends precision, creativity, and powerful storytelling through movement. Students will explore dynamic choreography, improve their technique, and build confidence under Manzi’s expert guidance, known for his contagious energy and passion. Whether you’re a beginner or an experienced dancer, this class offers a fun and dance skills and beyond.\n', 'Francophone Cultural Centre of Rwanda', '[-1.9578848,30.0965041]', '2025-03-04', '2025-03-04 16:30:05', '2025-03-04', '2025-03-04 18:00:05', 'https://www.sinc.events/afrofusion_96_edition_6', 0, 0, 0, 'Upcoming'),
