(798, 1251, 0, 10, '2025-04-29 10:00:09', 'Sinc', 'Legends Night - Makayanga Abdoul', 'https://dbmhau7o59w3r.cloudfront.net/1745919583665-file-Poster1.jpg', 'Discover Gisope at Legends Night: A Celebration of Gisope music with the Iconic Makanyaga Abdoul\nGisope is a joyful, soulful Rwandan music that made generations dance.\nThis timeless sound returns live with the legendary Makanyaga Abdoul.\nJoin us on Saturday, May 10th, at Piazza, Mundi Center.\nCome feel the rhythm, whether it’s familiar or brand new to you.\nLet’s dance, remember, and celebrate together.', 'Mundi Center', '[-1.9694694,30.0878461]', '2025-05-10', '2025-05-10 18:00:54', '2025-05-10', '2025-05-10 21:00:54', 'https://www.sinc.events/legends-ni-712', 0, 0, 0, 'Upcoming'),
