(831, 1281, 0, 10, '2025-05-05 15:00:10', 'Sinc', 'Ikaze After Party: May Edition', 'https://dbmhau7o59w3r.cloudfront.net/1746451149906-file-IKAZE+PARTY+VOLUME+2+(Poster)', 'Revolte is back with the Ikaze After Party: May Edition, bringing the summer vibes to ALU students!\n\n🔥 Live Music & DJ\nDance all night to an electrifying mix of local and international beats.\n\n🍹 Food & Drinks\nEnjoy gourmet delights and refreshing cocktails that bring the summer heat.\n\n🎟️ Tickets:\n5K RWF (General Access)\n 10K RWF (5K consumable)\n\n\"Ikaze,\" meaning \"welcome\" in Kinyarwanda, invites you to an unforgettable evening of unity, self-expression, and good vibes. Don’t miss it!\n\n📅 Date: 09/052025\n📍 Location: Petit Suisse', 'Petit Suisse Lounge&Club', '[-1.958672,30.1144575]', '2025-05-09', '2025-05-09 19:00:07', '2025-05-10', '2025-05-10 01:00:07', 'https://www.sinc.events/ikaze-afte-898', 0, 2, 0, 'Upcoming'),
(832, 1282, 0, 10, '2025-05-06 10:00:18', 'Sinc', 'Happiness Day', 'https://dbmhau7o59w3r.cloudfront.net/1746523541214-file-DSC08771.jpg', 'Happiness Day at The Circle 🎉✨\n\nJoin us this Sunday for a special gathering dedicated to joy, connection, and celebrating mental well-being. Often, when we talk about mental health, we focus on struggles—this event is about embracing happiness and shared moments!\n\nWhat to expect:\n🎶 Live music & spoken word\n🎲 Fun games & friendly competitions\n💃 Dancing & meaningful conversations\n🍦 Drinks & ice cream\n♻️ Clothes exchange\n\n📍 Location: The Circle, Kacyiru\n⏰ Time: 3 PM!\n\nCome as you are and bring a friend! 💛', '108 KG 5 Ave', '[-1.9395847,30.0764114]', '2025-06-01', '2025-06-01 13:00:34', '2025-06-01', '2025-06-01 18:00:34', 'https://www.sinc.events/happiness-978-edition-2', 2, 1, 0, 'Upcoming'),
(833, 1283, 0, 10, '2025-05-06 11:00:12', 'Sinc', 'Yoga Session ( Beginners)', 'https://dbmhau7o59w3r.cloudfront.net/1746528314333-file-Yoga+with+Rose+Uwineza_+10th+May', 'Join us this Saturday for a healing yoga session with Rose 🧘🏾‍♀️\nReconnect with your body through gentle movement and breath.\nFacilitated in both Kinyarwanda & English for anyone who needs translation.\n🗓️ Saturday, May 10 | 🕙 10 AM\n📍 The Circle, 108 KG 5 Ave\n💛 Contribution: 5K donation\n', '108 KG 5 Ave', '[-1.9395043,30.0764202]', '2025-05-10', '2025-05-10 08:00:44', '2025-05-10', '2025-05-10 09:00:44', 'https://www.sinc.events/yoga-sessi-978', 0, 0, 0, 'Upcoming'),
